INSERT INTO marca (tipo, clase_internacional, distingue, id_marca) VALUES
('MP', 3, 'Cosmeticos, cremas cosmeticas, preparaciones cosmeticas para el cuidado de la piel, hisopos de algodon para uso cosmetico, kits de cosmeticos, mascarillas de belleza, parches de gel para los ojos con una finalidad cosmetica, aceites para uso cosmetico, lociones para uso cosmetico, leche limpiadora para el tocador, preparaciones de tocador, lociones para despues del afeitado, preparaciones para el afeitado, preparaciones bronceadoras cosmeticos, preparaciones de proteccion solar, desodorantes para seres humanos o para animales, dentifricos, jabon, sales de ba  o que no sean para uso medico, preparaciones para el ba  o que no sean para uso medico, preparaciones cosmeticas para ba  os, champus, acondicionadores para el cabello, lociones para el cabello, spray para el cabello, transfer decorativos para uso cosmetico, tatuajes temporales para el cuerpo y las u  as con una finalidad cosmetica, esmalte de u  as, recubrimiento de esmalte para el base coat (primer de u  as), recubrimiento de esmalte para el top coat (recubrimiento final), preparaciones para el cuidado de las u  as, quitaesmaltes de u  as, pegatinas para u  as, u  as falsas, preparaciones de maquillaje, lapices cosmeticos, base de maquillaje, aerosoles fijadores de maquillaje, polvo de maquillaje, productos de maquillaje dedicados al embellecimiento del cutis, bases de maquillaje, correctores cosmeticos, rubor, balsamos que no sean para uso medico, productos para el cuidado de los labios, balsamos labiales, delineadores de labios, brillos de labios, lapices de labios, estuches para lapices de labios, sombra para parpados, delineador de ojos, lapices de ojos, lapices de parpados, lapices de mejillas, preparaciones cosmeticas para pesta  as, mascara, pesta  as postizas, cosmeticos para cejas, kits de cejas, lapices de cejas, mascaras de cejas, compactos de polvo, rellenos, cartuchos y recambios para productos cosmeticos y productos de maquillaje, preparaciones desmaquillantes, agua micelar, pa  uelos impregnados con preparaciones desmaquillantes, algodon impregnado con preparaciones desmaquillantes, desmaquilladores de ojos, limpiadores para brochas cosmeticas, perfumeria, perfumes, agua de colonia, agua de tocador, difusores de lengueta de fragancia de aire, preparaciones aromatizantes del aire, incienso, bolsitas (saches) para perfumar la ropa, lustra zapatos, conservantes del cuero abrillantadores, cremas para cuero. (Productos nacionales yo extranjeros).', 1),
