INSERT INTO signo (tipo, nombre, descripcion, imagen, marca) VALUES 
('grafica', NULL, 'La etiqueta que se presenta a continuación consiste en la representación gráfica de un círculo de fondo color negro en cuyo interior se encuentra una flor con cuatro pétalos redondos en color blanco y en el centro un círculo de color negro. El fondo de la etiqueta es de color blanco. Se reivindica el conjunto descrito.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000136.jpg', 1),
('mixta', 'H HANNA', 'CONSISTE EN UNA ETIQUETA DONDE EN SU PARTE SUPERIOR SE OBSERVA UNA FIGURA CIRCULAR DE COLOR VERDE Y BORDE BLANCO Y VERDE,DENTRO SE APRECIA UNA LETRA H DE MANERA ESTILIZADA Y DE COLOR BLANCO, ALREDEDOR DE LA FIGURA CIRCULAR SE VEN UNAS ESPIGAS DE COLOR DORADO; DEBAJO DE TODO ESTO SE APRECIA LA PALABRA HANNA ESCRITA EN COLOR VERDE Y LETRAS ESTILIZADAS, SE REIVINDICA EL CONJUNTO DE TÉRMINOS Y COLORES DESCRITOS', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000161.jpg', 2),
('mixta', 'SINOCHEM', 'CONSISTE EN UNA ETIQUETA RECTANGULAR DE FONDO BLANCO EN LA QUE SE OBSERVAN LOS SIGUIENTES ELEMENTOS: EN EL CENTRO DEL LADO IZQUIERDO DEL CONJUNTO SE OBSERVA UNA FIGURA IRREGULAR QUE SE ASEMEJA A UNA FLOR DE CUATRO PÉTALOS DE COLOR AZUL OSCURO Y BORDES BLANCOS, LOS BORDES CONFORMAN A SU VEZ TRES FIGURAS OVALADAS DENTRO DE LOS PÉTALOS, QUE SON DE COLOR AZUL CLARO. DEL LADO DERECHO DEL CONJUNTO SE OBSERVAN DOS CARACTERES CHINOS (SINOGRAMAS) EN COLOR GRIS, LOS CUALES SIGNIFICAN ZHONG HUA, Y TRADUCIDOS AL CASTELLANO SIGNIFICAN ZHONG = MEDIO, HUA = CAMBIO. DEBAJO Y DE MENOR TAMAÑO SE LEE LA PALABRA DE FANTASÍA SINOCHEM ESCRITA EN LETRA MOLDE, CARACTERÍSTICA, MINÚSCULAS, DE TRAZO GRUESO Y DE COLOR GRIS. LA PALABRA SINOCHEM FORMA PARTE DE LA DENOMINACIÓN COMERCIAL DE MI MANDANTE. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000292.jpg', 3),
('denominativa', 'BROWNIE', NULL, NULL, 4),
('mixta', 'INDUSTRIAS JHOSDAM', 'ESTÁ CONFORMADA POR UNA FIGURA DE ELEMENTOS TRIANGULARES QUE SE ENTRELAZAN. EL COLOR DE LAS LINEAS ES EN NEGRO, Y BLANCO EL FONDO. DEBAJO DE LA FIGURA SE LEE LA PALABRA "INDUSTRIAS JHOSDAM". EL TERMINO "JHOSDAM" ES UNA CREACION DE FANTASÍA, NO TIENE TRADUCCIÒN.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000454.jpg', 5),
('denominativa', 'JNTL CONSUMER HEALTH', NULL, NULL, 6),
('grafica', NULL, 'La marca gráfica cuyo registro se solicita consiste en un rectángulo de color blanco dentro del cual se observan dos rectángulos horizontales y paralelos de longitudes variables por encima de un cuadrado y a la derecha de otro cuadrado, todas estas figuras geométricas se reproducen en color negro.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000488.jpg', 7),
('denominativa', 'OH MY DOG', NULL, NULL, 8),
('mixta', 'LAS IDEALES', 'CONSISTE EN LA REPRESENTACION GRAFICA DE LA PALABRA \"LAS IDEALES\" (PALABRA DE FANTASIA). ESCRITA AL INICIO EN MAYUSCULA SEGUIDA DE LETRAS MINUSCULAS DE FORMA CURSIVA, EN COLOR AMARILLO. SE CARACTERIZA EL TERMINO \"LAS\" POR ESTAS EN LA PARTE SUPERIOR Y SER DE MENOR TAMAÑO QUE LA ANTERIOR. DICHA DESCRIPCION SE ENCUENTRA EN UN OVALO DE COLOR AZUL OSCURO, BORDEADO EN COLOR ROJO. \"SE REIVINDICA LOS COLORES Y EL CONJUNTO DESCRITO\"', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000581.jpg', 9),
('mixta', 'RDA', 'FONDO NEGRO Y LETRAS BALNCAS EN MAYUSCULA', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000785.jpg', 10),
('mixta', 'AIR WILLSON W1', 'FONDO NEGRO CON LETRAS MAYUSCULAS BLANCAS Y GRISES', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022000786.jpg', 11),
('denominativa', 'GLAFF PHARMACEUTICALS', NULL, NULL, 12),
('mixta', 'CLÍNICAS CLEO', 'EL DISEÑO SOLICITADO CONSISTE EN UNA ETIQUETA RECTANGULAR SOBRE FONDO BLANCO, DONDE SE LEE EN LA PARTE SUPERIOR LA PALABRA “CLÍNICAS” EN LETRAS MAYUSCULAS DE TRAZO FINO Y DE COLOR DORADO, DEBAJO DE ESTA SE ENCUENTRA LA PALABRA “CLEO” LA CUAL SE ENCUENTRA EN LETRAS MAYÚSCULAS DE TRAZO FINO Y DE COLOR DORADO. DE LA VOCAL “E” DE LA PALABRA CLEO, SE DESPRENDE LA SILUETA DELICADA DE LA NARIZ Y BOCA DE UNA MUJER, LO CUAL EN SU CONJUNTO CON LAS PALABRAS ANTES DESCRITAS, SIMULAN EL ROSTRO FEMENINO DE COLOR DORADO Y DE TRAZOS FINOS. SE REIVINDICA EL DISEÑO SOLICITADO CON LOS COLORES DESCRITOS MÁS NO LOS TÉRMINOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001014.jpg', 13),
('denominativa', 'TIKTOK MUSIC', NULL, NULL, 14),
('mixta', 'A TE ENAMORA', 'CONSISTE EN UNA ETIQUETA CONFORMADA POR LA LETRA "A" CON TRAZOS GRUESOS DE COLOR AZUL MARINO Y EN DONDE SE DESTACAN EN SU SUPERFICIE UNA FIGURAS EN FORMA DE CORAZONES DE COLOR VERDE, AZUL CLARO, AMARILLO, VERDE Y ANARANJADO. EN EL LADO DERECHO SE MUESTRA UN CORAZÓN CON MAYOR PROPORCIÓN A LOS DEMÁS DE COLOR AZUL CLARO. EN LA PARTE INFERIOR LA MARCA TE ENAMORA TAMBIÉN DE COLOR AZUL OSCURO EN LETRA DE MOLDE CON TRAZOS DELGADOS. SE REVINDICAN LOS COLORES, FORMAS Y DISEÑOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001372.jpg', 15),
('mixta', 'TATO', 'La marca mixta cuyo registro se solicita está conformada por una etiqueta rectangular de color blanco dentro de la cual se observa la caricatura del personaje TATO (término de fantasía y nombre propio) representado por la figura fantasiosa de un Mono humanizado, vestido con un traje tipo safari, que cuelga con su mano derecha de una liana de color verde claro (Pantone 376 C) y con su mano izquierda sostiene unos binoculares de color negro a la altura de su cara. TATO presenta una expresión facial alegre, con la boca abierta, con expresión sonriente, dejando ver su lengua de color rojo. El personaje tiene el cabello de color rojo (Pantone 199C), sus orejas son prominentes, lleva puesto un sombrero típico de safari de color marrón claro (Pantone 134 C). El pelaje del cuerpo del mono es de color amarillo (Pantone 137 C), aunque el color de sus manos y rostro es de color marrón (Pantone 162 C). El personaje viste ropa típica de safari, camisa de botones de color marrón claro (Pantone 134 C), en la parte inferior de la camisa a la altura de la cintura se pueden apreciar dos bolsillos que se cierran con una solapa superior y un botón de color marrón, en la parte superior de los bolsillos antes descritos se puede apreciar un cinturón o correa de color verde claro (Pantone 376 C), debajo de la camisa tipo safari se deja ver una franela de color verde claro (Pantone 376 C), que termina a la altura de los codos del mono. TATO viste unos pantalones cortos o shorts, con la particularidad que tienen un dobladillo en la parte inferior, los pantalones se presentan igualmente de color marrón claro (Pantone 134 C) y calza unos zapatos deportivos de color marrón claro (Pantone 134C) y marrón oscuro, las trenzas del calzado son de color amarillo y la suela de color negro que acompaña con unas medias blancas. Se reivindica el conjunto descrito y los colores señalados conforme a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001438.jpg', 16),
('mixta', 'MURASAKI', 'CONSISTE FUNDAMENTALMENTE EN UNA ETIQUETA EN LA CUAL SE LEE LA PALABRA MURASAKI (QUE SE TRADUCE PURPURA) ESCRITA CON GRAFÍA CARACTERISTICA Y ESTILIZADA, EN COLOR NEGRO Y DE TRAZO GRUESO. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001447.jpg', 17),
('mixta', 'FRANCHETTI', 'EL DISEÑO SOLICITADO ESTA SOBRE UN FONDO BLANCO DONDE SE OBSERVA EN PRIMER PLANO UNA FIGURA GEOMÉTRICA RECTANGULAR DE MANERA VERTICAL DE TRAZO FINO DE COLOR NEGRO Y EN EL CENTRO DE LA FIGURA SE PALABRA FRANCHETTI (PARTE DEL APELLIDO DE ASCENDENTES DE PRIMERA GENERACIÓN, PERO TAMBIÉN SIGNIFICA SEGÚN GOOGLE FRANQUICIAS), ESCRITA EN MAYÚSCULA, EN LETRA DE MOLDE, DE TRAZO FINO Y DE COLOR NEGRO, DICHA PALABRA ESA SUPERPUESTA Y ATRAVESANDO LA FIGURA. EN LA PARTE SUPERIOR DE LA PALABRA SE OBSERVA UNA ESPIGA DE COLOR DORADO CON DOS TONALIDADES UNA CLARA Y OTRA OSCURA QUE SE ABRE PASO HACIA ARRIBA ABRIENDO EN EL MEDIO DE LA FIGURA GEOMÉTRICA UN ABERTURA. Y EN LA PARTE INFERIOR Y EN SU CENTRO DE LA FIGURA GEOMÉTRICA SE ABRE UN DE IGUAL FORMA UN ABERTURA. SE REIVINDICA EL DISEÑO SOLICITADO EN SU CONJUNTO CON LOS COLORES DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001457.jpg', 18),
('denominativa', 'OLANZATIQUE', NULL, NULL, 19),
('mixta', 'BUZA CREAM', 'SE OBSERVA UN CONO (ANARANJADO) DIVIDIDO POR UNA SERIE DE LINEAS TRANSVERSALES, EL HELADO DE COLOR BLANCO, CON PUNTOS DE COLORES VARIOS (ROJO VERDE, ANARANJADO, AZUL, MORADO) CON UNA CARICATURA DE ROSTRO SONRIENTE DELINEADO DE COLOR NEGRO CON SU LENGUA DE COLOR ROJO, TODO LO ANTES DESCRITO SE ENCUENTRA DENTRO DE UN CIRCULO DE FONDO COLOR AZUL OSCURO CON UNA SOBRE LINEA DE COLOR AZUL CLARO , EN LA PARTE CENTRAL OBSERVAMOS LA PALABRA "BUZA CREAM" (TRADUCCIÓN. BUZA: PALABRA DE FANTASÍA CREAM: CREMA) DE COLOR FUCSIA EN LETRAS ESTILO CURSIVA SIENDO LA LETRAS INICIALES B Y C EN MAYÚSCULA Y DE MAYOR TAMAÑO', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001503.jpg', 20),
('mixta', 'TOP IGNITION', 'EL DISEÑO SE DESCRIBE DE LA FORMA SIGUIENTE: EN PRIMERA INSTANCIA SE APRECIA UNA FIGURA ABSTRACTA, LA CUAL PARECE COMO LA FORMA DE UNA FLAMA O LLAMA DE FUEGO ENCENDIDO; EN LA CUAL SE OBSERVA COMO DOS LENGÜETAS ONDULANTES CON DIRECCIÓN HACIA ARRIBA. ESTA FIGURA O LLAMA ENCENDIDA VA ENCERRADA EN UN CÍRCULO, EL CUAL, ÉSTE NO SE CIERRA COMPLETAMENTE, PUES HAY UNA ABERTURA EN LA PARTE SUPERIOR EN DONDE SOBRE SALE LA PUNTA DE LA FLAMA DE LA LENGÜETA IZQUIERDA, QUE ES MÁS ALTA QUE LA DERECHA. TODO EL DIBUJO DESCRITO ESTÁ FORMADO POR TRAZOS MEDIANOS DE COLOR AMARILLO MOSTAZA O ANARANJADO OSCURO. DEBAJO DE ESTA FIGURA ABSTRACTA, SE PRESENTA ESCRITO EL SIGNO SOLICITADO "TOP IGNITION", TÉRMINOS DEL IDIOMA INGLÉS, QUE AMBOS TIENEN DIVERSAS ACEPCIONES. POR EJEMPLO "TOP", COMO ADJETIVO, PUEDE SIGNIFICAR SUPERIOR, MÁXIMO, TAMBIÉN MÁS ALTO, Y COMO SUSTANTIVO PODRÍA SER LA CIMA, LA TAPA, EL TOPE, LA CUMBRE, LA PARTE SUPERIOR, E INCLUSIVE COMO VERBO SE TRADUCE EN REMATAR. POR OTRO LADO, "IGNITION", ES UN SUSTANTIVO QUE TRADUCIDO AL ESPAÑOL SIGNIFICA IGNICIÓN, EL CUAL PUEDE SIGNIFICAR: ENCENDIDO. AHORA BIEN, EL SIGNO "TOP IGNITION" ESTÁ ESCRITO CON LETRAS DE TIPO IMPRENTA ARTÍSTICA MUY PARTICULAR. SE PRESENTAN TODAS ESCRITAS EN MAYÚSCULAS. ESTÁN FORMADAS POR UN TRAZO MEDIANO DEL MISMO COLOR DE LA FIGURA ABSTRACTA ANTES DESCRITA, ES DECIR, CON UN COLOR AMARILLO MOSTAZA O ANARANJADO OSCURO. TODO EL DISEÑO ESTÁ CONTENIDO EN UN FONDO DE COLOR BLANCO. SE REIVINDICA TODO SU CONTENIDO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001517.jpg', 21),
('denominativa', 'BIONTECH', NULL, NULL, 22),
('denominativa', 'BIONTECH', NULL, NULL, 23),
('grafica', NULL, 'Consiste en una etiqueta en la cual se observa un círculo de trazo grueso en color negro de fondo blanco y en su interior se observan tres figuras similares a unas horquillas en color negro, de trazo grueso con una terminación en punta similar a una flecha y las tres se encuentran superpuestas entre sí. La primera figura se encuentra orientada verticalmente con la punta en dirección al norte, mientras que las otras dos figuras se encuentran colocadas en forma perpendicular o inclinada estando la segunda figura orientada con la punta hacia el sureste y la tercera hacia el suroeste formando en el medio la figura de un hexágono de trazo grueso en color blanco. Se reivindica los colores y conjuntos descritos.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001584.jpg', 24),
('mixta', 'SOLINTEX', 'UN LOGOTIPO FORMADO POR TRES FIGURAS EN FORMA DE DIAMANTES DE COLORES AZUL OSCURO, NARANJA Y AZUL OSCURO NUEVAMENTE SUPERPUESTOS, SE REIVINDICA LOS COLORES AQUÍ DESCRITO PARA LA MARCA SOLICITADA ATRAVESADOS POR UN RECTÁNGULO DE FONDO BLANCO EN CUYO CENTRO SE ENCUENTRA UN CONJUNTO DE LETRAS QUE FORMAN LA PALABRA Y SE LEE SOLINTEX. EN NEGRO, SE REIVINDICA EL CONJUNTO ANTES DESCRITO ELIMINANDO LAS PALABRAS GENÉRICAS Y/O LOS TÉRMINOS GENÉRICOS QUE IMPIDAN EL REGISTRO PARA LA CLASE SOLICITADA', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001643.jpg', 25),
('denominativa', 'VENGRANO', NULL, NULL, 26),
('mixta', 'CAFÉ MORÁN', 'EL DISEÑO SE DESCRIBE DE LA FORMA SIGUIENTE: EN PRIMERA INSTANCIA SE APRECIA UNA FIGURA CUADRADA DE FONDO DE COLOR NEGRO. DENTRO DEL CUADRADO DE FONDO NEGRO, EN TODO SU CENTRO, SE PRESENTA UN CÍRCULO DE COLOR BLANCO, DE TRAZO GRUESO, EN DONDE SE PUEDE OBSERVAR QUE SU DELINEADO INTERIOR O LADO INTERNO ES LISO DE FORMA CONTINUA, MIENTRAS QUE SU DELINEADO EXTERIOR O LADO EXTERNO, SE PUEDE APRECIAR QUE ESTA FORMADO POR PEQUEÑAS ONDAS O SEMI PUNTAS CONTINUAS, QUE LO HACEN VER, COMO SI FUESE UN BORDADO QUE PARECE SER LA DE UNA MEDALLA. DENTRO DEL CÍRCULO BLANCO, SE APRECIA UN FONDO FORMADO POR DOS COLORES, EN FORMA DE DEGRADE O MOTEADO, PUES EN LA PARTE SUPERIOR SE VE UN MARRÓN MÁS OSCURO, MIENTRAS QUE EN LA PARTE BAJA SE OBSERVA UN MARRÓN MÁS CLARO. SOBRE LO QUE SE HA DETALLADO, EN TODA LA PARTE CENTRAL, EXTENDIÉNDOSE A TODO EL FONDO DEL CÍRCULO BLANCO; SE ENCUENTRA ESCRITO EL SIGNO SOLICITADO "CAFÉ MORÁN"; ESCRITO CON LETRAS DE TIPO CURSIVA, EN FORMA DE TÍTULO, ES DECIR, LA PRIMERA LETRA DE CADA PALABRA ES MAYÚSCULA Y LAS SIGUIENTES SON MINÚSCULAS. LAS LETRAS SON DE TRAZO MUY GRUESO Y DE COLOR ROJO, DELINEADO CON UN TRAZO FINO DE COLOR BLANCO. SE PRESENTA EN PRIMERA INSTANCIA, EL TÉRMINO "CAFÉ", TÉRMINO GENÉRICO Y DESCRIPTIVO QUE NO SE REIVINDICA EN EL DISEÑO. JUSTO DEBAJO DEL TÉRMINO "CAFÉ", SE PRESENTA EL TÉRMINO "MORÁN". SE OBSERVA QUE EL TAMAÑO DE LAS LETRAS DEL TÉRMINO "MORÁN", SON MUCHO MÁS ALTAS QUE LA DEL TÉRMINO "CAFÉ". TAL ES ASÍ, QUE LA PRIMERA LETRA DE LA PALABRA "MORÁN", EL TRAZO DEL EXTREMO IZQUIERDO DE LA LETRA "L" SOBRESALE DEL CÍRCULO BLANCO. SE OBSERVA UNA PARTICULARIDAD EN LA PALABRA "MORÁN", PUES LA VOCAL "O", ESTÁ REPRESENTADA POR UN GRANO DE CAFÉ, EL CUAL SE VE EN ALTO RELIEVE. NO SE REIVINDICA EL TÉRMINO "CAFÉ", POR LO ANTES EXPUESTO. POR LO DEMÁS, SE REIVINDICA TODO SU CONTENIDO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001810.jpg', 27),
('mixta', 'MORELLA', 'EL LOGO ESTÁ COMPUESTO POR LA PALABRA MORELLA PARTE DEL NOMBRE DE MI PERSONA, ESCRITA EN LETRAS DE MOLDE Y EN MAYÚSCULA DE TRAZO GRUESO DE COLOR NEGRO, DONDE SE EVIDENCIA EN LA CONSONANTE M, EN LA PARTE INFERIOR Y EN EL MEDIO, UN PEQUEÑO CÍRCULO O CIRCUNFERENCIA DE COLOR NEGRO, TODO SOBRE UN FONDO BLANCO. SE REIVINDICA EL DISEÑO SOLICITADO CON LOS COLORES DESCRITOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022001912.jpg', 28),
('denominativa', 'DICLODEX', NULL, NULL, 29),
('denominativa', 'LA FANÁTICA VINOTINTO', NULL, NULL, 30),
('mixta', 'GANDOUR', 'SE TRATA DE UNA ETIQUETA DE FONDO BLANCO DONDE SE APRECIA DOS CÍRCULOS DE TRAZO FINO EN COLOR AZUL UNO SUPERPUESTO ARRIBA DEL OTRO Y SIN TERMINAR, EN SU CENTRO SE PUEDE OBSERVAR LA FIGURA FANTASIOSA Y CARICATURALIZADA DE UN JOVEN CON CABELLO Y CEJAS MARRÓN, OJOS NEGROS, PIEL COLOR CARNE QUE PRESENTA UN BRAZO ALZADO, CARA SONRIENTE CON DIENTES SUPERIORES EN BLANCO, LENGUA EN ROJO, EL MISMO CONTIENE UN ESPECIE DE SOMBRA EN COLOR PIEL MAS CLARA EN EL ANTEBRAZO Y CUELLO, TERMINANDO CON UNA FRANELA EN COLOR AZUL; DEBAJO DEL MISMO SE PUEDE LEER LA PALABRA DE FANTASÍA QUE NO TIENE TRADUCCIÓN AL ESPAÑOL GANDOUR, ESCRITA EN LETRAS DE MOLDE TRAZO GRUESO EN FORMA CARACTERÍSTICA Y COLOR BLANCO, EN DONDE LAS LETRAS GAN CONTIENEN VARIAS PARTICULARIDADES YA QUE LAS LETRAS (G) Y (A) SON DE MAYOR TAMAÑO QUE LA LETRA (N), IGUALMENTE LA LETRA (A) NO PRESENTA EN SU PARTE CENTRAL LA LINEA VERTICAL PARA DARLE UNA APRECIACIÓN DIFERENTE, LAS TRES LETRAS ESTÁN COLOCADA MAS ARRIBA QUE LAS LETRAS DOUR, PARA DARLE UNA DISPOSICIÓN ESCALONADA, TAMBIÉN SE PUEDE NOTAR QUE LA LETRA (D) ESTA DIVIDIDA EN SU LADO IZQUIERDO, DENTRO DE LA LETRA (O) SE PUEDE APRECIAR UN CIRCULO DE COLOR BLANCO, LA LETRA (U) EN SU PARTE DERECHA ES DE MAYOR TAMAÑO, LA LETRA (R) SE PUEDE NOTAR QUE ESTA ESCRITA EN FORMA INCOMPLETA EN SU PARTE SUPERIOR IZQUIERDA; TODO LO DESCRITO SE ENCUENTRA DENTRO DE UN FONDO DE TRAZO GRUESO EN COLOR AZUL. SE REIVINDICA EL CONJUNTO DESCRITO ASÍ COMO LA COMBINACIÓN DE LOS COLORES.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002020.jpg', 31),
('mixta', 'TAWALA LEGIÓN', 'EL DISEÑO DE LA MARCA SE CARACTERIZA POR ESTAR COMPUESTO EN LA PARTE CENTRAL DEL DISEÑO POR EL TERMINO "TAWALA" EN LETRAS MAYÚSCULAS TIPO IMPRENTA DE COLOR ROJO CON BORDES DE COLOR BLANCO, EN LAS LETRAS "A" SE OBSERVA DOS FIGURAS CIRCULARES DE COLOR DORADO EN EL CENTRO DE CADA UNA, EL TERMINO DESCRITO SE ENCUENTRA DENTRO DE UNA FIGURA RECTANGULAR DE COLOR ROJO CUYOS BORDES SE ENCUENTRAN SEPARADOS POR PEQUEÑAS FIGURAS RECTANGULARES DE COLOR BLANCO, EN LA PARTE INFERIOR CENTRAL DE LA FIGURA SE ENCUENTRA LA EXPRESIÓN "LICOR DE RON" EN LETRAS MAYÚSCULAS TIPO IMPRENTA DE COLOR NEGRO CON UNA LIGERA SEPARACIÓN ENTRE ELLAS. EN LA PARTE INFERIOR DEL DISEÑO SE ENCUENTRA EL TERMINO "LEGIÓN" EN UNA GRAFÍA CURSIVA DE COLOR DORADO Y CON UNA LIGERA INCLINACIÓN DE IZQUIERDA A DERECHA, LA LETRA "L" SE ENCUENTRA EN MAYÚSCULA Y SE EXTIENDE POR DEBAJO DE LA LETRA "E" HASTA LLEGAR A LA LETRA "G". EN SU PARTE SUPERIOR CENTRAL SE ENCUENTRA UNA FIGURA IRREGULAR QUE ASEMEJA A UNA PERSONA QUE CARGA UNA LANZA SOBRE SU HOMBRO Y PORTA UN CASCO EN SU CABEZA SOBRE UN CABALLO DE COLOR NEGRO QUE MIRA HACIA EL LADO IZQUIERDO DEL DISEÑO, A AMBOS LADOS SE POSICIONAN DOS FIGURAS IRREGULARES QUE ASEMEJAN ESTRELLAS DE CINCO PUNTAS TAMBIÉN DE COLOR NEGRO, SEGUIDO DE LA EXPRESIÓN "SOURCING PREMIUM QUALITY" (ABASTECIMIENTO DE PRIMERA CALIDAD) EN LETRAS MAYÚSCULAS TIPO IMPRENTA DE COLOR AMARILLO, A AMBOS LADOS DEL TÉRMINO, SEGUIDAMENTE SE ENCUENTRAN DOS FIGURAS DE FORMA RECTANGULAR CON BORDES DE COLOR DORADO Y FONDO BLANCO UBICADAS EN LA PARTE CENTRAL IZQUIERDA. SOBRE EL CONJUNTO DESCRITO SE DISPONE LA EXPRESIÓN "OF LEGIONARY MEN" (DE LOS HOMBRES LEGIONARIOS) EN LETRAS MAYÚSCULAS TIPO IMPRENTA DE COLOR DORADO ENTRE DOS ARCOS DE COLOR ROJO, AL FINAL DEL ARCO MAS GRANDE SE SITÚAN DOS FIGURAS IRREGULARES DE COLOR DORADO, LIGERAMENTE INCLINADAS Y QUE PRESENTAN SEMICÍRCULOS DE COLOR BLANCO EN SU INTERIOR. LOS ELEMENTOS ANTERIORMENTE DESCRITOS SE OBSERVAN SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y NO LAS PALABRAS GENÉRICAS Y/O DE USO COMÚN UTILIZADAS SEPARADAMENTE.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002028.jpg', 32),
('mixta', 'PAPELONYA', 'PAPELONYÁ (LA PALABRA PAPELONYÁ LEYENDA GENÉRICA NO REIVINDICABLE) CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE LA PALABRA PAPELONYÁ (LA PALABRA PAPELONYÁ LEYENDA GENÉRICA NO REIVINDICABLE), DE TRAZO GRUESO, COLOR BLANCO CON BORDE AMARILLO Y VERDE. LAS LETRAS P, L, Y. ESCRITAS EN MAYÚSCULAS, EL RESTO EN MINÚSCULAS. EN LAS LETRAS P Y O, SE OBSERVA QUE TIENEN EL FONDO DE COLOR VERDE. LA ÚLTIMA LETRA A, VEMOS QUE SE ENCUENTRA ACENTUADA. TODO LO DESCRITO SOBRE UN FONDO BLANCO. SE REIVINDICA TODO EL CONJUNTO DESCRITO, ASÍ COMO LA COMBINACIÓN DE COLORES: BLANCO, VERDE Y AMARILLO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002044.jpg', 33),
('mixta', 'T', 'LA MARCA CONSISTE EN UNA ETIQUETA NO ENMARCADA DE TAMAÑO Y FORMA IRREGULAR EN LA QUE SE OBSERVAN CINCO PUNTOS EN FORMA DE LETRA T EN COLOR AZUL PANTONE 2386, TODO SOBRE FONDO BLANCO. LO ESENCIAL ES EL CONJUNTO DESCRITO TAL COMO SE EVIDENCIA EN LOS FACSÍMILES ANEXOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002118.jpg', 34),
