('denominativa', 'LA DEAR', NULL, NULL, 36),
('denominativa', 'UBAI', NULL, NULL, 37),
('mixta', 'POLAR SINCE 1941', 'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL EL CONJUNTO DENOMINATIVO “POLAR SINCE 1941” EN DOS NIVELES. EN EL PRIMER NIVEL, SE LEE LA PALABRA DE FANTASÍA “POLAR” EN LETRA DISPUESTA EN FORMA DE ARCO; EN LETRA TIPO MOLDE, EN MAYÚSCULAS, DONDE LA LETRA “P” ES DE MAYOR TAMAÑO QUE EL RESTO DE LAS LETRAS. TODA LA PALABRA ES DE COLOR NEGRO. EN LA PARTE INFERIOR DE LA PALABRA POLAR Y CENTRADA SE LEE LA FRASE “SINCE 1941”, QUE TRADUCIDO AL ESPAÑOL SIGNIFICA “DESDE 1941””; EN LETRA TIPO MOLDE, REDONDEADA, DONDE LA LETRA “S” SE OBSERVA EN MAYÚSCULA Y EL RESTO DE LAS LETRAS EN MINÚSCULAS; TODAS DE TRAZO MEDIO, DE COLOR NEGRO. TODO LO ANTERIOR SE ENCUENTRA DENTRO DE UNA FIGURA ASIMÉTRICA QUE RECORRE LOS BORDES DEL CONJUNTO ANTES DESCRITO; CON EL BORDE DE COLOR NEGRO DE TRAZO MEDIO. LO ANTERIOR SE OBSERVA SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACIÓN DE COLORES SEGÚN SE DESCRIBE. LA DESCRIPCIÓN DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002442.jpg', 38),
('denominativa', 'GRENDENE', NULL, NULL, 39),
('denominativa', 'RIOT GAMES', NULL, NULL, 40),
('mixta', 'NUTRI DELHI', 'ESTA FIGURA CONSISTE EN UNA PALABRA DE FANTASIA NUTRI DELHI, DONDE SE PUEDE OBSERVAR LA LETRA N SE ENCUENTRA EN MAYÚSCULA DE COLOR BLANCO CON UN FONDO DE COLOR AZUL QUE ESTÁ CUBRE LA MAYOR PARTE DE LA PALABRA NUTRI, ASI MISMO LA LETRA ESCRITA EN MAYÚSCULA IDENTIFICADA EN COLOR VERDE, LA LETRA E EN MINÚSCULA DE COLOR FUSCIA, LA LETRA L EN COLOR AMARILLO Y LA LETRA H DE IGUAL FORMA MINÚSCULA SE ENCUENTRA EN COLOR TURQUESA TODA ESTÁS LETRA CON FONDO BLANCO CON EL FIN QUE SE VEA EN RELIVE, IDENTICANDAS ESTAS LETRAS CON COLORES VIVOS QUE REPRESENTA LA ALEGRÍA DE NUESTROS ALIMENTOS', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002734.jpg', 41),
('mixta', 'LA SALLE', 'CONSISTE EN LA PALABRA LA DE COLOR AZUL, LA CUAL LA ACOMPAÑA UNA ESTRELLA CUYO BORDE ES GRUESO DE COLOR AMARILLO Y SU FONDO ES BLANCO. DICHA ESTRELLA ES DE CINCO PICOS EN LA QUE SE EVIDENCIA QUE LOS MISMOS SON DE DISTINTAS DIMENSIONES, SIENDO LOS PICOS SUPERIORES E INFERIORES MÁS GRANDES QUE LOS PIRCOS SUPERIORES E INFERIORES DERECHOS. AL LADO DE LA ESTRELLA CONTINÚA LA PALABRA SALLE EN COLOR AZUL. SE REIVINDICA TODO EL CONJUNTO DE ELEMENTOS ANTERIORMENTE DESCRITO A EXCEPCIÓN DE: LOS ELEMENTOS GENÉRICOS DESCRIPTIVOS, LOS PREVIAMENTE REGISTRADOS O LOS QUE NO PUEDAN SER OBJETO DE REGISTRO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022002792.jpg', 42),
('denominativa', 'ALKEGEN', NULL, NULL, 43),
('mixta', 'ARKEMA', 'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO, EN LA QUE SE LEE EN SU INTERIOR LA PALABRA DE FANTASÍA ARKEMA, ESCRITA EN LETRA MOLDE, CARACTERÍSTICA, FANTASIOSA, MAYÚSCULA, DE TRAZO MEDIO Y DE COLOR NEGRO. LA PALABRA DE FANTASÍA ARKEMA, FORMA PARTE DE LA DENOMINACIÓN COMERCIAL DE MI MANDANTE. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022003339.jpg', 44),
('denominativa', 'META PORTAL', NULL, NULL, 45),
('mixta', 'ALIMENTOS TRINIDAD', 'LA MARCA SOLICITADA ESTÁ FORMADA POR LA PALABRA \\\"TRINIDAD\\\" EN MINÚSCULAS COMPUESTA EN UNA TIPOGRAFÍA DE PALO SECO EN COLOR NEGRO Y SUBRAYADA CON UNA LÍNEA DE COLOR GRIS MEDIO, EN CUYO EXTREMO SUPERIOR IZQUIERDO SE UBICA UNA CINTA RIBETEADA DE COLOR GRIS MEDIO QUE CONTIENE LA PALABRA \\\"ALIMENTOS\\\" EN MAYÚSCULAS Y ESTÁ COMPUESTA EN UNA TIPOGRAFÍA DE PALO SECO EN COLOR BLANCO. AL EXTREMO SUPERIOR DERECHO SE MUESTRAN TRES ARCOS SEMICIRCULARES CONCÉNTRICOS DE GROSOR VARIABLE EN COLOR GRIS MEDIO QUE SIMULAN LA ENTRADA A UNA PROFUNDA GALERÍA ABOVEDADA. LA MARCA PUEDE TAMBIÉN UTILIZARSE CON TODOS SUS ELEMENTOS EN COLOR BLANCO CUANDO ESTA SE PRESENTE SOBRE UN FONDO OSCURO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022003383.jpg', 46),
('denominativa', 'VENEUSA', NULL, NULL, 47),
('mixta', 'ALIMENTOS VILLATERRA', 'ISOLOGO CONFORMADO POR UN FONDO DE COLOR BLANCO, EN EL QUE SE OBSERVA EN SU PARTE MEDIA CENTRAL INICIANDO DE IZQUIERDA A DERECHA A OJO DEL OBSERVADOR LA MITAD DE LA SILUETA DE UNA VIVIENDA QUE CONTIENE EN SU PARTE INTERNA TRES LINEAS CURVAS UBICADAS EN POSICIÓN VERTICAL CON UNA PEQUEÑA INCLINACIÓN, Y SIENDO ESTAS DE LOS SIGUIENTES TAMAÑOS; PEQUEÑA, MEDIA Y GRANDE. SOBRE ESTÁ ULTIMA SE UBICAN TRES LINEAS VERTICALES DE MISMO TAMAÑO Y GROSOR, CON TRES OVOIDES EN SUS PUNTAS. TODA LA SILUETA SE ENCUENTRA EN UN TONO COLOR ROJO Y SE VE INTERRUMPIDA EN SU PARTE DERECHA POR UNA LETRA "V" MAYÚSCULA SEGUIDA DE LAS LETRAS "I", "L", "L", "A", "T", "E", "R", "R", Y "A" FORMANDO ASÍ LA PALABRA "VILLATERRA" EN LETRA TIPO MOLDE Y OBSERVÁNDOSE UN TONO COLOR ROJO EN LAS LETRAS "V", "I", "L", "L", Y "A", Y UN TONO COLOR AZUL OSCURO EN LAS LETRAS "T", "E", "R", "R", Y "A". EN LA PARTE SUPERIOR IZQUIERDA DEL TÉRMINO SE ENCUENTRA ESCRITA EN LETRA CORRIDA DESTACANDO SU INICIAL EN MAYÚSCULA Y EL RESTO EN MINUSCULAS LA PALABRA "ALIMENTOS" EN UN TONO AZUL OSCURO Y GRAFÍA ESPECIAL. SE REIVINDICAN LOS COLORES DESCRITOS. NO SE REIVINDICAN LOS TÉRMINOS GENÉRICOS, COMUNES O DESCRIPTIVOS EN EL CONJUNTO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022003661.jpg', 48),
('mixta', 'LA CAVA EST.1995', 'EN EL CENTRO SE APRECIA UN CIRCULO DE TAMAÑO GRANDE EL CUAL ESTA CERRANDO UN SEGUNDO CIRCULO, DENTRO DE LA FIGURA SE APRECIA DEL LADO SUPERIOR E INFERIOR UNA ABERTURA EN EL CENTRO EN DELINEADO DE COLOR VERDE, EN EL CENTRO DE LA ESAS ABERTURA LA PALABRA ( L, A, C, A, V, A, ) TODO ELLO EN DELINEADO COLOR VERDE, LAS LETRAS ( L ) Y ( A ) ESTÁN JUSTO AL BORDE DE CADA LADO. LA LETRA ( L ) TIENE UN PUNTICO EN LA PARTE SUPERIOR, AL IGUAL QUE LA LETRA ( V ) EN LA PARTE SUPERIOR, DEBAJO DE LA PALABRA LA SIGUIENTES LETRAS Y NÚMEROS, (E, S, T, 1,9,9,5 ) ES UN JUEGO DE PALABRA TODAS EN COLOR VERDE. NO SE REIVINDICAN LAS LEYENDAS GENÉRICAS DESCRITAS, SE REIVINDICAN LOS COLORES Y CONJUNTOS DESCRIPTIVOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022003819.jpg', 49),
('denominativa', 'IDHEA STORE', NULL, NULL, 50),
('denominativa', 'FEMIVITAL', NULL, NULL, 51),
('denominativa', 'LA BONA', NULL, NULL, 52),
('mixta', 'ZONA ROSAL', 'LA ETIQUETA ESTA DISTINGUIDA POR UN CONJUNTO DE PALABRAS QUE SE LEEN: ZONA ROSAL; DISPUESTA EN LINEA RECTA, DENTRO DE UN MARCO COLOR GRIS. LA PALABRA ZONA ROSAL ESTA COMPUESTA POR UNA TIPOGRAFIA FRACCIOANDA CUYA COMPOSICION TIPOGRÁFICA SE DESCRIBE DE LA SIGUIENTE MANERA: LETRA Z ESCRITA EN TAMAÑO MAYUSCULA CON TIPOGRAFIA FRACCIONADA EN COLORES VERDE Y AZUL CLARO. LETRA O ESCRITA EN TAMAÑO MINUSCULA, CON TIPOGRAFIA FRACCIONADA GRIS. LETRA N ESCRITA EN TAMAÑO MINUSCULA, CON TIPOGRAFIA FRACCIONADA EN COLOR GRIS. LETRA A ESCRITA EN MINUSCULA CON TIPOGRAFIA FRACCIONADA GRIS. LETRA R ESCRITA EN TAMAÑO MAYUSCULA, CON TIPOGRAFIA FRACCIONADA EN COLORES ROJO Y AMARILLO. LETRA O ESCRITA EN TAMAÑO MINUSCULA, CON TIPOGRAFIA FRACCIONADA EN COLOR GRIS. LETRA S ESCRITA EN TAMAÑO MINUSCULA CON TIPOGRAFIA FRACCIONADA COLOR GRIS. LETRA A ESCRITA EN TAMAÑO MINUSCULA CON TIPOGRAFIA FRACCIONADA EN COLOR GRIS. LETRA L ESCRITA EN TAMAÑO MINUSCULA EN COLOR AZUL CLARO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004053.jpg', 53),
('mixta', 'R', 'EL DISEÑO DE LA MARCA EN CUESTIÓN ESTÁ COMPUESTO POR LA LETRA "R", LA CUAL SE OBSERVA EN MAYÚSCULAS, EN UNA GRAFÍA ESPECIAL Y CARACTERÍSTICA, DE COLOR NEGRO, CUYO LADO INFERIOR DERECHO SE OBSERVA PROYECTADO HACIA LA DERECHA Y SE DESTACA MÁS GRUESO QUE EL RESTO DE LA LETRA. EN EL ESPACIO INFERIOR DE LA LETRA, COMPRENDIDO ENTRE LOS EXTREMOS INFERIORES DE LA MISMA, PUEDE OBSERVARSE UN TRIÁNGULO RECTÁNGULO PLASMADO EN COLOR VERDE AGUAMARINA. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004216.jpg', 54),
('mixta', 'R', 'EL DISEÑO DE LA MARCA EN CUESTIÓN ESTÁ COMPUESTO POR LA LETRA "R", LA CUAL SE OBSERVA EN MAYÚSCULAS, EN UNA GRAFÍA ESPECIAL Y CARACTERÍSTICA, DE COLOR NEGRO, CUYO LADO INFERIOR DERECHO SE OBSERVA PROYECTADO HACIA LA DERECHA Y SE DESTACA MÁS GRUESO QUE EL RESTO DE LA LETRA. EN EL ESPACIO INFERIOR DE LA LETRA, COMPRENDIDO ENTRE LOS EXTREMOS INFERIORES DE LA MISMA, PUEDE OBSERVARSE UN TRIÁNGULO RECTÁNGULO PLASMADO EN COLOR VERDE AGUAMARINA. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004218.jpg', 55),
('mixta', 'RIDERY', 'EL DISEÑO DE LA MARCA ESTÁ COMPUESTO POR EL TÉRMINO RIDERY (PASEO), PLASMADO EN UNA GRAFÍA TIPO IMPRENTA, EN LETRAS MINÚSCULAS DE COLOR NEGRO, EXCEPTUANDO SU PRIMERA LETRA "R", LA CUAL SE OBSERVA EN MAYÚSCULAS, EN UNA GRAFÍA ESPECIAL Y CARACTERÍSTICA DE COLOR NEGRO, CUYO LADO INFERIOR DERECHO SE OBSERVA PROYECTADO HACIA LA DERECHA Y SE DESTACA MÁS GRUESO QUE EL RESTO DE LA LETRA. EN EL ESPACIO INFERIOR DE LA LETRA, COMPRENDIDO ENTRE LOS EXTREMOS INFERIORES DE LA MISMA, PUEDE OBSERVARSE UN TRIÁNGULO RECTÁNGULO PLASMADO EN COLOR VERDE AGUAMARINA. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004219.jpg', 56),
('mixta', 'BAO BAO', 'CONSISTE EN LA REPRESENTACION GRAFIVA DE UN NIÑO CARICATURIZADO CON ABUNDANTE CABELLO, Q UIEN LLEVA UN PAÑAL COLOCADO Y UNA TOALLA EN FORMA DE CAPA COMO DE SUPER HEROE. EL NIÑO ESTA DESPROVISTO DE VESTIMANTA Y SE MUESTRA CON LA MANO DERECHA COLOCADA EN SU CINTURA Y CON LA MANO IZQUIERDA EN FORMA DE SALUDO. SU MIRADA ESTA ENFOCADA AL CENTRO. EL COLOR DE LA LINEA ES DE COLOR AZUL, EL CUAL SE REIVINDICA. SU CABELLO TAMBIEN ES DE COLOR AZUL ASI COMO LA SOMBRA QUE PROYECTA DEBAJO DE LA FIGURA DEL NIÑO,EL COLOR EN ESTOS ELEMENTOS SE REIVINDICA.EN LA PARTE I NFERIOR DE LA FIGURA SE PUEDE LEER LA FRASE BAO BAO QUE EN IDIOMA CHINO SE TRADUCE COMO "BEBE". DICHA FRASE ESTA DESCRITA EN COLOR NEGRO EL CUAL SE REIVINDICA Y EN LATRAS CURSIVAS INCLINADAS UN POCA HACIA EL LADO DERECHO Y CON LA LATRA INICIAL DE CADA PALABRA EN LETRA MAYUSCULA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004226.jpg', 57),
('mixta', 'TSINGYUAN', 'CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE LA PALABRA DE FANTASÍA ‶TSINGYUAN″ (SIN TRADUCCIÓN EN EL IDIOMA CASTELLANO), ESCRITA EN LETRAS DE MOLDE LIGERAMENTE ESTILIZADAS DE COLOR NEGRO SOBRE FONDO BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD, SIN REIVINDICAR NINGÚN ELEMENTO QUE EN FORMA AISLADA PUDIERA SER CONSIDERADO COMO GENÉRICO O DESCRIPTIVO EN LA CLASE SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004236.jpg', 58),
('mixta', 'PITAPOLLO', 'SE OBSERVA LA PALABRA PITAPOLLO, (FANTASÍA), ESCRITA EN LETRAS MINÚSCULAS DE TRAZO GRUESO Y COLOR BLANCO, SOBRE UN FONDO ROJO CON BORDE NARANJA, QUE LE DA SILUETA A TODAS LAS LETRAS, DE LAS CUALES, LA "P" Y LA "A", QUEDAN CARACTERISTICAMENTE ABIERTAS.SOBRE LA PALABRA SE DISTINGUE CLARAMENTE UNA FIGURA DE FONDO BLANCO QUE ASEMEJA UNA CABEZA DE AVE, DE CONTORNO ROJO Y NARANJA, DENTRO DEL CUAL SE REVELAN HACIA AFUERA, DOS CÍRCULOS, COMO ÓRBITAS DE OJOS DE BORDE ROJO Y COLOR BLANCO, CON UN PUNTO O IRIS NEGRO. UN PICO AMARILLO EN FORMA DE "V" Y UNA CRESTA DE COLOR ROJO COMPUESTA DE TRES SECCIONES EN FORMA DE PÉTALOS.SE REINVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004260.jpg', 59),
('mixta', 'ICC', 'CONSISTE EN LAS SIGLAS ¨ICC¨ DE LA FIRMA PETICIONARIA, EN LETRAS DE TIPO MOLDE, DE TRAZO GRUESO, DE COLOR NEGRO, EN MAYUSCULAS, SEGUIDAS POR UNA LINEA DISPUESTA VERTICALMENTE EN COLOR AZUL, SEGUIDAS POR DOS SEGMENTOS CURVILINEOS CONCAVOS TAMIEN DE COLOR AZUL, CON ABERTURA A LA DERECHA, EL PRIMER SEGMENTO MAS ABIERTO QUE EL SEGUNDO, LOS TRES SEGMENTOS EN SU CONJUNTO, IDEALIZAN LAS LETRAS ¨ICC¨. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022004765.jpg', 60),
('denominativa', 'WALGREENS', NULL, NULL, 61),
('denominativa', 'CARBAXIN', NULL, NULL, 62),
('mixta', 'OSTWINT PROFESSIONAL', 'CONSISTE EN LA PALABRA OSTWINT (PROVIENE DEL IDIOMA ALEMÁN Y TRADUCE: INVIERNO DEL ESTE) ESCRITA EN LETRA DE IMPRENTA, MINÚSCULA, TRAZO GRUESO. CON LA PARTICULARIDAD DE QUE LA O EN SU PARTE INFERIOR IZQUIERDA ESTÁ MÁS PRONUNCIADA Y PUNTIAGUDA. DEBAJO Y EN MENOR DIMENSIÓN SE LEE: PROFESSIONAL (PROVIENE DEL IDIOMA INGLÉS Y TRADUCE: PROFESIONAL) ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE MENOR DIMENSIÓN Y DE TRAZO FINO. TODO EL CONJUNTO DESCRITO ES DE COLOR NEGRO. SE REIVINDICA EL CONJUNTO COMO UN TODO, NO SUS PARTES AISLADAS, NI LOS TÉRMINOS GENÉRICOS O DESCRIPTIVOS POR SÍ SOLOS CONSIDERADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022005313.jpg', 63),
('denominativa', 'RESVELDEN', NULL, NULL, 64),
('mixta', 'GOSSIP', 'EL SIGNO QUE SE PRESENTA A CONTINUACIÓN SE ENCUENTRA CONFORMADO POR LA PALABRA EN INGLÉS "GOSSIP", QUE TRADUCIDA AL IDIOMA CASTELLANO SIGNIFICA "CHISME, COTILLEO", ESCRITA EN LETRAS MINÚSCULAS, A EXCEPCIÓN DE LA "G" INICIAL, LA CUAL, ESTÁ ESCRITA EN MAYÚSCULA, CORRIDAS, CURSIVAS, DE COLOR BEIGE, TRAZOS GRUESOS, CON UNA TIPOGRAFÍA ESPECIAL, POSICIONADAS DE FORMA HORIZONTAL, SOBRE UN FONDO DE GRIS OSCURO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NINGÚN ELEMENTO QUE EN FORMA AISLADA PUEDA SER CONSIDERADO GENÉRICO O DESCRIPTIVO EN LA CLASE SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022005383.jpg', 65),
('mixta', 'METAFRAX GROUP', 'LA ETIQUETA CONSISTE EN UN ELEMENTO FIGURATIVO QUE SE REPRESENTA COMO UNA IMAGEN ESTILIZADA DE UN CÍRCULO INCLINADO HACIA LA IZQUIERDA Y DIVIDIDO EN SU INTERIOR POR LÍNEAS, DESDE LÍNEAS LARGAS, DE COLOR MORADO, EN EL CENTRO, HASTA LÍNEAS MÁS PEQUEÑAS EN LOS BORDES, TAMBIÉN DE COLOR MORADO. EN LA PARTE INFERIOR DERECHA DEL ELEMENTO DE LA IMAGEN APARECE LA PALABRA «METAFRAX GROUP», QUE ESTA CONFORMADO POR LA PALABRA DE FANTASÍA «METAFRAX», LA CUAL, NO POSEE TRADUCCIÓN ALGUNA AL IDIOMA CASTELLANO NI TIENE UN SIGNIFICADO ESPECÍFICO EN EL COMERCIO O LA INDUSTRIA PERTINENTE, O APLICADA A LOS PRODUCTOS O SERVICIOS ENUMERADOS EN LA SOLICITUD. ASIMISMO, DEBAJO DE LA PALABRA DE FANTASÍA, SE APRECIA LA PALABRA EN INGLÉS «GROUP», EL CUAL SE TRADUCE AL IDIOMA CASTELLANO COMO «GRUPO». TODO EL CONJUNTO SE ENCUENTRA SOBRE FONDO BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NINGÚN ELEMENTO QUE EN FORMA AISLADA PUEDA SER CONSIDERADO GENÉRICO O DESCRIPTIVO EN LA CLASE SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022005555.jpg', 66),
('denominativa', 'ARIZI', NULL, NULL, 67),
('denominativa', 'DULCOXUNI', NULL, NULL, 68),
('mixta', 'FOODKART', 'CONSISTE EN LA PALABRA FOODKART (PROVIENE DEL NOMBRE DEL SOLICITANTE; FOOD DEL IDIOMA INGLÉS Y TRADUCE: COMIDA) ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA. FOOD DE TRAZO FINO Y COLOR NEGRO, CON LA PARTICULARIDAD DE QUE EN LA SEGUNDA O SE APRECIA LA REPRESENTACIÓN GRÁFICA DE UN KILOMETRAJE Y EN SU PARTE SUPERIOR LA SILUETA DE LLAMAS DE FUEGO DE 5 PUNTAS. KART: DE MAYOR DIMENSIÓN, TRAZO FINO, COLOR BLANCO Y DOBLE BORDE, UNO INTERNO Y OTRO EXTERNO DE TRAZO GRUESO Y COLOR NEGRO. SE REIVINDICA EL CONJUNTO COMO UN TODO, NO SUS PARTES AISLADAS, NI LOS TÉRMINOS GENÉRICOS O DESCRIPTIVOS POR SÍ SOLOS CONSIDERADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022005749.jpg', 69),
('denominativa', 'REELS', NULL, NULL, 70),
('denominativa', 'REGINA BY EC', NULL, NULL, 71),
('mixta', 'GALLETAS PUIG CRASKÍ BRAN', 'DESCRIPCIÓN DE LA ETIQUETA GALLETAS PUIG CRASKÍ BRAN (LA PALABRA GALLETAS LEYENDA GENÉRICA NO REIVINDICABLE) CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE UN CUADRADO, CON EL FONDO DE COLOR MARRÓN. A SU VEZ SE OBSERVAN LÍNEAS DIAGONALES, DE TRAZO FINO, BLANCAS Y MARRONES. ÉSTAS HACIA EL LADO IZQUIERDO. DEL LADO IZQUIERDO SE VE UN CÍRCULO CON EL FONDO DE COLOR BLANCO, EL BORDE DE COLOR ROJO Y BLANCO ALREDEDOR DE DICHO CÍRCULO, DENTRO SE LEE GALLETAS PUIG, (LA PALABRA GALLETAS LEYENDA GENÉRICA NO REIVINDICABLE) DE TRAZO MEDIO Y GRUESO, DE COLOR ROJO, LA PALABRA GALLETAS, SE CARACTERIZA POR EMPEZAR CON LETRA DE TAMAÑO NORMAL, CONTINUA CON LETRAS ALTAS Y FINALIZA CON LETRA DE TAMAÑO NORMAL, LA PALABRA PUIG, DE TRAZO GRUESO, DE COLOR ROJO, SE CARACTERIZA POR EMPEZAR CON LETRA DE TAMAÑO NORMAL, CONTINUA CON LETRAS ALTAS Y FINALIZA CON LETRA DE TAMAÑO NORMAL. LUEGO SE LEE CRASKÍ BRAN. LA PALABRA CRASKÍ, DE TRAZO GRUESO, COLOR BLANCO CON SOMBREADO ROJO Y ANARANJADO, ESCRITA LA LETRA C EN MAYÚSCULA, EL RESTO EN MINÚSCULA, SE OBSERVA QUE LA LETRA I ESTÁ ACENTUADA Y SE CARACTERIZA POR SER DE GRAN TAMAÑO. DEBAJO EN LA PARTE INFERIOR DERECHA, SE LEE LA PALABRA BRAN, DE TRAZO GRUESO, COLOR MARRÓN CON BORDE BLANCO, ESCRITA EN MAYÚSCULA. ENTRE LAS DOS PALABRAS ANTES DESCRITA SE OBSERVA LA FIGURA DE UNA RAMA DE TRIGO, DE COLOR AMARILLO. SE REIVINDICA EL CONJUNTO DESCRITO, ASÍ COMO LA COMBINACIÓN DE LOS COLORES: ROJO, BLANCO, ANARANJADO, MARRÓN Y AMARILLO. EXCEPTO LA PALABRA GENÉRICA GALLETAS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022005969.jpg', 72),
('mixta', 'CONFITERIA LA GUACAMAYA', 'SE TRATA DE UNA ETIQUETA DE FONDO BLANCO DONDE SE LEE LA PALABRA CONFITERÍA ESCRITA EN LETRAS DE TRAZO GRUESO EN CURSIVA Y DE COLOR AMARILLO CON BORDES FINOS EN COLOR NARANJA, DONDE LA LETRA (C) ESTÁ ESCRITA EN MAYÚSCULA Y EL RESTO EN MINÚSCULA, DICHO TERMINO ESTÁ COLOCADO EN SEMI ARCO DE FORMA DESCENDENTE, EN SU PARTE CENTRAL SE PUEDE APRECIAR LA FIGURA CARICATURESCA DE UNA GUACAMAYA EN COLOR AZUL, UNA FIGURA SEMI CIRCULAR EN SU CARA EN COLOR GRIS CLARO, SU OJO ESTÁ COMPUESTO POR UN CIRCULO DE BORDE EN NEGRO, FONDO BLANCO, CELESTE, NEGRO CON UN PEQUEÑO SEMI CIRCULO Y ONDA EN ESPECIE DE SOMBRA EN COLOR BLANCO, SU PICO ES DE COLOR GRIS OSCURO CON DELINEADO EN ESPECIE DE SOMBRA EN COLOR BLANCO, LA PARTE INFERIOR DE SU PICO ESTÁ COMPUESTA POR SU LENGUA EN COLOR ROJO, EL FONDO EN COLOR NEGRO Y LA PARTE EXTERIOR EN COLOR GRIS OSCURO DEGRADÁNDOSE HASTA LLEGAR EN COLOR BLANCO, LAS ALAS PRESENTAN SECCIONES EN COLOR AMARILLO, SU COLA CONTIENE DOS LÍNEAS ONDULADAS EN FORMA DE SOMBRA Y COLOR BLANCO, SUS PATAS SON DE COLOR NARANJA CLARO, DICHA FIGURA DE LA GUACAMAYA ESTA POSADA SOBRE UNA ESPECIE DE LÍNEA EN FORMA DE ONDA EN COLOR AMARILLO Y NARANJA; DEBAJO SE PUEDE LEER LA PALABRA LA GUACAMAYA ESCRITA EN LETRAS DE TRAZO GRUESO EN CURSIVA Y DE COLOR AMARILLO CON BORDES FINOS EN COLOR NARANJA, DONDE LA LETRA (L) ESTÁ ESCRITA EN MAYÚSCULA Y EL RESTO EN MINÚSCULA, DICHO TERMINO ESTÁ COLOCADO EN FORMA DE SEMI ARCO ASCENDENTE Y LAS LETRAS VAN CAMBIANDO DE MENOR TAMAÑO A MAYOR TAMAÑO A MEDIDA QUE SE TERMINA EL ARCO. SE REIVINDICAN LOS COLORES DESCRITOS; NO SE REIVINDICA EL TÉRMINO GENÉRICO CONFITERÍA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022006045.jpg', 73),
('mixta', 'PLANETA DULCE', 'SE TRATA DE UNA ETIQUETA DE FONDO AZUL OSCURO DONDE SE LEE LA PALABRA DE FANTASÍA PLANETA DULCE ESCRITA EN LETRAS DE MOLDE DE TRAZO GRUESO Y COLOR BLANCO DONDE LAS LETRAS (P) Y (D) ESTÁN EN MAYÚSCULAS Y EL RESTO EN MINÚSCULAS, DICHO TERMINO PRESENTA UN BORDE EN COLOR AZUL OSCURO Y FUCSIA, TANTO EN SU LADO DERECHO COMO IZQUIERDO SE PUEDEN APRECIAR DOS FIGURAS EN FORMA DE ONDA UNA EN COLOR AZUL HASTA LLEGAR A UN DEGRADE EN COLOR VIOLETA CLARO Y EL OTRO EN COLOR FUCSIA; EN LA PARTE DE ARRIBA SE NOTAN LAS FIGURAS FANTASIOSAS DE CUATRO CHUPETAS, UNA DE COLOR AMARILLO OSCURO, UNA EN COLOR FUCSIA, OTRA EN COLOR ROJO Y LA ULTIMA EN COLOR VERDE, TODAS CONTIENEN UN PALITO EN COLOR BLANCO CON BORDES EN AMARILLO IGUALMENTE PRESENTAN EN LA BASE DEL PALITO UNA ESPECIE DE SOMBRA QUE SE EXTIENDE HACIA ABAJO CONVIRTIÉNDOSE EN UNA LÍNEA MUY DELGADA EN COLOR GRIS, LAS FIGURAS DE LAS CHUPETAS CONTIENEN EN SU CENTRO UNA FRANJA DE TRAZO GRUESO EN FORMA DE RELIEVE DANDO UNA SENSACIÓN DE PROFUNDIDAD A DICHAS FIGURAS; TAMBIÉN SE PUEDEN APRECIAR CINCO FIGURAS EN FORMA DE ESTRELLAS DE CUATRO PUNTAS EN COLOR BLANCO, ASÍ COMO TAMBIÉN DOS FIGURAS EN FORMA DE CÍRCULOS PEQUEÑOS EN COLOR NARANJA. SE REIVINDICAN LOS COLORES DESCRITOS, NO SE REIVINDICAN LOS TÉRMINOS GENÉRICOS QUE PUEDE CONTENER LA MARCA SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022006051.jpg', 74),
('grafica', NULL, 'CONSISTE LA MARCA EN LA REPRESENTACIÓN GRÁFICA DE TRES FIGURAS LINEALES CON TRAZOS IRREGULARES HORIZONTALES Y VERTICALES EN COLOR NEGRO. LO ESENCIAL DE LA MARCA LO CONSTITUYE EL CONJUNTO DESCRITO. SE REIVINDICA EL COLOR NEGRO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022006130.jpg', 75),
('denominativa', '¡LOS DE LA CAJITA AZUL!', NULL, NULL, 76),
('mixta', 'POMPOSSO', 'EL SIGNO SE ENCUENTRA COMPUESTO POR UNA FIGURA CUADRADA DE COLOR BLANCO; EN LA PARTE CENTRAL, SE OBSERVA LA PALABRA POMPOSSO, ESCRITA EN LETRAS DE MOLDE, DE TRAZO GRUESO EN COLOR MORADO, ENCIMA DE LA LETRA O SE OBSERVA UNA FIGURA COMPUESTA POR TRES HOJAS EN COLOR AMARILLO MOSTAZA LIGERAMENTE INCLINADA A LA DERECHA. POMPOSSO PALABRA DE FANTASÍA QUE NO TIENE TRADUCCIÓN AL ESPAÑOL. SE REIVINDICA EL CONJUNTO DESCRITO; NO SE REIVINDICAN LOS TÉRMINOS GENÉRICOS NI DESCRIPTIVOS', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022006518.jpg', 77),
('mixta', 'PITAHAYA MEDIA MARKETING', 'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN LA QUE SE OBSERVA UNA FIGURA EN FORMA DE GOTA, DE COLOR ROSADO OSCURO, LA CUAL SE ASEMEJA A UNA FRUTA. EN SU PARTE INTERNA, INFERIOR IZQUIERDA, SE ENCUENTRA UN SEMICÍRCULO, DE TAMAÑO MEDIANO, DE COLOR ROSA CLARO. EN LA PARTE SUPERIOR EXTERNA DE LA FIGURA ANTES DESCRITA, ENCONTRAMOS UNAS LÍNEAS GRUESAS, DE COLOR VERDE, LAS CUALES DESCIENDEN DE MANERA CURVADA. DEBAJO DE LA FIGURA DESCRITA SE LEE LA PALABRA PITAHAYA, ESCRITA EN UN GRAFISMO ESPECIAL, CARACTERÍSTICA, DE TRAZO FINO, MAYÚSCULAS, DE COLOR NEGRO Y DEBAJO DE ESTA PALABRA SE LEE LA FRASE MEDIA MARKETING, ESCRITA EN LETRA ESTILIZADA, CARACTERÍSTICA, DE TRAZO FINO, MAYÚSCULAS Y DE COLOR VERDE, PALABRAS QUE TRADUCIDAS AL CASTELLANO SIGNIFICAN MEDIA = MEDIOS, MARKETING =MERCADEO. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022006639.jpg', 78),
('denominativa', 'DON LUCIANO', NULL, NULL, 79),
('mixta', 'MEDFALCH', 'EN LA ETIQUETA SE PUEDE OBSERVAR LO QUE APARENTA SER EL SÍMBOLO MEDICO DE UNA FORMA CARICATURESCA Y EN LA PARTE SUPERIOR TANTO DEL LADO DERECHO COMO DEL LADO IZQUIERDO SE OBSERVA LO QUE APARENTA SER UNAS HOJAS DE COLOR VERDE Y EN EL CENTRO UNA LINEA CURVA DE COLOR BLANCO, LA VARA CENTRAL ES DE COLOR AZUL CLARO Y TIENE EN SU PARTE SUPERIOR UNA CONCHA MARINA DE MENOR TAMAÑO DELINEADA EN COLOR AZUL CLARO Y FONDO BLANCO, ENROSCADA EN LA VARA SE OBSERVA UNA CULEBRA DE COLOR NEGRA DEBAJO DEL GRÁFICO ANTES DESCRITO SE OBSERVA LA PALABRA DE FANTASÍA MEDFALCH (SIN TRADUCCIÓN) EN LETRAS CARACTERÍSTICAS DE COLOR NEGRO DONDE LAS LETRAS M Y F SE ENCUENTRA EN LETRA MAYÚSCULA Y EL RESTO EN MINÚSCULA. SE REIVINDICA EL CONJUNTO DESCRITO, INCLUYENDO LOS COLORES Y LA DISPOSICIÓN DE ELEMENTOS EN EL.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022007064.jpg', 80),
('denominativa', 'INSPIRE GREATNESS', NULL, NULL, 81),
('mixta', 'BIOZTRONICS', 'Consiste en una etiqueta de fondo de color blanco sobre el cual se observa un robot con tonalidades verdes con un rectángulo azul en donde se ubicaran los ojos y la sonrisa del robot las cuales son de color verde. Debajo del robot se encuentra la palabra BIOZTRONICS escrita en letras características mayúsculas. La Palabra BIO Significa vida, se le agrega la letra Z que corresponde a la inicial del nombre de la madre del fundador, seguido se agrega la palabra TRONICS que es el diminutivo de electronics que es una palabra del idioma ingles que traducido al español significa “Electronica”. En la palabra Bioztronics se observan tres tonos de colores, se remplazan las dos “O” que posee la palabra por círculos en color verde, la B, I y la Z están en color azul marino y en negrita, luego las letras T, R, N, I, C, y la S se encuentran en color gris. Debajo de la palabra BIOZTRONICS y tocando las dos O que se encuentran en el texto se consigue una línea curva que hace alusión a una sonrisa debajo de la palabra.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022007277.jpg', 82),
('denominativa', 'METAONE', NULL, NULL, 83),
('denominativa', 'SIKASCREED', NULL, NULL, 84),
('denominativa', 'CESAR SHOES', NULL, NULL, 85),
('mixta', 'LOS ROSALES', 'SE APRECIA UN LOGOTIPO CON EL FONDO DE COLOR BLANCO, EN EL CENTRO LA PALABRA (LOS ROSALES) EN COLOR ROJO LAS LETRAS Y LIGERAMENTE INCLINADA, TENIENDO LAS TRES PRIMERAS LETRAS ( L,O,S ) EN MINÚSCULA, CON UNA SEPARACIÓN DE LA SILUETA DE ABAJO. LAS LETRAS (R,L) SON MÁS GRANDE QUE EL RESTO DE LAS LETRAS (O,S,A,E,S), LA LETRA ( E ) TIENE EN LA PARTE DE ARRIBA, UNA FIGURA QUE ASEMEJA A UNA CORONA, CON CINCO PUNTAS, EN COLOR VERDE. EN LA PARTE DE ABAJO UNA SILUETA EN FORMA DE ARCO CON CINCO NIVELES EN COLOR VERDE DE MAYOR A MENOR Y CON LA SEPARACIÓN DE LOS NIVELES EN COLOR BLANCO.NO SE REIVINDICAN LAS LEYENDAS GENÉRICAS DESCRITAS, SE REIVINDICAN LOS COLORES Y CONJUNTOS DESCRIPTIVOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008083.jpg', 86),
('mixta', 'PINK SILVER', 'ESTÁ COMPUESTA POR UNA ETIQUETA DE FONDO BLANCO DONDE SE LEE LA PALABRA PINK SILVER, (SIGNIFICA ROSA PLATA), ESCRITA EN LETRA DE MOLDE Y EN FORMA DE CALIGRAFÍA, EN MAYÚSCULAS LAS CONSONANTE P – S Y EL RESTO EN MINÚSCULAS DE COLOR NEGRO DE TRAZO FINO. SE REIVINDICA EL DISEÑO SOLICITADO EN SU CONJUNTO CON LOS COLORES DESCRITO MAS NO LOS TÉRMINOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008198.jpg', 87),
('mixta', 'TELLUS POWER', 'EL SIGNO QUE SE PRESENTA A CONTINUACIÓN SE ENCUENTRA CONFORMADO POR LA PALABRA DE FANTASÍA «TELLUS», LA CUAL, NO POSEE TRADUCCIÓN ALGUNA AL IDIOMA CASTELLANO NI TIENE UN SIGNIFICADO ESPECÍFICO Y, EN SU CONJUNTO, NO TIENE NINGÚN SIGNIFICADO EN EL COMERCIO O LA INDUSTRIA PERTINENTE O APLICADA A LOS PRODUCTOS ENUMERADOS EN LA SOLICITUD Y LA PALABRA EN INGLÉS «POWER», LA CUAL, TRADUCIDA AL IDIOMA CASTELLANO SIGNIFICA «PODER».AMBAS PALABRAS SE ENCUENTRAN ESCRITAS EN LETRAS DE MOLDE, DE COLOR NEGRO Y TRAZOS GRUESOS, CON UNA TIPOGRAFÍA ESPECIAL, POSICIONADAS DE FORMA HORIZONTAL SOBRE UN FONDO DE COLOR BLANCO. EN LA PALABRA «TELLUS», TODAS LAS LETRAS SE ENCUENTRAN EN MAYÚSCULA, A EXCEPCIÓN DE LA LETRA «E», LA CUAL, ESTÁ ESCRITA EN MINÚSCULA. EN LA PALABRA «POWER», TODAS LAS LETRAS SE ENCUENTRAN EN MINÚSCULAS, A EXCEPCIÓN DE LA LETRA «R», LA CUAL, ESTÁ ESCRITA EN MAYÚSCULA. DE IGUAL MANERA, LA PALABRA «POWER» SE ENCUENTRA SEPARADA POR UN APOSTROFE «´» ENTRE LAS LETRAS «O» Y «W»SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR PROTECCIÓN ALGUNA SOBRE CUALQUIER ELEMENTO GENÉRICO, DESCRIPTIVO NI GEOGRÁFICO EN LA CLASE SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008203.jpg', 88),
('mixta', 'EL CLUB DE LAS PAYASITAS', 'EL MENCIONADO DISEÑO CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN CUYO INTERIOR EN LA PARTE CENTRICA IZQUIERDA SE DIBUJA UN PEQUEÑO GLOBO EN COLOR AZUL CON UNA DELGADA TIRA DE COLOR NEGRO, DENTRO DE ESTE GLOBO SE ESCRIBE \\\"EL\\\" EN LETRA MOLDE DE COLOR BLANCO, SEGUIDO DE LA PALABRA \\\"CLUB\\\" ESCRITA EN LETRA MOLDE EN COLORES FUCSIA PARA LA LETRA \\\"C\\\" Y PARTE DE LA \\\"L\\\" Y ANARANJADO ROJIZO PARA LAS LETRAS \\\"L\\\", \\\"U\\\" Y \\\"B\\\", SE CONTINUA ESCRIBIENDO LA PALABRA \\\"DE LAS\\\" EN LETRA MOLDE DE COLOR BLANCO, ENCERRADO DENTRO DE UNA NARIZ DE PAYASO COLOR ROJO OSCURO, PARA FINALMENTE ESCRIBIRSE LA PALABRA \\\"PAYASITAS\\\" EN LETRA MOLDE EN COLORES AMARILLO PARA LA LETRA \\\"P\\\", VERDE PARA LA LETRA \\\"A\\\", AZUL JADE EN LA LETRA \\\"Y\\\" AZUL OCEANO PARA LA LETRAS \\\"A\\\" Y \\\"S\\\", AZUL OSCURO PARA LA LETRA \\\"I\\\" DONDE SE DESTACA UNA FIGURA DE NOTA MUSICAL DEL MISMO TONO ENCIMA DE LA LETRA, COLOR MORADO PARA LA LETRA \\\"T\\\" Y \\\"A\\\" Y FUCSIA PARA LA LETRA \\\"S\\\", TODO EL CONJUNTO MENCIONADO PREVIAMENTE SE ENCUENTRA CON UN FONDO BLANCO TIPO SOMBRA Y ENCERRADO CON UN BORDE DE COLOR FUCSIA PARA FORMAR LA PALABRA \\\"EL CLUB DE LAS PAYASITAS\\\", SE REIVINDICA TODO LO AQUI DESCRITO Y COLORES MENOS LO QUE PODRIA CONSIDERARSE COMO GENERICO.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008212.jpg', 89),
('mixta', 'CLAVO VARETA C.A. MEJIA & CIA', 'LA MARCA ESTÁ CONFORMADA POR UN CONJUNTO DE PALABRAS Y DISEÑOS. EN LA PARTE SUPERIOR DERECHA, SOBRE UN RECTÁNGULO DE COLOR NEGRO SE APRECIA LA EXPRESIÓN CLAVO VARETA ESCRITO EN LETRA TIPO MOLDE DE COLOR BLANCO. BAJO LA MISMA Y SOBRE UN RECTÁNGULO BLANCO SE APRECIA LA FIGURA DE DOS CLAVOS ENTRECRUZADOS DE COLOR BLANCO CON BORDES EN NEGRO. EN EL LADO DERECHO DEL DISEÑO Y SOBRE UN FONDO DE COLOR ROJO SE PRESENTA EL DISEÑO DE UNA ESFERA BLANCA CON LÍNEAS NEGRAS, ATRAVESADA POR UN CLAVO Y SOBRE LA MISMA, UNA FRANJA CURVILÍNEA NEGRA DONDE SE APRECIA LA EXPRESIÓN C.A. MEJIA & CIA, ESCRITA EN LETRA TIPO MOLDE DE COLOR BLANCO. LO QUE SE PRETENDE PROTEGER ES EL CONJUNTO DESCRITO Y NO LOS ELEMENTOS O TÉRMINOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008233.jpg', 90),
('mixta', 'TRITON', 'LA MARCA ESTÁ COMPUESTA POR LA PALABRA TRITON, ESCRITA EN LETRA TIPO MOLDE DE COLOR AZUL Y DESTACANDO UNA FIGURA COMPUESTA POR TRES TRIÁNGULOS DE COLOR AZUL, UNO DE ELLOS ATRAVESADO POR UNA LÍNEA BLANCA, UBICADOS SOBRE LA LETRA O. LO QUE SE PRETENDE PROTEGER ES EL CONJUNTO DESCRITO Y NO LOS ELEMENTOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008247.jpg', 91),
('denominativa', 'CAPITAL GRILL', NULL, NULL, 92),
('mixta', 'POSITEX', 'LA ETIQUETA ESTA COMPUESTA POR UNA FIGURA QUE HACE LAS VECES DE UNA PERSONA CON LOS DOS BRAZOS HACIA ARRIBA Y LAS PIERNAS ABIERTAS EN MEDIO DE LOS BRAZOS UN PUNTO, QUE HACE LA FORMA DE UNA CARA, ESTA DE COLOR NARANJA, EL CUAL REIVINDICA EL GRÁFICO Y EN LA PARTE DE ABAJO ESTA LA PALABRA "POSITEX" EN LETRAS AZULES, EN LETRAS GRANDES, LAS CUALES REIVINDICAN LA FIGURA, EL FONDO DE ESTA EN COLOR BLANCO QUE REIVINDICA TODA LA ETIQUETA', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008319.jpg', 93),
('mixta', 'WAFER 365 XL', 'LA ETIQUETA DE LA MARCA “WAFER 365 XL”, CONSTA DE UN LOGO CON FONDO AZUL, EN DONDE SE OBSERVA EN COLOR AZUL OSCURO CON BORDE AMARILLO LA PALABRA “WAFER 365” QUE ES UN TERMINO DE FANTASÍA Y ESTA ESCRITO EN LETRAS CARACTERISTICAS MINUSCULAS. DICHAS LETRAS TIENEN UN FONDO BLANCO. AL LADO DERECHO SE OBSERVA UNA FIGURA QUE ASEMEJA A UNA GALLETA TIPO WAFER (OBLEA) EN COLOR BLANCO CON UN RELLENO MARRON CLARO QUE SE OBSERVA EN LA PARTE DERECHA DE LA IMAGEN. EN LA PARTE INFERIOR DERECHA DE ESTA FIGURA EN FORMA DE GALLETA SE OBSERVAN LAS LETRAS “XL” EN COLOR BLANCO EN UN CIRCULO DE COLOR VERDE CLARO, DICHAS LETRAS ESTAN ESCRITAS EN LETRAS CARACTERISTICAS MAYUSCULAS. DEBAJO DE LAS LETRAS “XL” SE OBSERVAN UNAS FIGURAS QUE SE ASEMEJAN A UNAS AVELLANAS EN COLOR MARRON. SE REIVINDICA EL CONJUNTO DESCRITO. NO SE REIVINDICAN LOS ELEMENTOS GENERICOS, NI DESCRIPTIVOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008511.jpg', 94),
('mixta', 'OG', 'CONSISTE EN UN CONJUNTO EN EL CUAL SE OBSERVA LA FIGURA DE LO QUE ASEMEJA SER LA LETRA OMEGA DE FORMA ESTILIZADA Y DE TRAZO GRUESO DE LINEA BLANCA Y PUNTEAGUDA EN SU PARTE SUPERIOR SOBRE UN FONDO AZUL, DE FORMA CIRCULAR, CON LA PARTICULARIDAD DE TENER LO QUE PARECE UNA GOTA DE AGUA EN SU INTERIOR, DONDE SE OBSERVA UNA LINEA BLANCA EN EL LADO IZQUIERDO SUPERIOR QUE ASEMEJA UN REFLEJO DE LUZ. BAJO LA FIGURA DESCRITA SE ENCUENTRAN LAS LETRAS O y G ESCRITAS EN TRAZO MEDIO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO Y COLORES DESCRITOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008610.jpg', 95),
('denominativa', 'SACA EL PECHO FEST', NULL, NULL, 96),
('mixta', 'PLASTICOS CELIA', 'La etiqueta esta conformada por una figura en forma de corazón de color rojo; en el interior de la misma se aprecia una figura de caricatura de color blanco y rojo, que asemeja una niña a medio cuerpo, con los brazos extendidos, con los ojos abiertos, boca sonriente y pelo largo recogido en dos moños extendidos, uno hacia el lado derecho y el otro hacia el lado izquierdo. En la parte inferior y sobre esta figura se aprecian las palabras: `Plasticos` escrita en minúscula a excepción de la primera letra que está en mayúscula, en trazo grueso y estilizado, de color rojo y blanco; y `CELIA` escrita en su totalidad en letras mayúsculas, de trazo grueso y estilizado, de color rojo y blanco. Se reivindica todo el conjunto y los colores descritos en él, a excepción de los términos genéricos.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022008812.jpg', 97),
('mixta', 'AION', 'CONSISTE EN UN DISEÑO EN EL CUAL SE LEE \\\"AION\\\" (PALABRA DE FANTASÍA, SIN SIGNIFICADO PROPIO) EN LETRAS COLOR NEGRO, DE TRAZO GRUESO Y EN MAYÚSCULA; CON LA PARTICULARIDAD QUE EN LA LETRA \\\"A\\\" EL TRAZO HORIZONTAL ESTÁ INCOMPLETO Y COLOCADO EN LA PARTE MÁS BAJA DE LA LETRA. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022009083.jpg', 98),
('mixta', 'MEETION', 'CONSISTE EN LA PALABRA MEETION (PROVIENE DEL IDIOMA INGLÉS Y TRADUCE: REUNIÓN), ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE TRAZO GRUESO Y FONDO COLOR NEGRO, CON LAS LETRAS M Y T EN MAYOR TAMAÑO QUE LAS DEMÁS LETRAS. A LA IZQUIERDA DE DICHA PALABRA SE OBSERVA UNA FIGURA IRREGULAR CON TRAZOS RECTOS UBICADOS EN DIFERENTES POSICIONES DE FONDO COLOR NEGRO, LA CUAL TIENE SOBRE ELLA DOS TRAZOS IRREGULARES QUE SIMULAN UN ROMBO, DE TRAZO GRUESO Y FONDO COLOR NEGRO. SE REIVINDICA EL CONJUNTO DESCRITO, CON LOS COLORES INDICADOS EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022009112.jpg', 99),
('mixta', 'NUTRIT YEAST', 'LA ETIQUETA CONTIENE: AL CENTRO EN LA PARTE SUPERIOR EL NOMBRE DE LA COMPAÑIA (RODECAS ALIMENTOS) Y EL NOMBRE DEL PRODUCTO NUTRIT YEAST. SEGUIDO DE UN CINTILLO CON SILUETAS DE CABEZAS DE DISTINTOS ANIMALES. EN LA PARTE CENTRAL A LA IZQUIERDA INFORMACION NUTRICIONAL, EN LA PARTE CENTRAL A LA DERECHA DESCRIPCION DEL CONTENIDO EN UNIDADES DE PESO, EN LA PARTE INFERIOR A LA IZQUIERDA UN CIRCULO DISTINTIVO DEL PRODUCTO, EN LA PARTE INFERIOR A LA DERECHA CODIGO DE BARRA E INFORMACION DE LA EMPRESA COMERCIALIZADORA Y DE PRODUCCION.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022009512.jpg', 100),
('mixta', 'O2 OXIVEN', 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecia el termino OXIVEN escrita en letra molde, mayúscula, siendo que las letras OXI son de color azul, las letras EN son de color verde y la letra V es de color azul y verde, en la parte superior del termino antes descrito observamos la letra O escrita en letra molde, mayúscula, de color verde, en la parte inferior derecha se aprecia el numero dos escrita en letra molde, de color azul, así mismo podemos apreciar que, en la parte inferior de la letra O se observa varias líneas en forma de curva que se asemeja a una ola, la misma es de color azul y está unida al diseño del número dos. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genéricos, todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2022/2022009520.jpg', 101),
('denominativa', 'VERSITIV', NULL, NULL, 102),
('mixta', 'LATITUD SEGUROS', 'EL DISEÑO DE LA MARCA SE ENCUENTRA COMPUESTO POR EL TÉRMINO “LATITUD” ESCRITO EN UNA GRAFÍA ESPECIAL CARACTERÍSTICA DE COLOR AZUL CELESTE, CON LA LETRA “L” EN MAYÚSCULA Y EL RESTO DE LAS LETRAS EN MINÚSCULAS. EN LA PARTE INFERIOR DE DICHO TERMINO, EN MAYOR TAMAÑO, SE DISPONE LA PALABRA “SEGUROS” ESCRITO EN UNA GRAFÍA TIPO IMPRENTA DE COLOR AZUL MARINO EN MAYÚSCULA SOSTENIDA Y CON UNA LIGERA SEPARACIÓN ENTRE SUS LETRAS. EN LA PARTE SUPERIOR IZQUIERDA DEL DISEÑO SE ENCUENTRA UNA FIGURA SEMICIRCULAR, QUE ASEMEJA LA IMAGEN DE UN GLOBO TERRÁQUEO, COMPUESTA DE VARIOS CÍRCULOS, DE COLOR AZUL CELESTE, LOS CUALES DISMINUYEN SU TAMAÑO EN LOS EXTREMOS DE LA FIGURA. EL CONJUNTO DESCRITO SE DISPONE SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO Y NO EL TÉRMINO GENÉRICO UTILIZADO SEPARADAMENTE.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000002.jpg', 103),
('denominativa', 'NIREDON', NULL, NULL, 104),
('mixta', 'MATILDA', 'EL SIGNO SOLICITADO CONSISTE EN UN DISEÑO CON FONDO COLOR PANTONE 627C CONFORMADO POR LOS SIGUIENTES ELEMENTOS: EN UN PRIMER PLANO SE LEE LA PALABRA “MATILDA” ESCRITA EN LETRA TIPO MOLDE CON DOBLE BORDE Y MINÚSCULAS DE COLOR PANTONE 176C.EN LA PARTE SUPERIOR CENTRADA DE LA PALABRA “MATILDA” SE DIBUJAN CUATRO FIGURAS:LA PRIMERA UBICADA DESDE EL BORDE SUPERIOR IZQUIERDO HASTA EL BORDE INFERIOR DERECHO, UNA FIGURA DE LÍNEAS QUE SIMULA UNA ESPIGA CUYO COLOR ES PANTONE 176C.LA SEGUNDA FIGURA SIMULAN SUS LÍNEAS CURVAS ENTRECRUZADAS A UN BATIDOR MANUAL CUYO COLOR PANTONE ES 176C, QUE VA DESDE EL BORDE INFERIOR IZQUIERDO AL BORDE SUPERIOR DERECHO.LA TERCERA FIGURA SIMULA EN SUS LÍNEAS UNA PALETA CUYOS TRAZOS SON DE COLOR PANTONE 176C, QUE SE ENCUENTRA DIBUJADA EN EL CENTRO DE LAS FIGURAS DE LA ESPIGA Y EL BATIDOR. LA CUARTA FIGURA SIMULA CON SUS LÍNEAS UN RODILLO CON SUS EXTREMIDADES DE AGARRE EN CADA PUNTA BIEN DELINEADAS, SOBREPONIÉNDOSE Y EN EL CENTRO DE LAS FIGURAS ANTES DESCRITAS, CUYAS LÍNEAS SON DE COLOR PANTONE 176C.TODAS LAS FIGURAS ANTES DESCRITAS SE ENCUENTRAN ENTRECRUZADAS EN SU CONJUNTO FORMAN UN SOLO GRUPO. EN LA PARTE SUPERIOR DE LA ETIQUETA, CENTRADA ENCIMA DE LAS FIGURAS DESCRITAS SE ENCUENTRA ESCRITA LA PALABRA MAISON Y EN SUS EXTREMIDADES ESTÁN DIBUJADAS UNAS LÍNEAS CORTAS, CUYA TRADUCCIÓN AL CASTELLANO ES HOGAR, LA CUAL NO SE REIVINDICA. EN LA PARTE INFERIOR DE LA ETIQUETA SE ENCUENTRA ESCRITA LAS PALABRAS PÂSTISSERIE FINE, LAS CUALES EN SU TRADUCCIÓN AL CASTELLANO SIGNIFICA PASTELERIA FINA, LA CUAL NO SE REIVINDINCAN. EL RESTO DE LA ETIQUETA EN SU CONJUNTO, SE REIVINDICA EN COLORES, TAMAÑOS Y TIPO DE LETRAS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000106.jpg', 105),
('grafica', NULL, 'En la parte superior, se describe un diseño en el cual se observan tres figuras iguales de forma ovaladas, compuesta de líneas curvas de trazo fino, con la particularidad de que las figuras se alargan en cada uno de sus extremos y se encuentran, entre sí en la parte central. Debajo de lo anteriormente descrito, se observa en la parte central, una pequeña figura circular. Todo ello en color negro, presentando en su interior una línea de trazo fino en color blanco, que atraviesa el diseño y se presenta sobre un fondo de color blanco.Debajo de todo lo anteriormente descrito, en la parte central, se observa la palabra “TAMANACO”, en letras de trazo grueso en color negro, presentando una línea de trazo fino en color blanco en el interior de cada letra y debajo de este conjunto se observa la palabra “HOTEL” en letras de igual forma y tamaño, de trazo fino en color negro y de menor tamaño con relación a la palabra “TAMANACO”. Todo ello en fondo de color blanco. HOTEL TAMANACO es una marca registrada, cuyo titular es HOTEL TAMANACO C.A.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000166.jpg', 106),
('mixta', 'LV', 'La etiqueta que se presenta a continuación consiste en la representación gráfica de las letras L y V ubicadas en el centro de la etiqueta, escritas en mayúsculas, de trazo grueso, de color negro. Asimismo, destaca la particularidad de que la letra L se encuentra ligeramente inclinada hacia la derecha y se intersecta con la letra V en su lado izquierdo. Dichas letras están rodeadas de diferentes figuras con formas de flores. A mayor proximidad de las letras y en los cuatro puntos diagonales con respecto a las mismas, se encuentran cuatro representaciones gráficas de una flor de color negro con cuatro pétalos con extremos puntiagudos que apuntan, cada uno, hacia un punto cardinal distinto. El centro de estas flores es un círculo de color blanco. Más alejadas de las letras LV y ubicadas en cada uno de los cuatro puntos cardinales de la etiqueta, se encuentran cuatro representaciones gráficas de una flor de color blanco con cuatro pétalos con extremos puntiagudos que apuntan, cada uno, hacia un punto cardinal distinto. Cada una de estas cuatro flores tiene un círculo de color negro en su centro y se encuentra superpuesta sobre una figura más grande, de color negro y similar a un rombo con la diferencia de que sus lados son curvos. Adicionalmente, se muestran cuatro figuras con forma de flores en las cuatro esquinas de la etiqueta. Se trata de la representación gráfica de cuatro flores de color blanco con cuatro pétalos con bordes redondeados y orientados, cada uno, hacia un punto cardinal distinto. Cada una de estas cuatro flores tiene un círculo pequeño de color negro en su centro y se encuentra superpuesta sobre un círculo más grande de color negro. El fondo de la etiqueta es blanco. Se reivindica el conjunto descrito.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000191.jpg', 107),
('grafica', NULL, 'En la parte superior se describe un diseño, en el cual se observan tres figuras iguales de forma ovaladas, compuesta de líneas curvas de trazo fino, con la particularidad de que las figuras se alargan en cada uno de sus extremos y se encuentran, entre sí en la parte central. Debajo de lo anteriormente descrito, se observa en la parte central, una pequeña figura circular. Todo ello en color negro, presentando en su interior una línea de trazo fino en color blanco, que atraviesa el diseño y se presenta sobre un fondo de color blanco.Debajo de todo lo anteriormente descrito, en la parte central, se observa la palabra “TAMANACO”, en letras de trazo grueso en color negro, presentando una línea de trazo fino en color blanco en el interior de cada letra y debajo de este conjunto se observa la palabra “CASINO” en letras de igual forma y tamaño, de trazo fino en color negro y de menor tamaño con relación a la palabra “TAMANACO”. Todo ello en fondo de color blanco. CASINO TAMANACO es una marca registrada, cuyo titular es HOTEL TAMANACO C.A.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000228.jpg', 108),
('grafica', NULL, 'CONSISTE EN UNA ETIQUETA CON FONDO COLOR BLANCO, EL CUAL SE OBSERVA UNA FIGURA DE SEMIOVALO DE COLOR CEREZO, DENTRO DE ELLA SE ENCUENTRA UNA NUEVA FIGURA DE COLOR NEGRO, LA MISMA POSEE UNA CURVA CÓNCAVA EN LA PARTE CENTRAL SUPERIOR EN FORMA DE \\\\\\\"V\\\\\\\", DENTRO DE ESTA FIGURA NEGRA SE ENCUENTRAN DOS RECTANGULOS DE LINEA DELGADAS DE COLOR AZUL CON RELLENO COLOR NEGRO EN EL CENTRO, Y DEBAJO DE ESTOS UN CUADRADO CON LINEAS DELGADAS COLOR AZUL DE MENOR TAMAÑO CON RELLENO COLOR NEGRO, DEL LADO DE LA FIGURA DE SEMI-OVALO DE COLOR CEREZO SE ENCUENTRA DEL LADO DERECHO Y EL IZQUIERDO DOS SEMICÍRCULOS DE COLOR AZUL. NOSE REIVINDICAN LOS TERMINOS GENERICOS NI DESCRIPTIVOS, SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000277.jpg', 109),
('mixta', 'PEROS', 'LA ETIQUETA DE LA MARCA “PEROS”, CONSTA DE UN LOGO CON FONDO BLANCO, EN DONDE SE OBSERVA EN LETRAS ROJAS LA PALABRA “PEROS” LA LETRA “P” EN LETRAS CARACTERÍSTICAS MAYÚSCULAS Y LAS SIGUIENTES “EROS”, EN LETRAS CARACTERÍSTICAS MINÚSCULAS. SE REIVINDICA EL CONJUNTO DESCRITO. NO SE REIVINDICAN LOS ELEMENTOS GENÉRICOS, NI DESCRIPTIVOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000427.jpg', 110),
('mixta', 'LOS LLANOS', 'CONSISTE EN LAS PALABRAS LOS LLANOS, EN LETRA CURSIVA, DE COLOR BLANCO, EN LETRAS MINISCULAS Y FONDO DE COLOR AZUL. SE REINVINDICA EL CONJUNTO ANTES DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023000595.jpg', 111),
('denominativa', 'LEO', NULL, NULL, 112),
('mixta', 'LA TOSCANA', 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecia el término LA TOSCANA en letra molde, color negro, la letra L en mayúscula, un poco más gruesa que la letra a y rellena de color negro, en la parte derecha de dichas letras se aprecian 3 figuras que se asemejan a una hoja de un árbol y de color negro, que también en su parte superior hay una mini separación. Debajo de las letras La se aprecia el término Toscana en el cual la letra T están en mayúscula en color negro y rellena de color negro y el resto de las letras están en minúsculas. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genéricos, todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001213.jpg', 113),
('mixta', 'CAFÉ CENDÉ', 'EL DISEÑO SOLICITADO SE DESCRIBE DE LA SIGUIENTE MANERA: SE PRESENTA UNA FIGURA CUADRADA, QUE TIENE UN FONDO FORMADO POR DOS COLORES, NEGRO Y MARRÓN OSCURO. ESTOS SE PRESENTAN, EN FORMA DEGRADADO, PUES EN LA PARTE SUPERIOR SE OBSERVA EL COLOR NEGRO, HASTA LA PARTE MEDIA, PARA LUEGO APARECER EL COLOR MARRÓN OSCURO, EL CUAL PRESENTA TONALIDADES MÁS OSCURAS EN FORMAS DISPERSAS. DENTRO DEL CUADRADO, SE OBSERVA EN LA PARTE SUPERIOR, SOBRE EL FONDO DE COLOR NEGRO, UN TRAZO MEDIANO DE COLOR BLANCO CURVO DE MEDIA LUNA, DE FORMA DE ARCO HACIA ABAJO. DENTRO DEL ARCO HACIA ABAJO, SE OBSERVA EL SIGNO SOLICITADO “CENDÉ”, ESCRITO CON LETRAS DE TIPO BRUSH SCRIPT CURSIVA; EN FORMA DE TÍTULO, ES DECIR, LA PRIMERA LETRA ES MAYÚSCULA Y LAS SIGUIENTES SON MINÚSCULAS. LAS LETRAS, SON DE GRAN TAMAÑO, DE TRAZOS MUY GRUESO Y DE COLOR BLANCO. SOBRE EL TÉRMINO “CENDÉ”, SE OBSERVA QUE SE PRESENTA ESCRITO EL TÉRMINO “CAFÉ”, CON LETRAS DE TIPO IMPRENTA, EN FORMA DE TÍTULO, ES DECIR, LA PRIMERA LETRA ES MAYÚSCULA Y LAS SIGUIENTES SON MINÚSCULAS. ESTAS LETRAS SON DE UN TAMAÑO PEQUEÑO; DE TRAZO FINO Y DE COLOR BLANCO. EL TÉRMINO “CAFÉ”, NO SE REIVINDICA POR SER GENÉRICO. DEBAJO DE TODO LO ANTES DESCRITO, JUSTO SOBRE EL FONDO DE COLOR MARRÓN OSCURO, SE PRESENTA EL DIBUJO DE UN PAISAJE DE MONTAÑAS. ESTE PAISAJE ESTA DIBUJADO O CONTENIDO SOBRE LA BASE DE UN TRAZO CURVO DE FORMA DE ARCO HACIA ARRIBA; DE COLOR BLANCO. SE OBSERVA QUE EL PAISAJE ESTÁ DIBUJADO POR TRAZOS GRUESOS DE COLOR BLANCO, LOS CUALES PRESENTAN CONTENIDAS DENTRO DE ELLAS: TONALIDADES DE GRIS CLARO, COMO SI ESTUVIESEN SOMBREADAS. EL PAISAJE VISTO DESDE LEJOS; ESTÁ FORMADO POR MONTAÑAS QUE ESTÁN UNIDAS, QUE SE VEN SUS FALDAS Y CORDILLERAS, EN LOS CUALES SE APRECIAN SENDEROS, A LO LEJOS SE APRECIAN LAS LLANURAS Y SE PUEDE VER QUE AL FONDO HAY UN NACIENTE DE AGUA, YA QUE EN EL MEDIO SE OBSERVA CÓMO SE FORMA UN RÍO, QUE SE VA DESPLAZANDO HACIA ABAJO. TODO EL DIBUJO DE LAS MONTAÑAS, LOS SENDEROS, EL RIO, ESTÁN DIBUJADOS POR TRAZOS MEDIANOS DE COLOR BLANCO, SOMBREADOS CON GRIS CLARO. SI SE OBSERVA EN PERSPECTIVA, Y SE VISUALIZA TODO EL CONJUNTO DESCRITO, PARECIERA QUE, TODO EL DISEÑO ESTÁ CONTENIDO EN UN CÍRCULO DE TRAZO GRUESO DE COLOR BLANCO, PERO ÉSTE, SU BORDE NO LLEGA A UNIRSE COMPLETAMENTE, PUES SE SEPARAN EN LA PARTE MEDIA EN SUS EXTREMOS DERECHO E IZQUIERDO. SE OBSERVA TAMBIÉN QUE, EN LA PARTE INFERIOR DEL DISEÑO, JUSTO DEBAJO DEL TRAZO CURVO DE ARCO HACIA ARRIBA, SE VE UN PEQUEÑO GRANO DE CAFÉ. TODO EL DISEÑO SE ENCUENTRA CONTENIDO, COMO SE DESCRIBIÓ ANTES, SOBRE UN FONDO DEGRADADO DE COLOR NEGRO Y DE COLOR MARRÓN OSCURO. NO SE REIVINDICA LA PALABRA “CAFÉ”, POR SER UN TÉRMINO GENÉRICO. POR LO DEMÁS, SE REIVINDICA LOS COLORES Y TODO SU CONTENIDO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001290.jpg', 114),
('grafica', NULL, 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecian dos figuras las cuales se asemejan a arcos de color negro, uno de ellos está viendo hacia la parte superior y el otro hacia la parte inferior, los mismo son de delineado grueso en sus extremos y rellenos en los mismos y se hacen más delgado en su centro donde se encuentran entrelazados. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genéricos, todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001320.jpg', 115),
('denominativa', 'MIARROZ', NULL, NULL, 116),
('mixta', 'REDDOT', 'EL SIGNO SOLICITADO CONSISTE EN LA PALABRA REDDOT, EN COLOR NEGRO Y EN LETRA MOLDE, SIENDO QUE LA R Y LA SEGUNDA D SE ENCUENTRAN ESCRITAS EN MAYÚSCULAS. ASIMISMO, SE OBSERVA QUE LA LETRA O, ES REPRESENTADA COMO UNA FIGURA CIRCULAR, DE COLOR ROJO, CON CINCO PEQUEÑOS CÍRCULOS BLANCOS Y CUATRO LÍNEAS DELGADAS INTERCONECTADAS ENTRE SÍ EN SU INTERIOR. NO SE REIVINDICAN LAS EXPRESIONES GENÉRICAS O DE USO COMÚN QUE PUEDAN FORMAR PARTE DEL DISEÑO. SE REIVINDICA EL CONJUNTO DESCRITO. (TRADUCCIÓN DE REDDOT: PALABRA DE FANTASIA).', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001718.jpg', 117),
('mixta', 'GRUPO MC', 'LA ETIQUETA CONSISTE EN EL LOGO DE LA MARCA GRUPO MC, UN CLÚSTER TURÍSTICO CONFORMADO POR UNA RED DE NEGOCIOS Y SERVICIOS INTEGRADA POR MÚLTIPLES AGENCIAS DE VIAJE, UN OPERADOR TURÍSTICO RECEPTIVO Y EMISOR Y UNA UNIDAD DEDICADA A LA ASESORÍA DE EMPRENDEDORES Y PYMES DEL SECTOR. EL LOGO ESTA CONFORMADO POR LA PALABRA GRUPO EN COLOR GRIS Y UN RECUADRO CON LAS INICIALES MC, LAS LETRAS CORRESPONDEN A LAS INICIALES DEL SR. MIGUEL CLERCH REPRESENTANTE DE LA MARCA. GRUPO SE REFIERE A QUE LA MARCA AGRUPA A DOS MARCAS (MCAIR Y MC TOURS) AMBAS YA REGISTRADAS. COLOR AZUL PANTONE: 7463C Y COLOR GRIS PANTONE 424C Y LA TIPOGRAFÍA: HELVETICA NEUE.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001798.jpg', 118),
('mixta', 'HD', 'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LAS LETRAS “HD”, EN LETRA TIPO MOLDE, DE TRAZO GRUESO, EN LETRAS MAYÚSCULAS Y DE COLOR AZUL. EN LA PARTE IZQUIERDA SE PUEDE OBSERVAR UNA IMAGEN QUE ASEMEJA SER UNA FLECHA GEOMÉTRICA, LA CUAL SE ENCUENTRA APUNTANDO HACIA LAS LETRAS “HD”, CON UN DEGRADADO DE COLOR VERDE QUE VA DE LA SIGUIENTE MANERA: EN LA PARTE SUPERIOR UN COLOR VERDE CLARO, LUEGO UN VERDE MEDIO Y, POSTERIORMENTE, UN VERDE MÁS OSCURO. TODO EL CONJUNTO ANTERIORMENTE DESCRITO SE OBSERVA SOBRE UN FONDO BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO, Y LA COMBINACIÓN DE COLORES SEGÚN SE DESCRIBE. LA DESCRIPCIÓN DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001867.jpg', 120),
('denominativa', 'KEJUMALU', NULL, NULL, 121),
('mixta', 'MULTIMALL CENTER', 'ETIQUETAS: EL DISEÑO DE LA MARCA CONSISTE EN UNA ETIQUETA DE FONDO BLANCO, APRECIÁNDOSE EN LA PARTE IZQUIERDA UNA FIGURA FANTASIOSA DE UN CARRITO DE SUPERMERCADO DE BORDE AZUL OSCURO, EL INTERIOR DEL CARRITO ES DE COLOR BLANCO Y SE OBSERVAN DOS FIGURAS SIMILARES A UN TRAPECIO, LA FIGURA DEL LADO IZQUIERDO ES DE COLOR NARANJA Y LA FIGURA DEL LADO DERECHO ES DE COLOR AMARILLO; SE APRECIA EN LA PARTE DERECHA DE LA ETIQUETA LA PALABRA “MULTIMALL” COMPUESTA CON EL PREFIJO “MULTI” PARA HACER REFERENCIA A “MUCHOS” Y LA PALABRA DE ORIGEN INGLÉS “MALL” CUYA TRADUCCIÓN AL ESPAÑOL ES “VARIEDAD DE TIENDAS Y RESTAURANTES”, EN LETRA MOLDE, MINÚSCULA Y COLOR AZUL, SE PUEDE DETALLAR QUE EL INTERIOR DE LA LETRA “M” ES DE COLOR AMARILLO Y EL INTERIOR DE LA LETRA “A “ES DE TIENE COLOR NARANJA, DEBAJO SE OBSERVA LA PALABRA DE ORIGEN INGLÉS “CENTER” CUYA TRADUCCIÓN AL ESPAÑOL ES “CENTRO” EN LETRA MOLDE, MINÚSCULA Y COLOR AMARILLO. SE REIVINDICA EL CONJUNTO DESCRITO A EXCEPCIÓN DE LOS TÉRMINOS GENÉRICOS QUE FORMAN PARTE DEL MISMO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001981.jpg', 122),
('mixta', 'SARITA', 'La marca mixta cuyo registro se solicita, consiste en un círculo o circunferencia de fondo color negro, en cuya parte superior se observa otra circunferencia de color blanco dividida en dos partes iguales por una línea horizontal de color negro, con la peculiaridad que dentro de cada parte segmentada se observa una especie de figura que semeja ser una gota en posición horizontal de color negro, en la parte superior dicha gota está alineada al extremo derecho y en la parte inferior está alineada al extremo izquierdo, en su conjunto dicha circunferencia semeja ser el diseño fantasioso de la letra S. Justo debajo del diseño de la letra S, se encuentra la marca SARITA escrita en letras mayúsculas y en color blanco. Se reivindica el conjunto descrito, los colores señalados conforme a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023001982.jpg', 123),
('mixta', 'AIKOZ', 'CONSISTE EN UN RECTÁNGULO DE COLOR BLANCO, DENTRO DE ESTE SE ENCUENTRA LA PALABRA DE FANTASÍA AIKOZ, EN UNA TIPOGRAFÍA ESPECIAL, LA LETRA A Y Z CONSISTE EN UN RECTÁNGULO DE COLOR BLANCO, DENTRO DE ESTE SE ENCUENTRA LA PALABRA DE FANTASÍA AIKOZ, EN UNA TIPOGRAFÍA ESPECIAL, LA LETRA A Y Z ESTÁN DE COLOR AMARILLO MOSTAZA Y LAS LETRAS I, K Y O ESTÁN DE COLOR VERDE CLARO, A EXCEPCIÓN DEL PUNTO QUE SE ENCUENTRA ARRIBA DE LA I , QUE ESTA DE COLOR AMARILLO MOSTAZA. DEBAJO DE LA PALABRA DE FANTASÍA SE ENCUENTRA UNA LINEA EN FORMA DE MEDIA LUNA DE COLOR VERDE CLARO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACIÓN DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHA 18 DE NOVIEMBRE DE 1996', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002094.jpg', 124),
('mixta', 'GREEN TIDE EXTRACTO DE ALGA', 'CONSISTE EN UN LOGOTIPO RECTANGULAR DE COLOR VERDE CLARO CON LA PARTICULARIDAD DE TENER LOS BORDE REDONDEADOS DENTRO DEL MENCIONADO LOGOTIPO SE OBSERVA UN ARBOL DE COLOR VERDE ENCERRADO EN UN CIRCULO DE FONDO BLANCO EN LA PARTE SUPERIOR DE DICHA FIGURA SE OBSERVAN OTRAS FIGURAS SEMEJANDO SER UNAS HOJAS DE DIFERENTES TAMAÑOS DE COLOR VERDE, EN LA PARTE INFERIOR UNAS FIGURAS SEMEJANDO SER LAS RAICES DEL MENCIONADO ARBOL, A UN LADO SE OBSERVA LAS PALABRAS GREEN TIDE (GREEN TIDE=MAREA VERDE) ESCRITA EN LETRAS GRUESAS DE COLOR BLANCO DEBAJO SE OBSERVAN ESCRITA LAS PALABRAS EXTRACTO DE ALGA (PALABRAS DE FANTASIA ), ESCRITAS EN LETRAS FINAS DE COLOR BLANCO. LOS COLORES SE MENCIONAN A EFECTOS DE DESCRIBIR EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002125.jpg', 125),
('denominativa', 'PRONOV', NULL, NULL, 126),
('mixta', 'EMELIE', 'EL MENCIONADO DISEÑO CONSISTE EN UNA ETIQUETA DE FONDO ESCARCHADO EN COLOR NEGRO EN CUYA PARTE CÉNTRICA SE ESCRIBE LA PALABRA "EMELIE" (NOMBRE DE FANTASÍA) EN LETRA MOLDE DE TRAZO FINO EN COLOR DORADO, SE DESTACA LA LETRA "M" DE LA MENCIONADA PALABRA LA CUAL SE CONFORMA DE DOS ARCOS UNIDOS ENTRE SI PARA ASÍ HACER ALUSIÓN A LA LETRA, SE REIVINDICA TODO LO AQUÍ DESCRITO Y COLORES MENOS LO QUE PODRÍA CONSIDERARSE COMO GENÉRICO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002412.jpg', 127),
('mixta', 'LA SANAHORIA', 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecia el término LA SANAHORIA escrita en letra molde, mayúscula de color negro, en la parte superior del mismo se observa un figura la cual se asemeja a una pirámide invertida, cuya punta inferior es ovalada, dicha pirámide es de color negro e internamente posee múltiples rectángulos de color blanco, más arriba se aprecian dos flechas de color negro, las cuales apuntan hacia la parte superior central del logo descrito anteriormente. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genéricos, todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002471.jpg', 128),
('denominativa', 'SBR', NULL, NULL, 129),
('denominativa', 'EL FRUTO DE UNA TRADICION', NULL, NULL, 130),
('mixta', 'MANGUANGUA', 'CONSISTE EN UN CUADRADO DE COLOR AZUL CLARO EN EL CUAL DESTACA LA IMAGEN DE UNA FRUTA CON FORMA DE CORAZÓN DE BORDES GRUESOS EN COLOR BLANCO CUYAS HOJAS ESTÁN DELINEADAS IGUALMENTE EN COLOR BLANCO. DEBAJO DE ESTA DESTACA EL TERMINO MANGUANGUA ESCRITO EN LETRA CARACTERÍSTICA EN COLOR BLANCO Y EN LETRA MINÚSCULA. MANGUANGUA= COSA O ASUNTO QUE NO PRESENTA DIFICULTAD SE REIVINDICA EL CONJUNTO DESCRITO Y SE REIVINDICAN LOS COLORES NO ASÍ LOS ELEMENTOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002766.jpg', 131),
('mixta', 'ARQOS', 'EL SIGNO SOLICITADO CONSISTE EN EL DISEÑO DE LA PALABRA "ARQOS" ESCRITO EN LETRA MOLDE, EN MAYÚSCULAS Y DE COLOR BLANCO, ESTANDO CADA LETRA EN EL INTERIOR DE UN CUADRADO DE COLOR NEGRO. NO SE REIVINDICAN LAS EXPRESIONES GENÉRICAS O DE USO COMÚN QUE PUEDAN FORMAR PARTE DEL DISEÑO. SE REIVINDICA EL CONJUNTO DESCRITO. ARQOS: PALABRA DE FANTASÍA.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002860.jpg', 132),
('grafica', NULL, 'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN LA QUE SE OBSERVA UNA FIGURA IRREGULAR QUE SE ASEMEJA A DOS FLECHAS ROJAS APUNTANDO CADA UNA HACIA EL CENTRO DEL CONJUNTO, UNIDAS POR UNA LÍNEA SEMICIRCULAR DEL MISMO COLOR. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002864.jpg', 133),
('mixta', 'Gansito', 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecia el término GANSITO escrita en letra molde, en color negro, posicionada en diagonal, con un borde y fondo de color blanco; siendo que la letra G se encuentra en mayúscula y el resto en minúscula. Todo el conjunto descrito reposa sobre un ovalo horizontal, posicionado en diagonal y de fondo color fucsia, con un trazado en el borde del ovalo en color azul. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genéricos, todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023002917.jpg', 134),
('denominativa', 'BIOFARM', NULL, NULL, 135),
('mixta', 'CHUCHO CAFE', 'CONSISTE EN UN LOGOTIPO DE FONDO NEGRO, EN LA PARTE SUPERIOR SE APRECIA UN CIRCUNFERENCIA Y DENTRO SE VE UN BUSTO DE UN HOMBRE CON BARBA Y BIGOTE NEGRO, CABELLO NEGRO Y CON CORTE POR LA MITAD DE LA CABEZA Y PINTAS EN DORADO DEGRADADO, ENCIMA DE SU CABEZA SE APRECIA LO QUE SE SUPONE ES UN MANTO EN COLOR DORADO DEGRADADO, LA CIRCUNFERENCIA POR DENTRO ES DE COLOR DORADO EN DEGRADE; EN LA PARTE INFERIOR SE LEE CHUCHO EN CARACTERES ESTILIZADO Y COLOR DORADO EN DEGRADE, LA LETRA O ESTA REPRESENTADA POR UN GRANO DE CAFE EN COLOR DORADO, DEBAJO DE ESTO SE LEE CAFE (NO SE REIVINDICA) EN CARACTERES ESTILIZADOS Y COLOR DORADO EN DEGRADE Y SOBRE LA E UNA TILDE EN COLOR DORADO, SE REIVINDICA EL CONJUNTO DESCRITO, EN CUANTO A TERMINOS, COLORES Y FIGURAS, MENOS EL TERMINO CAFE.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023003045.jpg', 136),
('grafica', NULL, 'EL SIGNO QUE SE PRESENTA A CONTINUACIÓN SE ENCUENTRA CONFORMADO POR EL DIBUJO DE UN HOMBRE DE NIEVE DE COLOR BLANCO Y BORDES NEGROS, QUE LLEVA PUESTA UNA CAPA DE COLOR GRIS Y BORDES NEGROS Y UNA CORONA, IGUALMENTE, DE COLOR BLANCO Y BORDES NEGROS. EN LA MANO DERECHA, SOSTIENE UN CETRO QUE SE ASEMEJA A UN HELADO DE BARQUILLA, DE BORDES DE COLOR NEGRO, RELLENO DE COLORES BLANCO Y GRIS. TODO EL SIGNO SE ENCUENTRA SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NINGÚN ELEMENTO QUE PUEDA SER CONSIDERADO GENÉRICO O DESCRIPTIVO EN LA CLASE SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023003168.jpg', 137),
('mixta', 'MAVESA', 'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LA PALABRA DE FANTASÍA “MAVESA”, EN LETRA TIPO MOLDE, DE GRAN TAMAÑO, DE TRAZO GRUESO, EN MINÚSCULAS Y DE COLOR PANTONE 287 C; TAMBIÉN SE PUEDE OBSERVAR QUE LAS LETRAS “E” Y “S” TIENEN UNA TERMINACIÓN IRREGULAR. LA PALABRA DE FANTASÍA, SE ENCUENTRA ENCIMA DE UNA FIGURA QUE ASEMEJA SER UNA ESPECIE DE ONDA DE COLOR PANTONE 151 C. DEBAJO DE LA PALABRA DE FANTASÍA, SE OBSERVA UNA IMAGEN QUE ASEMEJA SER UN ARTÍCULO DE COCINA COMO ES EL SARTÉN, SALTEANDO VEGETALES, ENTRE LOS QUE SE OBSERVAN: PIMENTÓN, CEBOLLA Y CHAMPIÑONES. EN LA BASE DE LA IMAGEN, SE OBSERVAN UNOS TRAZOS DE COLOR VERDE CLARO EN FORMA DE ONDAS Y COLOR VERDE OSCURO EL FONDO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023003316.jpg', 138),
('mixta', 'ASTRO100', 'LA PRESENTE ETIQUETA ESTA REPRESENTADA EN CONJUNTO POR LETRAS MAS NÚMEROS ASTRO100, ESCRITAS SUS LETRAS EN COLOR AZUL TENIENDO COMO PARTICULARIDAD UNA ABERTURA EN SU PARTE INFERIOR DE LA LETRA O OBSERVÁNDOSE UNA PEQUEÑA ESTRELLA CON SU DESTELLO EN SUSTITUCIÓN DE SU ESPACIO INTERNO, BORDEADAS EN SU ENTORNO POR UNA LINEA DE COLOR GRIS UNIENDO ESTA CON EL NUMERO 100 SIENDO ESTE DE COLOR NEGRO CON EL MISMO BORDE QUE LOS UNIÓ EN COLOR GRIS, SE REIVINDICA EL CONJUNTO DESCRITO MAS LOS COLORES MENCIONADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023003457.jpg', 139),
('denominativa', 'FARMACIA RIO', NULL, NULL, 140),
('mixta', 'AGRO SIMÓN SEMBRAMOS AGRONEGOCIOS', 'LA MARCA MIXTA CUYO REGISTRO SE SOLICITA, ESTÁ CONFORMADO POR UNA ETIQUETA DE FONDO COLOR BLANCO, EN CUYA PARTE SUPERIOR SE OBSERVA UNA CIRCUNFERENCIA DE FONDO COLOR BLANCO, DE TRAZO DELGADO DE COLOR AZUL (PANTONE 7470 C) Y DENTRO DE LA CUAL SE ENCUENTRAN CUATRO DISEÑOS, EN EL EXTREMO SUPERIOR IZQUIERDO OBSERVAMOS UNA IMAGEN QUE SEMEJA SER UNA LÁGRIMA CON SU EXTREMO DERECHO RECTO Y EL OTRO EN FORMA DE ARCO EN COLOR VERDE (PANTONE 7732 C), EN EL EXTREMO SUPERIOR DERECHO SE OBSERVA LO QUE SEMEJA SER UNA CABEZA DE GANADO EN COLOR GRIS (PANTONE COOL GRAY 9 C), EN EL EXTREMO INFERIOR IZQUIERDO OBSERVAMOS LA IMAGEN FANTASIOSA DE DOS RAMAS U HOJAS DE PALMA DE COLOR VERDE (PANTONE 7732 C), CON LA PARTICULARIDAD QUE UNA DE LAS HOJAS DE PALMA SOBRESALE LEVEMENTE DE LA CIRCUNFERENCIA Y EN EL EXTREMO DERECHO LA IMAGEN DE UNA LÁGRIMA INVERTIDA CON SU EXTREMO IZQUIERDO RECTO Y EL EXTREMO DERECHO EN FORMA DE ARCO EN COLOR AZUL (PANTONE 7470 C). DEBAJO DE ESTA CIRCUNFERENCIA, SE ENCUENTRA EL ELEMENTO DENOMINATIVO DE LA MARCA CONFORMADO POR EL TÉRMINO AGROSIMÓN ESCRITO EN LETRAS MAYÚSCULAS, EN COLOR NEGRO, CON LA PARTICULARIDAD QUE LA LETRA A DE AGRO Y S DE SIMÓN SOBRESALEN LEVEMENTE DEL RESTO DEL CONJUNTO. DEBAJO DE ESTE SIGNO SE OBSERVA UNA LÍNEA RECTA DE COLOR AZUL (PANTONE 7470 C) CON DOS ROMBOS EN SUS EXTREMOS. SE REIVINDICA EL CONJUNTO DESCRITO Y LOS COLORES SEÑALADOS CONFORME A LOS FACSÍMILES QUE SE ACOMPAÑAN.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023003524.jpg', 141),
('denominativa', 'MÁS QUE HAMBURGUESAS', NULL, NULL, 142),
('denominativa', 'MAROLIO', NULL, NULL, 143),
('grafica', NULL, 'CONSISTE EN UNA ETIQUETA CONFORMADA POR UNA IMAGEN QUE REPRESENTA LA CARA DE UN PERRO DE COLOR BLANCO CON DOS MANCHAS GRANDES Y DOS PEQUEÑAS DE COLOR NEGRO EN LOS DOS EXTREMOS DE SUS OREJAS Y UNA MACHA MAS GRANDE DE COLOR NEGRO QUE CUBRE SU OJO Y PARTE DE LA CARA DEL LADO DERECHO. SUS OJOS, OCICO Y BOCA TAMBIEN ESTÁN REPRESENTADO EN COLOR NEGRO Y DEBAJO DE SU CARA SE MUESTRA UNA FIGURA ALARGADA EN FORMA DE LAZO DE COLOR COMPLETAMENTE NEGRO. SE REIVINDICAN LAS FORMAS, COLORES Y DISEÑOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023003797.jpg', 144),
