('mixta', 'MERLIN', 'CONSISTE EN LA FIGURA DE UN SOMBRERO PUNTIAGUDO, DE FONDO COLOR ROJO, CON DOS BORDES FINOS COLOR BLANCO Y NEGRO, CON PLIEGUES IRREGULARES Y LA PUNTA DOBLADA HACIA LA IZQUIERDA; DONDE SE OBSERVAN CINCO ESTRELLAS, DE FONDO COLOR BLANCO Y BORDES FINOS COLOR NEGRO. UBICADO SOBRE UN RECTÁGULO CURVO, DE FONDO COLOR NEGRO, DENTRO DEL QUE SE LEE MERLIN (PALABRA DE FANTASÍA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCIÓN), ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE TRAZO GRUESO CON BORDES REDONDEADOS; CON LA PARTICULARIDAD DE QUE EL PUNTO DE LA LETRA I ESTÁ REPRESENTADO POR UNA ESTRELLA DE CINCO PUNTAS. EL CONJUNTO PEVIAMENTE DESCRITO ES DE FONDO COLOR BLANCO Y BORDE GRUESO COLOR NEGRO, CON EFECTO TRIDIMENSIONAL. DEBAJO SE OBSERVA UN RECTÁNCULO DE BORDES REDONDEADOS, DE FONDO COLOR AMARILLO Y BORDE DE TRAZO GRUESO COLOR NEGRO. UNIDO EN SU PARTE INFERIOR A UNA PUNTA DE FONDO COLOR ROJO, DOBLADA HACIA LA DERECHA, CON DOS BORDES FINOS COLOR BLANCO Y NEGRO. SE REIVINDICA LA PALABRA MERLIN, Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023004719.jpg', 152),
('denominativa', 'ECO RHELEN', NULL, NULL, 153),
('mixta', 'CHAIN A LA PARRILLA', 'SE OBSERVA UN ESCUDO CREADO CON UNA LÍNEA GRUESA DE COLOR ROJO EN FORMA DE PENTÁGONO CON BORDES REDONDEADOS QUE REPRESENTA LA CREACIÓN ARTESANAL DE UN AHUMADOR PROPIO CON MATERIAL RECUPERADO. SOBRE EL ESCUDO SE ENCUENTRA LA SILUETA DE UNA LLAMA EN COLOR NEGRO QUE REPRESENTA LA AFICIÓN POR DOMINAR EL ARTE DE COCINAR SOBRE LAS BRASAS, Y POR LA GASTRONOMÍA PARRILLERA EN GENERAL. DEBAJO DEL ESCUDO SE OBSERVA LA EXPRESIÓN "CHAIN" ESCRITA EN LETRAS MAYÚSCULAS DE TIPO MOLDE EN COLOR NEGRO ABARCANDO EL ANCHO DEL LOGO, REPRESENTANDO EL APODO FAMILIAR DEL CREADOR DE LA MARCA. EN LA LÍNEA DEBAJO DE ESTA EXPRESIÓN SE ENCUENTRA LA FRASE "A LA PARRILLA", ESCRITA EN LETRAS MAYÚSCULAS DE TIPO MOLDE EN COLOR NEGRO ABARCANDO EL ANCHO DEL LOGO, Y EN UN TAMAÑO INFERIOR A LA EXPRESIÓN "CHAIN", REPRESENTANDO UN AMPLIO Y RECONOCIDO PORTAFOLIO DE PRODUCTOS Y SERVICIOS DEL MERCADO PARRILLERO MARCANDO UN ESTILO DE ELEGANCIA, FUERZA Y PRESENCIA.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023004899.jpg', 154),
('denominativa', 'SALMTECH', NULL, NULL, 155),
('denominativa', 'VENTO', NULL, NULL, 156),
('mixta', 'PEPSI', 'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO BLANCO EN LA QUE SE OBSERVA, EN EL CENTRO, UNA FIGURA CIRCULAR DE BORDES DE COLOR NEGRO, LA CUAL CONTIENE EN SU INTERIOR DOS SEMICÍRCULOS, EL PRIMERO DISPUESTO EN LA PARTE SUPERIOR ES DE COLOR ROJO, Y TIENE UNA LÍNEA ONDULADA EN LA PARTE INFERIOR. EL SEGUNDO SEMICÍRCULO, DISPUESTO EN LA PARTE INFERIOR DEL CÍRCULO, ES DE COLOR AZUL OSCURO Y TIENE UNA LÍNEA ONDULADA EN LA PARTE SUPERIOR. EN EL MEDIO DEL CÍRCULO SE OBSERVA UNA FRANJA ONDULADA DE COLOR BLANCO EN LA QUE SE LEE LA PALABRA DE FANTASÍA PEPSI ESCRITA EN LETRA MOLDE, CARACTERÍSTICA, MAYÚSCULAS, DE TRAZO GRUESO Y DE COLOR NEGRO. LA PALABRA DE FANTASÍA PEPSI FORMA PARTE DE LA DENOMINACIÓN COMERCIAL DE MI MANDANTE. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023005319.jpg', 157),
('grafica', NULL, 'LA ETIQUETA QUE SE PRESENTA A CONTINUACIÓN CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE DOS FIGURAS ANGELICALES EN COLORES BLANCO, NEGRO Y GRIS. LA ILUSTRACIÓN ESTÁ CONFORMADA POR LOS ROSTROS DE DOS QUERUBINES, UNO DE CABELLO NEGRO QUE SE MUESTRA DE FRENTE Y EL OTRO DE CABELLO GRIS QUE SE MUESTRA DE PERFIL. SUS CUERPOS ESTÁN CUBIERTOS POR UN GRUPO DE TRES ALAS CON PLUMAS BLANCAS LEVEMENTE SOMBREADAS. AMBOS ÁNGELES PARECEN VER HACIA ARRIBA Y CADA UNO TIENE UN CINTILLO EN SU CABELLERA SOBRE EL QUE SE MUESTRA UNA PEQUEÑA ESTRELLA BLANCA DE CINCO PUNTAS. EL FONDO DE LA ETIQUETA ES BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023005349.jpg', 158),
('mixta', 'DECOPAINT', 'SE OBSERVA UN ISOLOGO EN FONDO BLANCO EN EL CENTRO DEL MISMO SE VISUALIZA UNA FIGURA COLOR NARANJA DEGRADANTE Y CON UN CIRCULO EN LA PARTE SUPERIOR CENTRADA DEBAJO DEL MISMO UN RECTÁNGULO DE COLOR AZUL Y DENTRO DE LA MISMA SE LEE EN MAYÚSCULA DECOPAINT EN COLOR BLANCO, CABE DESTACAR QUE A SIMPLE VISTA DICHO LOGO HACE UNA SEMEJANZA A UNA BROCHA, NO REIVINDICANDO LOS TÉRMINOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023005353.jpg', 159),
('mixta', 'PAFIA', 'CONSISTE EN UNA FIGURA IRREGULAR, DE BORDES DORADOS Y FONDO AZUL OSCURO, EN SU PARTE INFERIOR POSEE UNA CURVA CONVEXA, Y DE LADO DERECHO UNA SERIE DE TROZOS DE COLORES ORDENADADOS DE MAYOR A MENOR, INICIANDO DESDE EL PLATEADO, VERDE, VERDE OSCURO, GRIS, ROJO Y CULMINANDO DE MENOR TAMAÑO EL AMARILLO. DENTRO DEL MISMO SE LEE LA PALABRA PAFIA (PALABRA DE FANTASIA), DESCRITA EN MAYUSCULA Y LETRA MODEL, DE COLOR PLATEADO. SE REIVINDICA EL CONJUNTO ANTES DESCRITOS, EXCEPTUANDO TÉRMINOS GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023005521.jpg', 160),
