('mixta', 'MANPA ECOLOGY SUTIL', 'La marca mixta que se solicita consiste en una etiqueta rectangular de color blanco, dentro de la cual se observa, en la parte superior izquierda un triángulo invertido de color rojo (Pantone 179C) y fondo de color blanco dentro del cual se inserta la marca MANPA (Término de fantasía y parte de la razón social de la empresa titular) escrita en letras mayúsculas y en color azul (Pantone 7687C), justo debajo y ocupando casi toda la superficie central de la etiqueta, se encuentra el término ECOLOGY escrito en tipografía cursiva, en color Verde (Pantone 7732 C), con la particularidad que la letra E está escrita en mayúscula mientras que el resto de las letras se encuentran en minúscula. En el extremo inferior derecho del conjunto se aprecia el diseño tipográfico característico de la marca SUTIL en color blanco, escrita en grafía especial, con la característica que la letra S se encuentra en mayúscula y el resto en minúsculas, en forma cursiva e inserta dentro del diseño de un óvalo de fondo color verde (Pantone 7732 C), delineado su borde exterior por un trazo de color dorado (Pantone 385 C). Se reivindica el conjunto descrito y los colores señalados conforme a los facsímiles que se acompañan. No se reivindica protección ni exclusividad alguna sobre los términos genéricos individualmente considerados, sino como formando parte del conjunto.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006036.jpg', 165),
('mixta', 'MINISO', 'CONSISTE LA MARCA EN LA PALABRA DE FANTASÍA “MINISO” (PARTE DE LA RAZÓN SOCIAL DE LA SOLICITANTE), EN LETRAS ESTILIZADAS DE IMPRENTA MAYÚSCULA GRUESA EN COLOR NEGRO, LO ESENCIAL DE LA MARCA LO CONSTITUYE EL CONJUNTO DESCRITO. SE REIVINDICA EL COLOR NEGRO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006074.jpg', 166),
('mixta', 'PAOLA STUDIO', 'EL DISEÑO CONSISTE EN EL NOMBRE MARCARIO (PAOLA STUDIO) DISPUESTO SOBRE UN FONDO BLANCO. LAS LETRAS DEL CONJUNTO SON CARACTERÍSTICAS DE TRAZO CONTINUO, SEMIGRUESAS Y DE COLOR NEGRO, EL CONJUNTO SE ENCUENTRA LIGERAMENTE INCLINADO A LA DERECHA, LAS LETRAS P DE PAOLA Y S DE STUDIO SE ENCUENTRAN EN MAYÚSCULA.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006176.jpg', 167),
('denominativa', 'NANO WEB', NULL, NULL, 168),
('mixta', 'THOM SAILOR', 'LA ETIQUETA CONTIENE UNA FIGURA REDONDA DE COLOR ROJA, EN LA PARTE DE ADENTRO DE ESTA SE ENCUENTRA UNA FIGURA EN FORMA DE VELERO, DE COLOR ROJO CON EL FONDO DE COLOR NEGRO, DICHOS COLORES REIVINDICAN LA FIGURA, AL LADO DE ESTA EN LETRAS TIPO BICKHAM, DE COLOR NEGRO, LA PALABRA THOM SAILOR, CON FONDO COLOR BLANCO, DICHOS COLORES REIVINDICA LA ETIQUETA, PUDIENDO SER DE OTRO COLOR SEGÚN EL TIPO DE CALZADO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006527.jpg', 169),
('mixta', 'M', 'COMO SE PUEDE APRECIAR ES UNA “M” ENTRELAZADA CON UN ELIPSE, LA CUAL ESTA LEVEMENTE INCLINADA HACIA EL LADO DERECHO, DE BORDE DE COLOR NEGRO Y BLANCO, EL CUAL ES GRUESO EN SU PARTE DELANTERA Y DELGADA EN SU PARTE TRASERA. EN LA LETRA “M”, SE USÓ COMO REFERENCIA LAS INICIALES DEL NOMBRE DE LOS SOCIOS (ALEXANDRO Y ADRIANO), HACIENDO UNA FUSIÓN DE LAS MISMAS CREANDO UNA UNIÓN Y FORMANDO UNA “M”, QUE TERMINAN EN PUNTA EN FLECHAS, DANDO UN ACABADO DE ESTRUCTURA Y FIRMEZA. LA PALETA DE COLORES UTILIZADAS ES: AMARILLO: (#FFBB26) Y NEGRO: (#000000). SE ANEXA COPIA DETALLADA DE LA DESCRIPCIÓN. MARCADA CON LA LETRA “C”', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006642.jpg', 170),
('mixta', 'QUEENS LEAGUE', 'CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE UN ESCUDO DE COLOR MORADO, DENTRO DEL CUAL SE OBSERVA LA FIGURA DE UNA MUJER EN CUYA CABEZA LLEVA UNA CORONA Y EN SU MANO IZQUIERDA UNA ESFERA, TODO EL CONJUNTO ANTERIORMENTE DESCRITO ES DE COLOR BLANCO. DEBAJO SE LEE QUEENS LEAGUE (TRADUCEN AL CASTELLANO REINAS Y LIGA RESPECTIVAMENTE) UNA DEBAJO DE LA OTRA, ESCRITAS EN LETRA DE IMPRENTA, MAYÚSCULAS, DE TRAZO GRUESO Y COLOR MORADO. SE REIVINDICAN LAS PALABRAS QUEENS LEAGUE Y TODO EL CONJUNTO DESCRITO, CON LOS COLORES INDICADOS EN ÉL. NO SE REIVINDICAN LOS TÉRMINOS DESCRIPTIVOS O GENÉRICOS POR SI SOLO CONSIDERADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006692.jpg', 171),
('mixta', 'SUNTY MANZANA', 'CONSISTE EN UN RECTÁNGULO, UBICADO EN POSICIÓN HORIZONTAL, DIVIDIDO HORIZONTALMENTE POR UNA LÍNEA ONDULADA, SIENDO LA PARTE SUPERIOR DE COLOR VERDE Y LA PARTE INFERIOR DE COLOR ROJO, DONDE SE OBSERVAN BURBUJAS DE DISTINTOS TAMAÑOS DE COLOR AMARILLO Y HOJAS DE DISTINTOS TAMAÑOS, DE COLOR VERDE, DISTRIBUIDAS EN EL RECTÁNGULO. DENTRO DE ESTE SE LEEN EN DOS RENGLONES LAS PALABRAS: SUNTY MANZANA. SUNTY (PALABRA DE FANTASÍA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCIÓN), ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE TRAZO GRUESO Y COLOR BLANCO, CON BORDES DE TRAZO FINO Y EFECTO TRIDIMENSIONAL EN COLOR VERDE; CON LA PARTICULARIDAD QUE SOBRE LA LETRA S, SE OBSERVA LA REPRESENTACIÓN GRÁFICA DE UN SOL CONFORMADO POR UN TRAZO FINO CURVO Y 19 RAYOS RECTOS DE DIFERENTES TAMAÑOS, DE TRAZO FINO Y COLOR BLANCO. DEBAJO DE LAS LETRAS TY SE OBSERVA UNA HOJA DE COLOR VERDE, EN POSICIÓN HORIZONTAL, DONDE SE LEE LA PALABRA MANZANA, ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE MENOR TAMAÑO, DE TRAZO GRUESO Y COLOR BLANCO. DEBAJO SE OBSERVA LA MITAD DE UNA MANZANA, DE COLOR ROJO, SU TALLO FINO DE COLOR MARRÓN Y SALIENDO DE ÉL UNA HOJA DE COLOR VERDE. FRENTE A ELLA SE OBSERVA UN TRAZO GRUESO, ONDULADO, DE COLOR AMARILLO, QUE ASEMEJA SER UN CHORRO DE JUGO Y UBICADA AL FRENTE UNA MANZANA CORTADA A LA MITAD, DONDE SE OBSERVA SU CORAZÓN CON DOS SEMILLAS Y SU TALLO DE TRAZO FINO DE COLOR MARRÓN. SE REIVINDICA LA PALABRA SUNTY Y TODO EL CONJUNTO DESCRITO, CON LOS COLORES INDICADOS EN ÉL. NO SE REIVINDICAN LOS TÉRMINOS GENÉRICOS, DESCRIPTIVOS, NI DE USO COMÚN, INDIVIDUALMENTE CONSIDERADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023006946.jpg', 172),
('denominativa', 'CAFÉ SEMPITERNO', NULL, NULL, 173),
('mixta', 'ORIENTAL', 'SE PUEDE VISUALIZAR EN LA GRÁFICA EN UN FONDO DE COLOR BLANCO UNA FIGURA CONSTITUIDA DEL LADO IZQUIERDO, SE PUEDE OBSERVAR CINCO LINEAS SEMI-ONDULADAS QUE VAN DE COLOR VERDE OSCURO A VERDE CLARO, EN SU LADO DERECHO SE OBSERVA UNA FIGURA EN FORMA DE HOJA DE COLOR VERDE OSCURO CON UNA LINEA BLANCA EN EL CENTRO DE ELLA PARA COMPLETAR LA FIGURA EN EL CENTRO DE ELLAS SE PUEDE OBSERVAR UN SEMICIRCULAR EN REPRESENTACIÓN DE EL SOL, ENCIMA DE ÉL SE VE UNA ESPIGA EN FORMA ONDULADA AMBOS DE COLOR AMARILLO OSCURO, DEBAJO DE LA IMAGEN SE LEE LA PALABRA ORIENTAL, EN COLOR NEGRO, SIENDO LA LETRA O EN MINÚSCULA Y SU COMPLEMENTO EN MAYÚSCULA, SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007359.jpg', 174),
('mixta', 'TU ALIADO', 'EL MENCIONADO DISEÑO CONSISTE EN UNA ETIQUETA DE FONDO BLANCO EN CUYO INTERIOR EN LA PARTE CENTRICA SE ESCRIBE \"TU\" EN LETRA MOLDE DE TRAZO GRUESO EN COLOR AZUL OSCURO, SEGUIDO DEL DIBUJO UNICOLOR DEL PERFIL DE UNA PALMA ABIERTA DE UNA MANO DE LA MISMA TONALIDAD AZUL OSCURA, EN LA PARTE CENTRICA INFERIOR SE ESCRIBE \"ALIADO\" EN LETRA MOLDE DE TRAZO GRUESO EN COLOR AZUL OSCURO, SE REIVINDICA TODO LO AQUI DESCRITO Y COLORES MENOS LO QUE PODRIA CONSIDERARSE COMO GENERICO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007370.jpg', 175),
('mixta', 'MOTUL EGEN', 'LA ETIQUETA QUE SE PRESENTA A CONTINUACIÓN CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE LAS DENOMINACIONES MOTUL EGEN, ESCRITAS EN LETRAS MAYÚSCULAS ESTILIZADAS, DE TRAZOS GRUESOS Y DE COLOR BLANCO. POR SU PARTE, LA DENOMINACIÓN MOTUL SE ENCUENTRA ENMARCADA POR UN RECTÁNGULO DE COLOR ROJO MIENTRAS QUE LA DENOMINACIÓN EGEN ESTÁ ENMARCADA POR UN RECTÁNGULO CONTIGUO DE COLOR AZUL OSCURO. DENTRO DE LA PALABRA MOTUL, DESTACA EL DISEÑO DE LA LETRA T DADO QUE SU EXTREMO SUPERIOR IZQUIERDO TIENE UNA FORMA PUNTIAGUDA DELIMITADA POR EL CONTORNO DE LA LETRA O. EL FONDO DE LA ETIQUETA ES BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007420.jpg', 176),
('mixta', 'PALUZ', 'SE OBSERVA UN SIGNO MIXTO, EN CUYOS COMPONENTES SE APRECIAN UN ELEMENTO DENOMINATIVO Y OTRO FIGURATIVO. EL ELEMENTO DENOMINATIVO ESTÁ COMPUESTO POR LA PALABRA PALUZ EN LETRA IMPRENTA, MINÚSCULAS, TRAZO GRUESO, LAS LETRAS PA DE COLOR CELESTE Y LAS LETRAS LUZ DE COLOR AZUL. LA DENOMINACIÓN PALUZ NO TIENE TRADUCCIÓN AL CASTELLANO, CONSTITUYENDO UN SIGNO DE FANTASÍA, EL CUAL POSEE UN SIGNIFICADO PROPIO, ES TOTALMENTE FRUTO DE LA IMAGINACIÓN, Y NO TRANSMITE OTRO SIGNIFICADO MÁS QUE EL DE ACTUAR COMO MARCA. EL ELEMENTO FIGURATIVO, SE ENCUENTRA MANIFIESTO PRINCIPALMENTE A TRAVÉS DE UNA FIGURA QUE SE APRECIA A LA IZQUIERDA DEL ELEMENTO DENOMINATIVO, REPRESENTADA POR UN SEMI CIRCULO, COMPUESTO POR LA FIGURA DE DOS MANOS VISTAS DESDE UNA PERSPECTIVA FRONTAL DE COLOR BLANCO CON LÍNEAS CELESTE, LAS CUALES PARECEN ENVOLVER UNA PEQUEÑA CRUZ DE COLOR CELESTE. ASÍ PUES, LA DENOMINACIÓN TIENE UN TRAZO MODERNO CON LETRAS SIN REMATES Y BORDES CURVEADOS. SE REIVINDICA TODO EL DISEÑO EN SU CONJUNTO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007470.jpg', 177),
('denominativa', 'YALA', NULL, NULL, 178),
('mixta', 'ABBA ENMANUEL', 'AGUILA VOLANDO CON LETRAS DEL NOMBRE DE LA EMPRESA ABBA ENMANUEL', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007572.jpg', 179),
('mixta', 'BISTON', 'ETIQUETA RECTANGULAR DE FONDO BLANCO, SOBRE LA CUAL SE LEE LA PALABRA \"BISTON\" EN CARACTERES ESPECIALES, ATRAVESADA POR UNA LÍNEA COLOR NARANJA QUE LA DIVIDE EN DOS SEGMENTOS, UNO SUPERIOR DE COLOR AZUL CLARO Y UNO INFERIOR DE COLOR AZUL OSCURO, TODO EL CONJUNTO TERMINADO EN UNA FLECHA CONFORMADA POR DOS PARALELEPIPEDOS, UNO SUPERIOR DE COLOR NARANJA Y UNO INFERIOR DE COLOR AZUL DE LA MISMA TONALIDAD DEL SEGMENTO SUPERIOR DE LA PALABRA \"BISTON\"', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007614.jpg', 180),
('mixta', 'SMART HOME', 'Consiste en un conjunto sobre un fondo color blanco, sobre este se observa una figura que simula ser una letra (S), sin embargo dejamos claro que no forma parte del nombre marcario, pero si es parte del diseño, la figura tiene un trazo grueso de color gris oscuro con una línea gruesa color azul y se ve un segundo trazo de color blanco y construyen la letra (S). Debajo de esto se encuentra el nombre marcario (Smart Home) (Inteligente hogar), Smart en color gris y Home en color azul, las letras finas, en mayúscula, letra tipo imprenta. Se reivindica el conjunto y colores mencionados.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023007722.jpg', 181),
('mixta', 'JOHNSON&JOHNSON', 'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LAS PALABRAS “JOHNSON&JOHNSON”, ESCRITAS EN LETRA TIPO MOLDE, DE TRAZO GRUESO, COLOR ROJO, DONDE LAS LETRAS “J” SE PRESENTAN EN MAYÚSCULAS Y EL RESTO DE LAS LETRAS EN MINÚSCULAS, AMBAS PALABRAS “JOHNSON” ESTÁN SEPARADAS POR EL CARÁCTER O SÍMBOLO TIPOGRÁFICO “&” QUE REPRESENTA LA Y COMERCIAL Y ES LA CONJUNCIÓN COPULATIVA LATINA ET. TODO EL CONJUNTO ANTERIORMENTE DESCRITO SE OBSERVA SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACIÓN DE COLORES SEGÚN SE DESCRIBE. LA DESCRIPCIÓN DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023008002.jpg', 182),
('denominativa', 'SOL DE JANEIRO', NULL, NULL, 183),
('mixta', 'OMEGA ELECTRONICS', 'LA ETIQUETA DE LA MARCA “OMEGA ELECTRONICS” VIENE DADA POR UN SIMBOLO DE LA LETRA OMEGA GRIEGA (LA MITAD) EN COLOR AZUL OSCURO. AL LADO DEL MISMO SE OBSERVA EN LETRAS GRANDES DE COLOR NEGRO Y TRAZO FINO, LA PALABRA “OMEGA” DEBAJO DE LA CUAL SE LEE EN LETRAS PEQUEÑAS LA PALABRA ”ELECTRONICS” EN COLOR NEGRO EN LETRAS MÁS PEQUEÑAS PERO TIPO SCRIPT TAMBIÉN. NO SE REIVINDICA LA PARTE GENÉRICA.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023008010.jpg', 184),
('denominativa', 'CHOCOLATE LATINOAMERICANO SOSTENIBLE', NULL, NULL, 185),
('denominativa', 'BARBEBIEN', NULL, NULL, 186),
('mixta', 'ZAMUSA', 'Consiste en la representación gráfica de la palabra “ZAMUSA” escrita con un grafismo especial, con trazos gruesos, con la letra inicial “Z” con mayor tamaño; todas las letras se presentan con color azul turquesa, y con excepción de la letra inicial Z, todas presentan en diversas partes de su estructura algunos pequeños trazos con color negro; en la parte superior de este vocablo aparecen dos líneas paralelas semicurvas, con grosor creciente de izquierda a derecha, observándose la línea superior con mayor longitud que la línea inferior y que termina con su extremo derecho en forma de estrella de mediano tamaño; estas dos líneas paralelas se presentan con el mismo color azul turquesa con matices negros que tiene el vocablo ZAMUSA; todo el conjunto aparece sobre un fondo blanco, tal como se observa en la etiqueta. Se reivindican los colores descritos de la etiqueta.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023008291.jpg', 187),
('denominativa', 'ZUBI', NULL, NULL, 188),
('denominativa', 'SAINT LAURENT', NULL, NULL, 189),
('mixta', 'XETUX', 'CONSISTE EN UN LOGOTIPO CON EL FONDO COLOR ENTRE BLANCO Y NEGRO, QUE EN EL CENTRO SE APRECIA LA LETRA (X) EN DELINEADO DE COLOR NEGRO Y DE GRAN TAMAÑO, CON EL FONDO DE COLOR BLANCO LA MITAD DE LA LETRA IZQUIERDA, DEL LADO DERECHO DE LA LETRA ( X ) PARTE ES DE FONDO NEGRO, EN EL CENTRO SE OBSERVAN LAS LETRAS (ETUX) EN DELINEADO DE COLOR BLANCO CON UN FONDO DE COLOR NEGRO Y DE MENOR TAMAÑO QUE LA PRIMERA LETRA (X), SITUADAS EN EL MEDIO DE LA GRAN LETRA ( X ) TODAS ELLAS FORMAN LA PALABRA ( X,E,T,U,X,) LA CUAL ES UNA PALABRA COMPUESTA DE FANTASIA. NO SE REIVINDICAN LAS LEYENDAS GENÉRICAS, SE REIVINDICAN LOS COLORES, FORMAS Y DISEÑOS PRESENTADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023008677.jpg', 190),
('mixta', 'PINTURAS COINPICA', 'CONSISTE EN LAS PALABRAS “PINTURAS COINPICA” ESCRITAS EN DOS RENGLONES EN LETRAS MAYUSCULAS DE IMPRENTA COLOR NEGRO, RESALTANDO LA PALABRA DE FANTASIA “COINPICA” POR SER DE MAYOR TAMAÑO Y POR FORMAR LA LETRA “O” DE DICHA PALABRA UN CIRCULO SIN CERRAR EN COLOR AZUL CIELO. TODO LO ANTES DESCRITO SE ENCUENTRA SOBRE UN FONDO RECTANGULAR COLOR NEGRO. NO REINVINDICAMOS EL TERMINO PINTURAS. COINPICA ES UNA PALABRA DE FANTASÍA, Y NO SE REIVINDICA EL TERMINO GENERICO PINTURAS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023008927.jpg', 191),
('mixta', 'LEVARE', 'CONSISTE EN UNA ETIQUETA RECTANGULAR DE FONDO BLANCO EN LA QUE SE LEE LA PALABRA DE FANTASÍA LEVARE, TAMBIÉN PARTE DEL NOMBRE DE MI MANDANTE, EN LETRAS GRANDES, CARACTERÍSTICAS, MINÚSCULAS, DE TRAZO GRUESO Y COLOR NEGRO, CON LA PARTICULARIDAD DE QUE LA LETRA L SE REPRESENTA POR UNA LÍNEA VERTICAL CURVA ASCENDENTE DE DERECHA A IZQUIERDA Y OTRA LÍNEA HORIZONTAL EN LA PARTE INFERIOR. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009040.jpg', 192),
('denominativa', 'GREINO', NULL, NULL, 193),
('mixta', 'DELANTO', 'Se describe una etiqueta fondo blanco, dónde se observa el logo que se lee como \\\\\\\"delanto\\\\\\\", una palabra de fantasía la cual finalizando el diseño se observa la silueta de una flecha doble y curva que parte de la letra \\\\\\\" t\\\\\\\" y termina en la letra \\\\\\\"o\\\\\\\", en color ,azul rey, todo lo descrito,Se REIVINDICAN el conjunto decrito.,Se REIVINDICAN los colores descritos.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009386.jpg', 194),
('denominativa', 'SABRE', NULL, NULL, 195),
('mixta', 'YOY', 'SE TRATA DE UNA ETIQUETA DE FONDO BLANCO DONDE SE PUEDEN OBSERVAR EN LA PARTE IZQUIERDA SUPERIOR Y POSTERIOR DOS FIGURAS FANTASIOSAS EN FORMA DE SEMI ARCO Y COLOR CELESTE, EN LA CUAL LA DE ARRIBA ES MÁS PEQUEÑA QUE LA DE ABAJO, EN SU PARTE CENTRAL SUPERIOR SE PUEDE NOTAR UNA FRANJA VERTICAL DE TRAZO GRUESO Y DE COLOR CELESTE, EN LA PARTE SUPERIOR DERECHA SE PUEDE APRECIAR UN CÍRCULO EN COLOR CELESTE, TODO LO DESCRITO FORMA LA FIGURA CARICATURESCA DE UNA CARA GUIÑANDO EL OJO IZQUIERDO; EN LA PARTE DE ABAJO SE PUEDE LEER LA PALABRA DE FANTASÍA QUE NO TIENE TRADUCCIÓN ALGUNA YÖY ESCRITA EN LETRAS DE MOLDE DE TRAZO GRUESO Y COLOR CELESTE EN DONDE LA PRIMERA LETRA (Y) ESTÁ ESCRITA EN MAYÚSCULA, LA LETRA (Ö) ESTÁ ESCRITA EN MINÚSCULA Y LA MISMA PRESENTA EN SU PARTE SUPERIOR DOS CUADRADOS DE TRAZO GRUESO Y COLOR CELESTE, LA SEGUNDA LETRA (Y) ESTÁ ESCRITA EN MINÚSCULA. SE REIVINDICAN LOS COLORES Y LOS TÉRMINOS DESCRITOS.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009487.jpg', 196),
('denominativa', 'NIZOX', NULL, NULL, 197),
('mixta', 'CALIFORNIA COLLECTION', 'LA MARCA SOLICITADA CONSISTE, EN UNA ETIQUETA SIN ENMARCAR, SIN FONDO DE COLOR. SE APRECIA UNA FLOR DE PETALOS OVALADOS PUNTIAGUDOS, CUYOS PETALOS INTERNOS SON DE COLOR GRIS OSCURO Y LOS PETALOS EXTERNOS SON DE COLOR GRIS INTERMEDIO. DEBAJO DE LA FLOR ESTA ESCRITO LA PALABRA CALIFORNIA COLLECTION. LA PALABRA CALIFORNIA ESTA ESCRITA EN LETRA CORRIDA, EN CURSIVA, EN NEGRITA Y DE COLOR GRIS INTERMEDIO; LA PALABRA COLLECTION ESTA ESCRITA EN LETRA IMPRENTA, EN CURSIVA, DE COLOR GRIS INTERMEDIO. LA PALABRA COLLECTION EN IDIOMA CASTELLANO SIGNIFICA COLECCION.SE REIVINDICA EL CONJUNTO DESCRITO A EXCEPCION DE LOS ELEMENTOS GENERICOS QUE LA PRESENTE ETIQUETA PUDIESE CONTENER.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009612.jpg', 198),
('mixta', 'IMPOL', 'Consiste en una etiqueta de fondo color blanco, sobre la cual se observa una figura triangular, compuesta por tres figuras irregulares, todas ellas en forma de boomerang, entrelazadas entre ellas, siendo la del extremo izquierdo de fondo color amarillo, la del extremo superior de fondo color negro, y la del extremo derecho de fondo color verde oscuro, con la particularidad de que el centro de la figura se observa de color blanco. Debajo de la figura antes descrita, se lee la palabra IMPOL, escrita en letras características, en formato imprenta, en mayúsculas y de fondo color verde oscuro. Se reivindica el conjunto descrito y los colores en él señalados.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009789.jpg', 199),
('grafica', NULL, 'EL LOGOTIPO DE "KORAL OHS HOTEL & MARINA MORROCOY" SE DSCRIBE EN UNA SUPERFICIE COLOR BLANCO, LAS LETRAS "K" EN COLOR MARRON OSCURO, "O" EN COLOR MOSTAZA CLARO, "RAL" EN COLOR MARRÓN OSCURO, EN LA PARTE SUPERIOR DE LA LETRA "O" SE ENCUENTRAN UBICADOS UNOS PÉTALOS U HOJAS DE LOS CUALES UNO ESTÁ EN COLOR MOSTAZA CLARO Y OTRO EN MARRÓN OSCURO, DEBAJO DE LA PALABRA KORAL, LAS LETRAS "OHS HOTEL & MARINA" EN COLOR MARRÓN OSCURO Y DEBAJO DE ESTAS, LAS LETRAS "MORROCOY" EN COLOR MOSTAZA CLARO. SE REIVINDICA LA TOTALIDAD DEL LOGO QUE SE PRETENDE PROTEGER Y TAMBIÉN SE REIVINDICA EN TODOS LOS COLORES EN QUE SE PRESENTE EL MISMO.LA CENTRALIDAD DE LOS ELEMENTOS DEFINE UNA SIMETRÍA EXACTA Y DE ALTO CONTRASTE ENTRE TIPOGRAFÍA Y SILUETAS CREANDO UN BUEN IMPACTO PSICOLÓGICO VISUAL. SE SOLICITA EL USO EXCLUSIVO DE LOS ELEMENTOS GRÁFICOS QUE LA INTEGRAN, ASÍ COMO DE LOS COLORES ARRIBA INDICADOS, A EXCEPCIÓN DE AQUELLOS COMPONENTES QUE POR SU NATURALEZA PUDIERAN CONSIDERARSE GENÉRICOS O DESCRIPTIVOS DE LOS PRODUCTOS QUE PRETENDE DISTINGUIR.', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009931.jpg', 200),
('mixta', 'AIKOZ', 'CONSISTE EN UN RECTANGULO DE COLOR BLANCO, DENTRO DE ESTE SE ENCUENTRA LA PALABRA DE FANTASIA AIKOZ, EN UNA TIPOGRAFIA ESPECIAL, LA LETRA A Y Z ESTAN DE COLOR AMARILLO MOSTAZA Y LAS LETRAS I, K Y O ESTAN DE COLOR VERDE CLARO, A EXCEPCION DEL PUNTO QUE SE ENCUENTRA ARRIBA DE LA I , QUE ESTA DE COLOR AMARILLO MOSTAZA. DEBAJO DE LA PALABRA DE FANTASIA SE ENCUENTRA UNA LINEA EN FORMA DE MEDIA LUNA DE COLOR VERDE CLARO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LA COMBINACION DE COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHA 18 DE NOVIEMBRE DE 1996', 'http://grafico.sapi.gob.ve/marcas/ef2023/2023009999.jpg', 201),
('denominativa', 'THYGENEXT', NULL, NULL, 202),
('denominativa', 'RASPA TU SUERTE', NULL, NULL, 203),
('denominativa', 'FEMDIEN', NULL, NULL, 204),
('mixta', 'BIMBA Y LOLA', 'CONSISTE EN LAS PALABRAS BIMBA Y LOLA (PROVIENEN DEL NOMBRE DEL SOLICITANTE, TAL Y COMO SE SOLICITAN NO TIENE TRADUCCIÓN) ESCRITAS EN LETRA DE IMPRENTA, MAYÚSCULAS, DE TRAZO GRUESO Y COLOR NEGRO. SE REIVINDICAN LAS PALABRAS BIMBA Y LOLA Y TODO EL CONJUNTO DESCRITO CON EL COLOR INDICADO EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024000663.jpg', 205),
('mixta', 'Gmillet', 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecia el termino GMILLET siendo que la letra G está escrita en letra molde, mayúscula de color verde aguamarina, el trazado de dicha letra G está unida a lo que se asemeja a un semi-círculo de color verde aguamarina, seguidamente se observa el termino MILLET escrita en letra de molde, minúscula, de color negro. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genéricos (GMILLET= PALABRA DE FANTASIA), todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024000709.jpg', 206),
('denominativa', 'PROBIOMED', NULL, NULL, 207),
('denominativa', 'MEGAN BATLA', NULL, NULL, 208),
('mixta', 'ROSWILL', 'CONSISTE EN LA REPRESENTACION GRAFICA DE LA PALABRA ROSWILL, LA CUAL PROVIENE DE LA UNION DE DOS NOMBRES "ROSMERY" Y "WILLIAM". LA MARCA A PROTEGER ESTA ESCRITA EN LETRAS MAYUSCULAS DE COLOR BLANCO CENTRADA EN UN FONDO DE COLOR FUCSIA. SE REIVINDICAN LOS COLORES.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024000970.jpg', 209),
('mixta', 'LUATEK', 'CONSISTE EN LA PALABRA LUATEK (PALABRA DE FANTASÍA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCIÓN) ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE TRAZO GRUESO Y DE COLOR AZUL; CON LA PARTICULARIDAD QUE LA BARRA HORIZONTAL DE LA LETRA A Y EL TRAZO MEDIO HORIZONTAL DE LA LETRA E, NO TIENEN CONTACTO CON EL ASTA IZQUIERDA DE LAS LETRAS. SE REIVINDICA LA PALABRA LAUTEK Y TODO EL CONJUNTO DESCRITO CON EL COLOR INDICADO EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024000983.jpg', 210),
('mixta', 'MAREAH', 'SE DESCRIBE UNA ETIQUETA DONDE SE OBSERVA UN DISEÑO EN LA PARTE SUPERIOR DE DOS LÍNEAS GRUESAS CURVAS, QUE SE UNEN EN EL EXTREMO INFERIOR IZQUIERDO, COMPUESTO POR LOS COLORES ROSADO, ANARANJADO Y AMARILLO DEGRADO QUE VAN EN ESE ORDEN DE IZQUIERDA A DERECHA. ABAJO SE OBSERVA LA PALABRA FANTASÍA \\\"MAREAH\\\" EN MAYÚSCULA CON UNA TIPOGRAFÍA GRUESA Y ESPECIAL EN LAS LETRAS \\\"A\\\" Y \\\"H\\\" EN EL COLOR AZUL MARINO. SE REIVINDICA EL CONJUNTO DESCRITO CON INDEPENDENCIA DEL TAMAÑO, Y NO ASÍ LAS PALABRAS, LEYENDAS GENÉRICAS O DESCRIPTIVAS POR SEPARADO, TODO SE ACUERDO A LOS FACSÍMILES QUE SE ACOMPAÑAN. SE REIVINDICAN LOS COLORES DESCRITOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001107.jpg', 211),
('mixta', 'ARABITO FERRETERIAS', 'Consiste en el termino ARABITO escrito en letra caracteristica en donde la letra A esta en color naranja y la letra O en color naranja y en el centro tiene forma de hexagono el resto de las letras en color negro y el punto de la letra i en color naranja separada por una linea blanca. Debajo del termino ARABITO destaca el termino FERRETERIAS (No se reivindica) escrita en letra caracteristica, en menor tamaño y en color negro. El conjunto antes descrito esta sobre un fondo blanco. Se reivindica el conjunto descrito y los colores. No se reivindica el termino Ferreterias.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001117.jpg', 212),
('denominativa', 'EVOLUTION', NULL, NULL, 213),
('mixta', 'MAXWELL', 'SE OBSERVA UN SIGNO MIXTO, EN CUYOS COMPONENTES SE APRECIAN UN ELEMENTO DENOMINATIVO Y OTRO FIGURATIVO. EL ELEMENTO DENOMINATIVO ESTÁ COMPUESTO POR LA PALABRA MAXWELL, EN LETRA IMPRENTA, EN MAYÚSCULAS Y DE COLOR NEGRO. LA DENOMINACIÓN MAXWELL NO TIENE TRADUCCIÓN AL CASTELLANO, CONSTITUYENDO UN SIGNO DE FANTASÍA, EL CUAL POSEE UN SIGNIFICADO PROPIO, ES TOTALMENTE FRUTO DE LA IMAGINACIÓN, Y NO TRANSMITE OTRO SIGNIFICADO MÁS QUE EL DE ACTUAR COMO MARCA. EL ELEMENTO FIGURATIVO, SE ENCUENTRA MANIFIESTO A TRAVÉS DE LA FIGURA DE UN OSO POLAR DE COLOR BLANCO, EN EL CUAL LAS LÍNEAS SUPERIORES SON DE COLOR NEGRO, MIENTRAS QUE LAS INFERIORES SON DE COLOR ROJO, EN ESTE SENTIDO, LA FIGURA DEL OSO POLAR SE ENCUENTRA DIRECCIONADA CON LA CABEZA HACIA LA DERECHA Y SE UBICA SOBRE UNA LÍNEA FINA DE COLOR ROJO. POR OTRO LADO, LA PALABRA MAXWELL SE ENCUENTRA UBICADA EN LA PARTE INFERIOR DEL REFERIDO DISEÑO SOBRE UNA LÍNEA DE COLOR NEGRO. SE REIVINDICA TODO EL DISEÑO EN SU CONJUNTO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001327.jpg', 214),
('mixta', 'SEU ALIMENTOS', 'Consiste en un diseño cuadrado de fondo blanco, en donde se puede observar escrita de forma horizontal la palabra SEU (palabra de fantasía), en letras de imprenta, mayúsculas, de trazo grueso y de color negro y bordes blancos. Debajo de esta, se aprecia la palabra Alimentos, escrita en letra de molde, mayúsculas, de trazo fino y de color negro, en tamaño más pequeño. En la parte inferior de la letra “S”, parte una línea ondulada, la cual lleva una dirección ascendente y más gruesa en su parte central, terminando en una parte fina en su parte más alta y es de color rojo y finaliza sobre la letra “N” de la palabra alimentos. Paralela a esta, se encuentra otra línea ondulada, con las mismas características, de color naranja, con la diferencia que parte desde la parte inferior de la letra “U” y finaliza sobre la letra “S” de la palabra alimentos. Se reivindica el conjunto descrito, con su combinación de colores a excepción del termino genérico “Alimentos”.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001377.jpg', 215),
('mixta', 'FLUXUS', 'CONSISTE EN LA PALABRA FLUXUS (TRADUCE AL CASTELLANO: FLUJO), ESCRITA EN LETRAS DE IMPRENTA, MAYÚSCULAS, DE TRAZO GRUESO Y DEGRADADAS DE COLOR AZUL CLARO A OSCURO DE IZQUIERDA A DERECHA. EN LA PARTE SUPERIOR SE OBSERVA LA FIGURA DE UN SHURIKEN AZUL DE TRES PUNTAS, CADA UNA FORMADA POR UNA MEDIALUNA Y UNIDAS EN EL CENTRO FORMANDO UNA GOTA DE COLOR BLANCO. SE REIVINDICA LA PALABRA FLUXUS Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001415.jpg', 216),
('mixta', 'T TAWALA', 'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO, DENTRO DE LA CUAL SE OBSERVA EN SU PARTE CENTRAL UNA LETRA \"T\" MAYÚSCULA, EN LETRA MOLDE Y ESCRITA DE UNA FORMA PARTICULAR, EN CUANTO A SUS TERMINACIONES SUPERIORES E INFERIORES, DE TRAZO GRUESO DE COLOR NEGRO ENTREVIENDO EL FONDO DE COLOR BLANCO DE LA ETIQUETA, VIÉNDOSE A SU VEZ INTERRUMPIDA EN SU PARTE CENTRAL POR LA PALABRA DE FANTASÍA \"TAWALA\", LA CUAL SE PROYECTA EN LETRA MOLDE Y MAYÚSCULA SOSTENIDA, TENIENDO EN SU COMPOSICIÓN LAS SIGUIENTES CARACTERÍSTICAS: LA LETRA \"T\" Y \"L\" ESTÁN ESCRITA EN COLOR NEGRO Y BORDEADAS CON UNA LÍNEA SEMI GRUESA DE COLOR NEGRO DEJANDO VER EL COLOR BLANCO DEL FONDO DE LA ETIQUETA; LAS LETRAS \"AWA\" Y \"A\" SE PROYECTAN DE COLOR NEGRO BORDEADAS CON UNA LÍNEA SEMI GRUESA DE COLOR NEGRO OBSERVÁNDOSE CON UN EFECTO DE SOMBRA IRREGULAR Y ENTREVIENDO EL FONDO BLANCO DE LA ETIQUETA. SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001548.jpg', 217),
('mixta', 'WILD OLIVE', 'La marca consiste en la palabra WILD OLIVE (Olivo Silvestre), escrita en letras mayúsculas, manuscritas, estilizadas, gruesas de color negro sobre la cual se halla la figura de un ramillete de tres hojas con dos olivos en negro, gris y con toques ligeramente abrillantados, todo lo descrito sobre un fondo blanco. Lo esencial de la marca lo constituye el conjunto descrito. Se reivindican los colores blanco, negro y gris.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001716.jpg', 218),
('mixta', 'KALY', 'ES UN CIRCULO AMARILLO QUE ACEMEJA EL SOL CON UNA FINA LINEA DE COLOR BLANCO QUE BORDEA EL CIRDULO Y EN EL CENTRO DEL MISMO SE ENCUENTRA LA PALABRA KALY LETRAS DE COLOR ROJO Y EL BORDE DE COLOR BLANCO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001777.jpg', 219),
('denominativa', 'HANA', NULL, NULL, 220),
('mixta', 'MOLINA VIAJES', 'SE OBSERVAN LAS PALABRAS MOLINA (ARRIBA)VIAJES (ABAJO), ESCRITAS EN LETRAS MINÚSCULAS DE TRAZO GRUESO Y COLOR VERDE PINO (P132-16), AMBAS SOBRE FONDO COLOR NEGRO. DENTRO DE LA PALABRA MOLINA SE DISTINGUE UNA FIGURA CARACTERÍSTICA EN FORMA DE BRÚJULA EN EL LUGAR DE LA LETRA \"O\". SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001987.jpg', 221),
('mixta', 'PREMIER PADEL', 'CONSISTE EN UN DISEÑO EN EL CUAL SE LEE \\\"PREMIER PADEL\\\" (PRINCIPAL PADEL) EN LETRAS ESTILIZADAS, DE TRAZO GRUESO, MAYÚSCULAS Y DE COLOR NEGRO; CON LA PARTICULARIDAD QUE LAS PALABRAS ESTÁN EN DIFERENTE NIVEL Y LAS LETRAS EN EL NIVEL INFERIOR SON DE MAYOR TAMAÑO. EN \\\"PADEL\\\" A LA LETRA \\\"P\\\" LE FALTA UN SEGMENTO EN SU TRAZO, DEL LADO IZQUIERDO. DEL LADO IZQUIERDO DEL TEXTO, SE APRECIA UN DISEÑO, DE COLOR GRIS, DONDE SE OBSERVA UNA FIGURA QUE SEMEJA UNA ESTRELLA DE CINCO PUNTAS; CON LA PARTICULARIDAD QUE EN CADA UNA DE LAS PUNTAS SE EXTIENDE UNA FIGURA QUE SEMEJA UNA GOTA DE AGUA (IGUAL EN COLOR GRIS), LA CUAL TIENE SU PARTA MÁS ESTRECHA EN DIRECCIÓN A LA PUNTA CORRESPONDIENTE DE LA ESTRELLA. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS. NO SE REIVINDICA POR SEPARADO LOS TÉRMINOS GENÉRICOS Y/O ALUSIVOS AL PRODUCTO/SERVICIO, TALES COMO \\\"PADEL\\\", PERO SI EN SU CONJUNTO Y SEGÚN LO DISPUESTO EN LA IMAGEN.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024001997.jpg', 222),
('mixta', 'LABANCALAW', 'CONSISTE EN UNA ETIQUETA SOBRE UN FONDO BLANCO CONFORMADA POR LA PALABRA \\\"LABANCA ESCRITA EN LETRA DE MOLDE DE TRAZOS DELGADOS DE COLOR DORADO EN DONDE LA PRIMERA Y ÚLTIMA \\\"A\\\" TIENE EN EL MEDIO UN PUNTO DE COLOR DORADO Y LA \\\"A\\\" DEL MEDIO TIENE EN EL PRIMERO DE SUS EXTREMOS UNA FIGURA QUE ASEMEJA A UNA PLUMA ASIMISMO, LA LETRA \\\"N\\\" TIENE UN LIGERO ESPACIO ENTRE LAS LINEAS QUE LA CONFORMAN, EN LA PARTE INFERIOR SE REPRODUCE EL CONJUNTO DE PALABRAS \\\"LAW FIRM & CONSULTING (QUE TRADUCIDO DEL IDIOMA INGLÉS AL ESPAÑOL SIGNIFICA FIRMA LEGAL Y CONSULTORIA), ESCRITO EN LETRAS DE MOLDE DE COLOR DORADO DE MENOR TAMAÑO. NO SE REIVINDICAN LAS PALABRAS \\\"LAW FIRM & CONSULTING PORQUE PESE A ESTAR ESCRITAS EN INGLÉS SU SIGNIFICADO ES TRANSPARENTE PARA LA MAYORÍA DEL PÚBLICO REIVINDICAN LOS COLORES, DISEÑOS Y FORMAS. SE REIVINDICA LOS COLORES, DISEÑOS Y FORMAS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024002137.jpg', 223),
('grafica', NULL, 'CONSISTE EN UNA CIRCUNFERENCIA, CON BORDE DE TRAZO FINO, DE COLOR NEGRO Y EN SU INTERIOR DE COLOR BLANCO. SUPERPUESTO SOBRE ÉL SE ENCUENTRA UN TRIANGULO DE COLOR BLANCO, DENTRO DE ÉL SE OBSERVAN DOS TRAZOS INCLINADOS GRUESOS UNIDOS EN SU PARTE INFERIOR DE COLOR NEGRO. SE REIVINDICA TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024002185.jpg', 224),
('mixta', 'B BESTANDIG APPLIANCES', 'EL DISEÑO CONSISTE EN UN FONDO CUADRADO DE COLOR NEGRO, UNA LETRA B EN LA PARTE SUPERIOR DE COLOR GRIS EN DISTINTOS TONOS Y CREADA EN FORMA DE RELIEVE, SEGUIDO DE ESTO, SE LEE BESTANDIG EN LETRAS MAYÚSCULAS DE COLOR BLANCO (BESTANDIG TRADUCIDO DEL ALEMÁN AL CASTELLANO SIGNIFICA RESISTENTE), FINALMENTE EN LA PARTE INFERIOR SE LEE APPLIANCES EN LETRAS DELGADAS, MAYÚSCULAS Y DE COLOR BLANCO (APPLIANCES TRADUCIDO DEL INGLÉS AL CASTELLANO SIGNIFICA ACCESORIOS), LA PALABRA APPLIANCES NO SE REIVINDICA POR SER TERMINO GENÉRICO, PERO SÍ SE REIVINDICA TODO EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024002217.jpg', 225),
('mixta', 'B BESTANDIG APPLIANCES', 'EL DISEÑO CONSISTE EN UN FONDO CUADRADO DE COLOR NEGRO, UNA LETRA B EN LA PARTE SUPERIOR DE COLOR GRIS EN DISTINTOS TONOS Y CREADA EN FORMA DE RELIEVE, SEGUIDO DE ESTO, SE LEE BESTANDIG EN LETRAS MAYÚSCULAS DE COLOR BLANCO (BESTANDIG TRADUCIDO DEL ALEMÁN AL CASTELLANO SIGNIFICA RESISTENTE), FINALMENTE EN LA PARTE INFERIOR SE LEE APPLIANCES EN LETRAS DELGADAS, MAYÚSCULAS Y DE COLOR BLANCO (APPLIANCES TRADUCIDO DEL INGLÉS AL CASTELLANO SIGNIFICA ACCESORIOS), LA PALABRA APPLIANCES NO SE REIVINDICA POR SER TERMINO GENÉRICO, PERO SÍ SE REIVINDICA TODO EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024002221.jpg', 226),
('mixta', 'GATHOPE', 'CONSISTE EN UN DISEÑO EN EL CUAL SE LEE \\\"GATHOPE\\\" (PALABRA DE FANTASÍA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCIÓN) EN LETRAS MINÚSCULAS (SALVO LA LETRA \\\"G\\\" Y LA \\\"H\\\"), EN COLOR NEGRO Y TRAZO GRUESO. DEL LADO IZQUIERDO DE LA PALABRA ANTES MENCIONADA SE OBSERVA UNA FIGURA DE FANTASÍA DE FORMA IRREGULAR CON UNA PUNTA QUE SOBRESALE EN SU PARTE INFERIOR IZQUIERDA, CON BORDE COLOR NEGRO Y FONDO BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024002353.jpg', 227),
