('mixta', 'SOR', 'SE TRATA DE UNA ETIQUETA CUADRADA SIN MARCO DONDE SE OBSERVA UNA FIGURA RECTANGULAR IRREGULAR DE COLOR ROJO CON LOS EXTREMOS REDONDEADOS, EN DONDE SE LEE LA PALABRA SOR, ESCRITO EN LETRAS DE MOLDE EN MINÚSCULAS Y EN COLOR BLANCO, EN CURSIVA. EN EL EXTREMO SUPERIOR IZQUIERDO DE LA FIGURA SE OBSERVA UNA FRANJA EN COLOR VERDE EN DEGRADADO Y EN EL EXTREMO INFERIOR DERECHO DE LA MISMA SE OBSERVA UNA FRANJA EN COLOR AMARILLO EN DEGRADADO. LA PALABRA SOR EN CASTELLANO ES UN SUSTANTIVO UTILIZADO PARA REFERIRSE A UNA MONJA (HERMANA CONTEMPLATIVA) O UNA HERMANA RELIGIOSA. EL CONJUNTO DESCRITO SE ENCUENTRA SOBRE UN FONDO EN COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO, INCLUYENDO LOS COLORES, PERO NO SE REIVINDICAN TÉRMINOS DE USO GENÉRICO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003180.jpg', 232),
('mixta', 'SOR', 'SE TRATA DE UNA ETIQUETA CUADRADA SIN MARCO DONDE SE OBSERVA UNA FIGURA RECTANGULAR IRREGULAR DE COLOR ROJO CON LOS EXTREMOS REDONDEADOS, EN DONDE SE LEE LA PALABRA SOR, ESCRITO EN LETRAS DE MOLDE EN MINÚSCULAS Y EN COLOR BLANCO, EN CURSIVA. EN EL EXTREMO SUPERIOR IZQUIERDO DE LA FIGURA SE OBSERVA UNA FRANJA EN COLOR VERDE EN DEGRADADO Y EN EL EXTREMO INFERIOR DERECHO DE LA MISMA SE OBSERVA UNA FRANJA EN COLOR AMARILLO EN DEGRADADO. LA PALABRA SOR EN CASTELLANO ES UN SUSTANTIVO UTILIZADO PARA REFERIRSE A UNA MONJA (HERMANA CONTEMPLATIVA) O UNA HERMANA RELIGIOSA. EL CONJUNTO DESCRITO SE ENCUENTRA SOBRE UN FONDO EN COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO, INCLUYENDO LOS COLORES, PERO NO SE REIVINDICAN TÉRMINOS DE USO GENÉRICO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003181.jpg', 233),
('denominativa', 'PAISAJE GLOBAL', NULL, NULL, 234),
('denominativa', 'CITRACELL-PROTECT', NULL, NULL, 235),
('mixta', 'M M', 'CONSISTE EN UNA ETIQUETA CUADRADA DE FONDO COLOR NEGRO Y BORDE DE COLOR BLANCO, DONDE SE OBSERVAN LAS LETRAS M Y M, ESCRITAS EN LETRA DE IMPRENTA, MAYUSCULA, DE TRAZO GRUESO, DE FONDO COLOR BLANCO, CON LA PARTICULARIDAD DE QUE DEBAJO DE LAS MISMAS, SE ENCUENTRAN DOS SEMICIRCULOS DE FONDO COLOR BLANCO, Y DENTRO DE LAS MISMAS SE ENCUENTRAN UNA FIGURA QUE ASEMEJA LA REPRESENTACION GRAFICA DE LA CABEZA DE UN PERRO Y SUS OREJAS DE FONDO COLOR NEGRO, Y EN LA DE AL LADO, UNA FIGURA QUE ASEMEJA LA REPRESENTACION GRAFICA DE LA CABEZA DE UN GATO CON SUS OREJAS, DE FONDO COLOR NEGRO. SE REIVINDICA TODO EL CONJUNTO DESCRITO ANTERIORMENTE, CON LOS COLORES INDICADOS EN EL, EXCEPTUANDO LOS TERMINOS GENERICOS Y DESCRIPTIVOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003318.jpg', 236),
('mixta', 'FarmaPay', 'El signo solicitado consiste en un diseño conformado por los siguientes elementos: Se aprecia el término FARMAPAY escrita en letra molde, de trazado delgado y de color negro, siendo que las letras F y P están en mayúscula y el resto en minúscula. Se reivindica el conjunto y colores descritos con independencia del tamaño, y no así las palabras o términos genérico, a saber: (FARMAPAY= Palabra de Fantasía, Por separado traducción del Inglés al Español de Pay - Pagar) todo de acuerdo a los facsímiles que se acompañan.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003463.jpg', 237),
('mixta', 'AGC YOUR DREAMS, OUR CHALLENGE', 'LA ETIQUETA QUE SE PRESENTA A CONTINUACIÓN CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE LA DENOMINACIÓN AGC YOUR DREAMS, OUR CHALLENGE (AGC = PARTE DEL NOMBRE DEL MANDANTE, YOUR = SUS, DREAMS = SUEÑOS, OUR = NUESTRO, CHALLENGE = DESAFÍO), LAS LETRAS AGC SE ENCUENTRAN ESCRITA EN MAYÚSCULAS, DE COLOR AZUL OSCURO, CON LA PARTICULARIDAD QUE LA LETRA G PRESENTA EN LA PARTE INTERIOR UNA FRANJA DE COLOR ROJO EN FORMA DE TRAPEZOIDE, DEBAJO DE LAS LETRAS AGC SE ENCUENTRAN LA DENOMINACIÓN YOUR DREAMS, OUR CHALLENGE ESCRITA EN MINÚSCULAS, DE COLOR GRIS OSCURO, CON LA PARTICULARIDAD QUE LAS LETRAS Y, D, O Y C SE ENCUENTRAN ESCRITAS EN MAYÚSCULAS. EL FONDO DE LA ETIQUETA ES BLANCO, SE REIVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003557.jpg', 238),
('mixta', 'ASTER', 'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO, EN ELA CUAL SE PUEDE OBSERVAR EL NOMBRE MARCARIOS DISPUESTO EN LETRA MAYUSCULA Y TRAZO GRUESO CARACTERISTICO. ASTER CONSISTE EN UNA PALABRA DE FANTASIA, LA PARTICULARIDAD DE LA MARCA ES QUE LA LETRA R SOBRE SALE DEL CONJUNTO Y SE UNE CON UNAS FIGURAS DE COLOR BLANCO EN LO ALTA AZUL Y ROJA A LOS COSTADOS, EN TOTAL SON 3 FIGURAS SEMI CIRCULARES.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003597.jpg', 239),
('mixta', 'IZY', 'LA MARCA CONSISTE EN UNA REPRESENTACIÓN GRÁFICA DEL TÉRMINO DE FANTASÍA IZY EN COLOR AZUL Y ESCRITA EN CARACTERES DE IMPRENTA DE TRAZO GRUESO, DONDE LA LETRA I SE REPRESENTA EN MINÚSCULA Y EL RESTO DE LAS LETRAS SON MAÝÚSCULAS DE COLOR AZUL MÁS OSCURO, DEGRADANDO SUS EXTREMOS EN COLOR AZUL MÁS CLARO HACIA EL LADO DERECHO DEL SIGNO, COMO SE PUEDE OBSERVAR LA LETRA Z CORTA CON UNA LÍNEA SINUOSA INFERIOR A LA LETRA Y; LAS LETRAS TIENEN APARIENCIA Y BRILLOS PARA HACER PERCIBIR QUE TIENEN VOLÚMEN. REIVINDICAMOS EL ALCANCE DE ESTRA DESCRIPCIÓN CON SUS COLORES Y PARTICULARIDADES.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003632.jpg', 240),
('mixta', 'LUVENE', 'OBSERVAMOS LA PALABRA LUVENE (DEL INGLES: AMOR) ESCRITA EN LETRAS DE MOLDE CURSIVAS, ESTANDO LA LETRA L EN MAYÚSCULA Y EL RESTO DE LAS LETRAS EN MINÚSCULAS, ENCIMA DE LA ULTIMA LETRA E SE VE UNA TILDE INCLINADA HACIA LA IZQUIERDA, LA PALABRA ESTA DIBUJADA EN COLOR NEGRO EN UN FONDO BLANCO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO, LA DESCRIPCIÓN DE LOS COLORES SE HA HECHO EN CUMPLIMIENTO AL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL, FECHADO 18/11/1996.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003658.jpg', 241),
('denominativa', 'CELAFLOR', NULL, NULL, 242),
('mixta', 'MENTALINK', 'CONSISTE EN UNA ETIQUETA SOBRE UN FONDO GRIS CLARO CONFORMADA POR UNA FIGURA SEMICIRCULAR QUE ASEMEJA LA SILUETA DE UNA PERSONA DE LINEAS DELGADAS DE COLOR AZUL Y EN LA CONTRAPCARA UNA LINEA CIRCULAR LIGERAMENTE MAS GRUESA DE COLOR AZUL CLARO. DENTRO DE LA FIGURA SE MUESTRA UN EXAGONO DE LINEAS DE COLOR AZUL OSCURO CON SEIS EXTENSIONES TAMBIEN DE COLOR AZUL DOBLADAS DURANTE SU RECORRIDO Y CULMINANDO CON UN CIRCULO AZUL OSCURO CON FONDO GRIS CLARO. DENTRO DEL EXAGONO SE REPRODUCE UNA FIGURA CIRCULAR DE COLOR AZUL CLARO CON VARIOS SEMICIRCULOS CON LIGEROS CORTES EN SUS EXTREMOS. EN LA PARTE INFERIOR DE LA FIGURA, SE REPRODUCE LA PALABRA \"MENTALINK\" (LINK TRADUCIDO DEL INDIOMA INGLÉS AL ESPAÑOL SIGNIFICA: ENLACE) ESTANDO LA PALABRA \"MENTA\" EN COLOR AZUL OSCURO Y LINK EN AZUL CLARO. SE REIVINDICAN LOS DISEÑOS, FORMAS Y COLORES.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024003960.jpg', 243),
('mixta', 'ZETA´S MOTORCYCLE PARTS', 'CONSISTE EN UN CIRCULO DE FONDO COLOR BLANCO, QUE EN EL TERCIO SUPERIOR TIENE DOS LINEAS QUE CONFLUYEN Y LUEGO SE UNEN DE MANERA ASCENDENTE, FORMANDO UNA V INVERTIDA Y A LOS LADOS DOS PUNTAS SEMEJANDO SER UNA CORONA Y EN LOS DOS TERCIOS INFERIORES, TIENE UNA ZETA DEL LADO IZQUIERDO Y UNA Z INVERTIDA DEL LADO DERECHO Y ENTRE AMBAS UNA FIGURA QUE SEMEJA SER UN EMBUDO APUNTANDO HACIA ABAJO, TANTO EN LA PARTE SUPERIOR E INFERIOR DEL CIRCULO ASI COMO PARTE DE LAS Z Y EL EMBUDO SE OBSERVA LA PRESENCIA DEL COLOR GRIS, DEBAJO DE LA FIGURA DESCRITA SE LEE LA PALABRA ZETA´S MOTORCYCLE PARTS EN LETRAS DE COLOR BLANCO DE TRAZOS GRUESOS Y SOBRE UN FONDO MUY TENUE DE COLOR GRIS, QUE TRADUCIDO AL CASTELLANO SIGNIFICA ZETA´S PARTES DE MOTOCICLETAS, NO SE REIVINDICAN LAS PALABRAS, TERMINOS O FIGURAS QUE PUDIERAN RESULTAR GENERICOS O DESCRIPTIVOS, MAS SI SE REIVINDICAN LOS COLORES', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024004466.jpg', 244),
('mixta', 'MI REGALO PA CHAVEZ ES VOTANDO', 'EL LOGOTIPO CONSISTE EN LA FRASE \"MI REGALO PA CHAVEZ ES VOTANDO\" DE LAS CUALES EN LA PARTE SUPERIOR SE DISTINGUE QUE LAS PALABRAS \"MI\" Y \"PA\" SON EN LETRA CURSIVA Y COLOR NEGRO, LA PALABRA \"REGALO\" ES DE COLOR ROJO CON UN LEVE OSCURECIMIENTO HACIA LA DERECHA Y LA PALABRA \"CHAVEZ\" ES COMPLETAMENTE EN MAYUSCULA Y DE COLOR AZUL, CON UN LEVE OSCURECIMIENTO HACIA LA PARTE IZQUIERDA, DEBAJO SE PUEDE LEER LAS PALABRAS \"ES\" Y \"VOTANDO\", IGUALMENTE EN LETRA CURSIVA Y COLOR NEGRO, ESTA ULTIMA SE ENCUENTRA SUBRAYADA Y VIENE SEGUIDA DE DOS SIGNOS DE EXCLAMACION. SE REIVINDICA LA TOTALIDAD DEL LOGOTIPO INCLUYENDO SUS COLORES Y NO LOS ELEMENTOS QUE LOS CONSTITUYEN DE FORMA SEPARADA.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024004614.jpg', 245),
('mixta', 'HO.LA', 'Consiste en una figura triangular que es dividida en dos por una línea blanca en el centro y esta misma línea se ensancha en la parte inferior. Esta triangulo descrito anteriormente tiene en sus parte interior varias líneas de color blanco de trazos fino que subdivide a esta figura en varias en varias figuras geométricas de color azul de varia tonalidades como azul oscuro, claro y oro de mayor claridad. En la parte inferior de este triangulo subdividido podemos ver una figura que se entrecruza de color gris y de esta unión se ve una figura en forma de rombo de color gris oscuro. En la parte inferior de las figuras antes descrita encontramos las letras HO que en química significa o equivale al elemento HOLMIO Es un metal relativamente blando, plateado, bastante resistente a la corrosión y maleable, seguidamente encontramos un punto seguidamente de la HO y después del punto encontramos las letras LA que es la sexta nota de la escala musical. Las cuatro letras mas el punto estos escritos en trazos gruesos de color gris y en mayúscula. Se reivindica los colores, figuras y letras anteriormente descritas.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024004796.jpg', 246),
('mixta', 'PORTADAS AL DÍA', '“SE DESCRIBE UNA ETIQUETA CON UN FONDO COLOR NARANJA DONDE SE OBSERVA LA PALABRA “PORTADAS” ESCRITA EN MAYÚSCULAS DE UN TAMAÑO MUCHO MAYOR A LOS DEMÁS COMPONENTES Y SITUADA EN EL CENTRO; DEBAJO DE ESTA SE OBSERVA LA PALABRA “AL” ESCRITA EN MINISCULAS DE UN TAMAÑO MUCHO MENOR AL RESTO Y AL LADO DE ESTA SE OBSERVA LA PALABRA “DÍA” ESTAS PALABRAS SE ENCUENTRAN ESCRITAS EN COLOR BLANCO; LAS PALABRAS DESCRITAS SE ENCUENTRAN SOBRE UN CIRCULO NARANJA CON DEGRADADO AMARILLO Y ESTE CIRCULO A LOS LADOS TIENE DOS FIGURAS QUE SIMULAN SER DOS SEMICIRCULOS DE COLOR NARANJA DEGRADADO A ROJO CON UNA FRANJA DELGADA DE COLOR VERDE. SE REIVINDICA EL CONJUNTO DESCRITO INCLUYENDO LOS COLORES, CON INDEPENDENCIA DEL TAMAÑO. Y NO ASÍ LA PALABRA GENÉRICA “DÍA”, TODO DE ACUERDO A LOS FACSÍMILES QUE SE ACOMPAÑAN”.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024004891.jpg', 247),
('mixta', 'FEITIAN', 'EL SIGNO QUE SE PRESENTA A CONTINUACIÓN SE ENCUENTRA CONFORMADO POR LA PALABRA DE FANTASÍA «FEITIAN», LA CUAL, NO POSEE TRADUCCIÓN ALGUNA AL IDIOMA CASTELLANO NI TIENE UN SIGNIFICADO ESPECÍFICO Y, EN SU CONJUNTO, NO TIENE NINGÚN SIGNIFICADO EN EL COMERCIO O LA INDUSTRIA PERTINENTE O APLICADA A LOS PRODUCTOS ENUMERADOS EN LA SOLICITUD. LA PALABRA SE ENCUENTRA ESCRITA EN LETRAS MAYÚSCULAS, DE MOLDE, DE COLOR NEGRO, DE TRAZOS GRUESOS, CON UNA TIPOGRAFÍA ESPECIAL, POSICIONADA DE FORMA HORIZONTAL, SOBRE UN FONDO DE COLOR BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO EN SU TOTALIDAD SIN REIVINDICAR NINGÚN ELEMENTO QUE, DE FORMA AISLADA, PUEDA SER CONSIDERADO GENÉRICO O DESCRIPTIVO EN LA CLASE SOLICITADA.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024004983.jpg', 248),
('denominativa', 'APPLE SPORTS', NULL, NULL, 249),
('denominativa', 'KERAKOLL', NULL, NULL, 250),
('mixta', 'PERFECT SENSE', 'LA IMAGEN ESTA COMPUESTA POR UN FONDO BLANCO UN ELEMENTO GRAFICO Y UN TEXTO EN COLOR NEGRO EL ELEMENTO GRAFICO UBICADO EN EL LADO IZQUIERDO DE LA IMAGEN COMPUESTO POR FIGURAS GEOMETRICAS CONSISTE EN UNA REPRESENTACIÓN ESTILIZADA DE TRES (3) CAPAS SUPERPUESTAS LA CAPA SUPERIOR DA LA ILUSION OPTICA DE FORMA DE DIAMANTE POR DEBAJO HAY OTRAS DOS CAPAS ANGULADAS QUE DAN LA SENSACION DE PROFUNDIDAD O TRIDIMENSIONALIDAD Y LA CAPA CENTRAL TIENE LINEAS HORIZONTALES QUE SUGIEREN TEXTURA A LA DERECHA DE LA GRAFICA SE ENCUENTRA EL TEXTO. COMPUESTO POR DOS PALABRAS PERFECT SENSE PERFECTA SENSACIÓN) AMBAS PALABRAS ESCRITAS EN TIPOGRAFIA SANS-SERIF NEGRITA LA PALABRA PERFECT QUE SIGNIFICA PERFECTA ESCRITA CON LA LETRA P EN MAYUSCULA Y LA LETRAS ERFECT MINUSCULAS Y CON LA CARACTERISTICA QUE LA SEGUNDA E TIENE UNA LEVE INCLINACION QUE REPRESENTA LO DIFERENTE, NUEVO, NOVEDOSO, ADEMAS EL TAMAÑO DE LA FUENTE ES LIGERAMENTE MAS GRANDE CON RESPECTO DE LA PALABRA SENSE POR OTRA PARTE LA PALABRA SENSE QUE SIGNIFICA SENSACION SE ENCUENTRA ESCRITA CON LA S INICIAL EN MAYUSCULA Y LAS LETRAS ENSE EN MINUSCULAS', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024005075.jpg', 251),
('denominativa', 'GIOVANNI SCUTARO MILANO', NULL, NULL, 252),
('denominativa', 'PEPECOOL', NULL, NULL, 253),
('grafica', NULL, 'LETRAS EN MAYUSCULAS EN COLORES AZULES Y VERDES', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024005286.jpg', 254),
('denominativa', 'ANTADYS', NULL, NULL, 255),
('mixta', 'ROC', 'CONSISTE EN UN ISOLOGO DE FONDO DE COLOR NEGRO QUE EN EL CENTRO SE APRECIA UNA SILUETA ANIMAL DE COLOR BLANCO QUE SE ASEMEJA A LA CABEZA DE UN GALLO EL MISMO SE ENCUENTRA EN DIRECCIÓN HACIA LA DERECHA, EL PLUMAJE DEL CUELLO SE APRECIA DE MANERA PUNTEAGUDAS EL OJO SE ENCUENTRA UN POCO CERRADO DEBAJO DE EL UN PEQUEÑO RAYO DE COLOR BLANCO, DEL LADO DERECHO DEL PICO SE OBSERVA UN PEQUEÑO PUNTO DE COLOR BLANCO DEBAJO DE LA FIGURA ANIMAL SE APRECIAN LAS LETRAS (ROC) ESCRITAS DE COLOR BLANCO Y REPRESENTANDO UNA PALABRA DE FANTASÍA SIN NINGÚN SIGNIFICADO. SE REIVINDICAN LOS COLORES, FORMAS Y DISEÑOS PRESENTADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024005392.jpg', 256),
('mixta', 'MOLLY', 'LA FIGURA ESTA REPRESENTADA POR UN ISOLOGO, ES UN CIRCULO DE COLOR ROJO CLARO, DENTRO DE ESTE SE PUEDE OBSERVAR UN GRUPO DE LETRAS QUE FORMAN LA PALABRA MOLLY EN TRAZOS GRUESOS DE COLOR BLANCO, A SU AL REDEDOR SE PUEDE APRECIAR UN GRUPO DE LINEAS EN TRAZOS GRUESOS DE COLOR BLANCO QUE ESTÁN EN FORMAS DE CIRCULO SOBRE EL TEXTO SE PUEDE DECIR CON SON SEMICÍRCULOS INCLINADOS MAS AL COSTADO IZQUIERDO DE LA PALABRA, ENTRE EL SEMICÍRCULO MAS ESPECÍFICAMENTE SOBRE LAS LETRAS LL SE PUEDE OBSERVAR UN CIRCULO PEQUEÑO DE COLOR BLANCO, TODO ESTE CONJUNTO SE REIVINDICA, ASÍ COMO SU COLORES, A EXCEPCIÓN DE ELEMENTOS QUE POR USTEDES PUDIERAN SER TOMADOS COMO GENÉRICOS, LA PALABRA MOLLY ES UNA PALABRA DE FANTASÍA(COMPUESTA), MOTIVO POR EL CUAL NO TIENE NINGÚN TIPO DE TRADUCCIÓN.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024005406.jpg', 257),
('mixta', 'NEXGO CLOUD', 'LOGO TIPO IMAGOTIPO, USANDO TIPOGRAFÍA SOFACHOME BOOK Y COLOR AZUL, TANTO PARA EL TEXTO COMO PARA LA IMAGEN, SE LEE DE LADO DERECHO LA PALABRA NEXGO CLOUD, EL CUAL NEXGO ES SIN NINGÚN TIPO DE TRADUCCIÓN DE COLOR AZUL Y LA PALABRA CLOUD TRADUCIDO AL ESPAÑOL SIGNIFICA NUBE, Y DEL LADO IZQUIERDO UN GRUPO DE LINEAS SOBREPUESTAS ENTRE SI DE COLOR AZUL, SE REIVINDICA EL CONJUNTO DESCRITO, A EXCEPCIÓN DE AQUELLOS ELEMENTOS QUE PUEDAN SER TOMADOS COMO GENÉRICOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024005412.jpg', 258),
('denominativa', 'GLICEMIN', NULL, NULL, 259),
('mixta', 'VDI', 'EL LOGO VDI ES UNA COMBINACION DE LA ABREVIATURA DE VENEZOLANA DE INGENIERIA PARA PRODUCTOS DE INGENIERIA ELECTRICA, ELECTRONICA Y TELECOMUNICACIONES , CON LETRAS NEGRAS Y FONDO BLANCO', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006078.jpg', 260),
('mixta', 'JUEGOS INDIGENAS', 'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO EN EL CUAL SE ENCUENTRA DISPUESTA UNA FIGURA CARACTERISTICA CON DISEÑO CARACTERISTCIO Y PARTICULAR ASIMETRICO, EN COLOR BLANCO SOBRE FONDO VINOTINTO POSEE UNS CIRCULOS PEUQEÑOS, EN EL CENTRO UNA LINEA CARACOL DE COLOR VINOTINTO Y EN LA PARTE SUPERIOR DERECHO LAS SIGLAS FVF DE MENOR TAMAÑO, COLOR BLANCO EN MAYUSCULA. SEGUIDO DE ESTE ELEMENTO SE ENCUENTRA EK NOMBRE JUEGOS INDIGENAS, DE GRAN TAMAÑO DISPIESTA EN LETRAS MAYUSCULAS TRAZO GRUESO Y LETRAS CARACTERISTICAS COLOR VINOTINTO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006104.jpg', 261),
('mixta', 'FVF', 'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO EN LA CUAL EN LA PARTE LATERAL IZQUIERDA SE OBSERVA EL EMBLEMA CARACTERISTICOS DE LA FEDERACION VENEZOLANA DE FUTBOL, ESTE EMBLEMA ES DE COLOR VINOTINTO CON LETRAS COLOR DORADAS, TIENE UN FINA LINEA QUE DELINEA TODO EL EMBLEMA EN COLOR DORADO, SE ENCUENTRA UNAS FRANJAS QUE ASEMEJAN SER LA BANDERA EN COLOR AMARILLO AZUL Y ROJO Y SOBRE ESTAS FRANJAS SE ENCUENTRAN DISPUESTAS 8 ESTELLAS COLOR BLANCO. SEGUIDAMENTE JUSTO AL LADO SE OBSERVAN DE GRAN TAMAÑO LAS SIGLAS FVF MAYUSCULAS DE TRAZO GRUESO, LETRA TIPO IMPRENTA DE COLOR DORADO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006140.jpg', 262),
('mixta', 'XTREME PERFORMANCE', 'CONSISTE EN LA REPRESENTACION GRAFICA DEL NOMBRE XTREME PERFORMANCE ESCRITA DE LA SEGUIENTE MANERA: LA PALABRA XTREME ESCRITA ASI: LA LETRA X EN MAYUSCULA Y EL RESTO DE LA PALABRA ES DECIR LAS LETRAS T,R,E,M,E EN MAYUSCULAS, CON UNA TIPOGRAFIA ARIAL BLACK DE COLOR NEGRO PANTONE 100% NEGRO. JUSTO ARRIBA DE LA PALABRA XTREME ENCONTRAMOS DENTRO DE UNA CIRCUNFERENCIA DE COLOR NEGRO UNA FIGURA QUE REPRESENTA LA LETRA PRINCIPAL DE LA MARCA, LA LETRA X, LA CUAL ESTA FUSIONADA CON DOS COLORES, EN SU LADO IZQUIERDO AMARILLO PANTONE 368C Y DEL LADO DERECHO NARANJA PANTONE 166C. SEGUIDAMENTE ENCONTRAMOS JUSTO DEBAJO DE LAS LETRAS M,E LA PALABRA PERFORMANCE, ESCRITA DE LA SIGUIENTE MANERA: LA LETRA P EN MAYUSCULA Y EL RESTO DE LA PALABRA, ES DECIR LAS LETRAS, E,R,F,O,R,M,A,N,C,E EN MAYUSCULAS CON UNA TIPOGRAFIA ARIAL BOLD ITALIC DE COLOR BLANCO Y CON UNA FRANJA DE COLOR NEGRO PANTONE 100% NEGRO PARA RESALTAR LA PALABRA. SE REIVINDICA TANTO LOS COLORES COMO LA PALABRA XTREME PERFORMANCE EN SU TOTALIDAD.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006328.jpg', 263),
('mixta', 'HIPOCAMPO SALA SHOW', 'ISÓLOGO DE FONDO COLOR BLANCO, COMPUESTO POR LAS LETRAS MAYÚSCULAS Y TIPO MOLDE \\\\\\\"H\\\\\\\", \\\\\\\"I\\\\\\\", \\\\\\\"P\\\\\\\", \\\\\\\"O\\\\\\\", \\\\\\\"C\\\\\\\", \\\\\\\"A\\\\\\\", \\\\\\\"M\\\\\\\", \\\\\\\"P\\\\\\\", Y \\\\\\\"O\\\\\\\" FORMANDO ASÍ LA PALABRA \\\\\\\"HIPOCAMPO\\\\\\\", EN UN TONO COLOR DORADO QUE SE DEGRADA EN UN TONO MÁS OSCURO DESDE LA PARTE MEDIA DE CADA LETRA HASTA SU PARTE INFERIOR HACIENDO VER CADA LETRA DE FORMA METALIZADA Y DANDO PROFUNDIDAD.LA LETRA \\\\\\\"C\\\\\\\" SE FORMA GRACIAS A LA PARTE GRÁFICA DEL CONJUNTO LA CUAL SE ENCUENTRA REPRESENTADA POR LA SILUETA DE UN HIPPOCAMPUS O CABALLO DE MAR, UBICADO EN SU PERFIL IZQUIERDO A OJO DEL OBSERVADOR, NOTANDO EN SU PARTE SUPERIOR LA SILUETA DE SU TROMPA, Y CRESTA DORSAL CON UNA PEQUEÑA LÍNEA CURVA QUE ASEMEJA SER EL OJO, SU DORSO Y CUERPO SE ENCUENTRAN CONSTITUIDOS POR UNA LARGA CURVA QUE ATRAVIESA A LA LETRA \\\\\\\"A\\\\\\\" HASTA LLEGAR A SU COLA EN LA LETRA \\\\\\\"M\\\\\\\", EN MEDIO DE ESTA CURVA SE MUESTRA LO QUE PARECE SER UNA ALETA DORSAL DE TAMAÑO MEDIA, TODA LA SILUETA ES DE UN TONO COLOR AZUL QUE COMIENZA EN SU PARTE SUPERIOR SIENDO DE UN TONO CLARO HASTA CONVERTIRSE EN SU PARTE INFERIOR EN UN TONO MÁS OSCURO. EN LA PARTE BAJA DEL CONJUNTO JUSTO DEBAJO DE LA LETRA \\\\\\\" O \\\\\\\" SE OBSERVAN LAS LETRAS ITALICAS Y CURSIVAS \\\\\\\"S\\\\\\\", \\\\\\\"A\\\\\\\" , \\\\\\\"L\\\\\\\", \\\\\\\"A\\\\\\\", \\\\\\\"S\\\\\\\", \\\\\\\"H\\\\\\\", \\\\\\\"O\\\\\\\", \\\\\\\"W\\\\\\\", FORMANDO LOS TÉRMINOS \\\\\\\"SALA SHOW\\\\\\\" QUE TRADUCIDOS AL CASTELLANO SIGNIFICAN \\\\\\\"ESPECTÁCULO DE SALA\\\\\\\" EN UN TONO COLOR DORADO QUE SE DEGRADA EN UN TONO MÁS OSCURO DESDE LA PARTE MEDIA DE CADA LETRA HASTA SU PARTE INFERIOR HACIENDO VER CADA LETRA DE FORMA METALIZADA. SE REIVINDICA EL CONJUNTO DE FORMA GENERAL INCLUYENDO SUS COLORES, MÁS NO LO TÉRMINOS GENÉRICOS O DESCRIPTIVOS COMO \"HIPOCAMPO\" \"SALA\" Y \"SHOW\" QUE PUEDAN SER EVALUADOS EN SU CONCEPTUALIZACIÓN INDIVIDUAL Y SE ENCUENTRAN PRESENTES EN EL CONJUNTO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006362.jpg', 264),
('mixta', 'HUMMER', 'CONSISTE: EN UNA MARCA MIXTA CONSTITUIDA POR LA COMBINACIÓN DE UN ELEMENTO GRAFICO CON UNO DENOMINATIVO. EL CONJUNTO GRÁFICO ESTÁ REPRESENTADO POR UN RECTÁNGULO CRUZADO EN FORMA DIAGONAL POR BANDAS PARALELAS DE DISTINTO GROSOR DE COLORES VERDE – NEGRO – VERDE. EN EL INTERIOR DE LA BANDA DE COLOR NEGRO, QUE ES LA MÁS ANCHA Y LA CENTRAL, SE ENCUENTRA ESCRITA HORIZONTALMENTE LA PALABRA HUMMER (TRADUCCIÓN: “ZUMBAR”) EQUIPMENT FOR LIFE (TRADUCCIÓN: “EQUIPO PARA LA VIDA”), EN LETRAS DE MOLDE, MAYÚSCULAS, DE FORMATO GRUESO, CENTRADAS EN EL RECTÁNGULO Y DE COLOR BLANCO, EN CUYA PARTE SUPERIOR SE ENCUENTRA UN DISEÑO QUE ASEMEJA LA LETRA “H” CARACTERIZADO POR SER DE MAYOR TAMAÑO QUE EL RESTO DEL CONJUNTO, DONDE LOS PEDESTALES Y CAPITELES DE LAS COLUMNAS TERMINAN CON UNA APERTURA CAPRICHOSA Y CORONADAS CON UNA ESTRELLA, UNIDAS POR UN BRAZO QUE TERMINA EN PUNTA DE FLECHA QUE SE INSERTA EN LA COLUMNA DERECHA. SE REIVINDICA EL CONJUNTO DESCRITO, EN LA POSICIÓN COMO SE PRESENTA. SE REIVINDICA LOS COLORES INDICADOS EN ESTA DESCRIPCIÓN (BLANCO, NEGRO Y VERDE). NO SE REIVINDICAN LOS TÉRMINOS QUE PUEDAN RESULTAR GENÉRICOS Y DESCRIPTIVOS NI LAS PALABRAS EQUIPMENT FOR LIFE (TRADUCCIÓN: “EQUIPO PARA LA VIDA”) CONTENIDAS EN EL FACSÍMIL ANEXO. (PRODUCTOS NACIONALES Y/O EXTRANJEROS).', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006385.jpg', 265),
('denominativa', 'ACTYON', NULL, NULL, 266),
('mixta', 'WOLF BY EBITEN', 'CONSISTE EN UN DISEÑO EN EL CUAL SE LEE `WOLF BY EBITEN` (LOBO POR EBITEN), EN LETRAS MAYÚSCULAS, DE TRAZO GRUESO Y COLOR NEGRO, CON LA PARTICULARIDAD QUE LA PALABRA `WOLF` SE ENCUENTRA EN LA PARTE SUPERIOR Y `BY EBITEN`, EN LA PARTE INFERIOR DERECHA Y DE MENOR TAMAÑO. TODO EL CONJUNTO ANTES DESCRITO, SE ENCUENTRA DENTRO DE UN RECTÁNGULO EN SENTIDO HORIZONTAL, DE COLO GRIS CLARO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006475.jpg', 267),
('denominativa', 'FERREXEL', NULL, NULL, 268),
('mixta', 'ÜMA', 'LA ETIQUETA TIENE COMO ELEMENTO PRINCIPAL LA PALABRA DE FANTASÍA “ÜMA”, CENTRADA, EN LETRAS MINÚSCULAS, TIPO MOLDE Y TRAZO MEDIO. LA LETRA “Ü” ES DE COLOR AZUL, DONDE SE OBSERVA QUE EN CADA EXTREMO TIENE EN LA PARTE SUPERIOR UN PUNTO (.) LO CUAL ASEMEJA SER UNA DIÉRESIS (¨) DE DOS COLORES, EL PUNTO IZQUIERDO ES DE COLOR AMARILLO Y EL PUNTO DERECHO ES DE COLOR ROJO; LA LETRA “M” ES DE COLOR VERDE CLARO Y LA LETRA “A” ES DE COLOR ROJO. TODO EL CONJUNTO ANTERIORMENTE DESCRITO SE OBSERVA SOBRE UN FONDO DE COLOR VERDE OSCURO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO, Y LA COMBINACIÓN DE COLORES SEGÚN SE DESCRIBE. LA COMBINACIÓN DE COLORES SE HA HECHO EN CUMPLIMIENTO DEL AVISO OFICIAL S/N EMANADO DEL REGISTRO DE LA PROPIEDAD INTELECTUAL FECHADO 18 DE NOVIEMBRE DE 1996.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006540.jpg', 269),
('mixta', 'UDUKE', 'CONSISTE EN LA PALABRA UDUKE (TRADUCE AL CASTELLANO: DUQUE), ESCRITA EN LETRA DE IMPRENTA, MAYÚSCULA, DE TRAZO GRUESO Y DE COLOR AMARILLO, CON LA PARTICULARIDAD QUE LA LETRA U SE OBSERVA CON UN BORDE DEL QUE A SU VEZ FORMA A SU DERECHA UN RECTÁNGULO EN POSICIÓN HORIZONTAL Y DE COLOR NEGRO. EN SU LADO IZQUIERDO SE OBSERVAN TRECE ESTRELLAS DE COLOR NEGRO, CONFORMANDO UN CÍRCULO INCONCLUSO RONDEANDOLA, DENTRO DEL RECTANGULO SE OBSERVAN LAS LETRAS D, U, K, E, LA LETRA K EN SU ASTA ASCENDENTE ESTA UNIDO CON SU BRAZO DERECHO. SE REIVINDICA LA PALABRA UDUKE Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006650.jpg', 270),
('denominativa', 'MAUREL & PROM', NULL, NULL, 271),
('denominativa', 'RUTILARC', NULL, NULL, 272),
('mixta', 'EBC COLLECTION', 'CONSISTE EN UNA SERIE DE LINEAS RECTAS, DANDO FORMA A UN DIAMANTE, DE TRAZOS GRUESOS DE COLOR BLANCO. DENTRO DEL MISMO SE OBSERVA LAS LETRA EBC, EN LETRA MOLDE, MAYUSCULA Y DE COLOR BLANCO. EN LA PARTE INFERIOR CENTRAL SE LEE LA PALABRA COLLECTION TRADUCCIÓN AL ESPAÑOL RECOPILACIÓN. EN LETRA MAYUSCULA Y MOLDE, DE TRAZO COLOR BLANCO. TODA LA IMAGEN SE ENCUENTRA EN UN FONDE DE COLOR BLANCO.SE REINVIDICA EL CONJUNTO ANTES DESCRITO EN SU TOTALIDAD EXCEPTUANDO EL TERMINO COLLECTION.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006981.jpg', 273),
('mixta', 'SHOFU', 'CONSISTE EN UN CUADRADO DE COLOR NEGRO, DENTRO DE EL SE OBSERVA UN CIRCULO DE COLOR AZUL. DENTRO DE EL SE LEE SHOFU (TRADUCE AL CASTELLANO: CALIGRAFIA) ESCRITA EN LETRAS DE IMPRENTA, MAYUSCULA, DE TRAZO GRUESO, LAS LETRAS S,H,O, ESTAN SUBRAYADA POR UNA LINEA GRUESO, EL LA PARTE SUPERIOS DE LAS LETRAS O,F,U, SE OBSERVA LA SILUETA DE UNA CIUDAD Y SOBRE ELLAS DIFERENTES LINEAS IRREGULARES QUE ASEMEJAN SER UNA MONTAÑA. CON 4 SILUETAS QUE ASEMEJAN SER UNAS AVES. TODO EL CONJUNTO ANTERIORMENTE DESCRITO ES DE COLOR BLANCO. SE REIVINDICA LA PALABRA SHOFU Y TODO EL CONJUNTO DESCRITO INDICANDO LOS COLORES EN EL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024006984.jpg', 274),
('denominativa', 'ALLY', NULL, NULL, 275),
('denominativa', 'ZIU', NULL, NULL, 276),
('mixta', 'INTACO', 'CONSISTE LA ETIQUETA EN UN RECTANGULO DE COLOR ROJO, DISPUESTO DE FORMAL HORIZONTAL, EN SU INTERIOR SE DISPONE LA PALABRA DE FANTASI INTACO (PARTE DEL NOMBRE DE LA PETICIONARIA) EN LETRAS DE TIPO MOLDE, DE TRAZO GRUESO, EN MAYUSCULAS, DE COLOR BLANCO, ANTEPONIENDOSE A LA MENCIONADA PALABRA SE DISPONE LA FISURA DE UN MAPAMUNDI, EN TRAZOS BLANCOS, DONDE EVIDENCIA LA FORMA DEL CONTINENTE AMERICANO. SE REIVINDICA EL CONJUNTO EXCEPTUANDO LA FIGURA GENERICA DEL MAPAMUNDI.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024007537.jpg', 277),
('mixta', 'KUENTRO', 'Observamos la palabra KÜENTRO (palabra fantasía) escrita en letra de molde, en color negro, en un fondo de color blanco, estando la letra K en mayúscula y el resto de las letras en minúsculas, con la particularidad de que la letra U tiene dos puntos encima de ella, y está dibujada con cincos colores distintos, a saber de izquierda a derecha y partiendo de arribe, el punto y la punta superior de color rojo, debajo es de color naranja, la parte inferior de la U es verde manzana, la siguiente sección es verde turquesa y la parte superior derecha incluyendo el ponto redondo azul cielo. Se reivindica el conjunto anteriormente descrito. La descripción de colores se ha hecho en cumplimiento al aviso oficial s/n emanado del Registro de la Propiedad Intelectual, de fecha 18/11/1996.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024007778.jpg', 278),
('mixta', 'R', 'CONSISTE EN UNA ETIQUETA DE FONDO COLOR BLANCO, EN LA CUAL SER OBSERVA UN RECUADRO DE TRAZO SEMI GRUESO COLOR MARRÓN, DENTRO DE ESTE LA LETRA R CON UN DISEÑO CARACTERÍSTICO, ES DE COLOR VERDE Y DE ELLA SOBRE SOBRESALE UNA LÍNEA QUE ASEMEJA SER UN TALLO DEL CUAL SE DESPRENDEN HOJAS Y CÍRCULOS COLOR MARRÓN.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024007867.jpg', 279),
('denominativa', 'PENOTTI', NULL, NULL, 280),
('grafica', NULL, 'EL DISEÑO CONSISTE EN UNA FIGURA DE UN COCODRILO ANIMADO, DONDE PREDOMINA EL COLOR VERDE, SE PUEDE OBSERVAR SU BOCA ABIERTA, LA LENGUA DE COLOR ROJO Y DIENTES BLANCOS. EN EL DORSO SE OBSERVAN LAS ESCAMAS DEL COCODRILO EN COLOR AZUL OSCURO, EN LA PARTE POSTERIOR ES DE COLOR VERDE Y EN LA PARTE FRONTAL ES DE COLOR CREMA CON LÍNEAS NEGRAS EN FORMA HORIZONTAL, TODO EL CONTORNO DEL COCODRILO ES CON LÍNEAS NEGRAS, EN LA PARTE INFERIOR DE LA FIGURA, EN SUS DOS PATAS TRASERAS SE APRECIAN UNOS ZAPATOS EN COLOR MORADO, CON TRENZAS BLANCAS QUE LLEVAN DOS FIGURAS DE GOTAS DE COLOR BLANCO, DEBAJO DE LAS GOTAS, UNA LÍNEA GRUESA HORIZONTAL DE COLOR MORADO, SUELA DE COLOR BLANCO Y LA SILUETA DE SU CABEZA EN LA PARTE SUPERIOR DERECHA DE LOS ZAPATOS, EN LA PATA SUPERIOR DERECHA SE APRECIA UNA FIGURA QUE SIMULA LA MITAD DE UN COCO. SE REINVINDICA EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024007963.jpg', 281),
('mixta', 'MUSAI', 'CONSISTE EN UNA FIGURA IRREGULAR CONFORMADA POR DOS PARTES, UNA SUPERIOR Y LA OTRA INFERIOR UNIDAS ENTRE SÍ, CON BORDES CURVOS Y RECTOS DE TRAZO GRUESO. DEBAJO DE LA QUE SE OBSERVA LA PALABRA MUSAI (PALABRA DE FANTASÍA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCIÓN) ESCRITA EN LETRAS DE IMPRENTA, MAYUSCULAS Y MINISCULAS CON EL MISMO TAMAÑO. TODO EL CONJUNTO ANTERIORMENTE DESCRITO ES DE TRAZO GRUESO, COLOR NEGRO. SE REIVINDICA LA PALABRA MUSAI Y TODO EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN EL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024008038.jpg', 282),
('mixta', 'CAMEL', 'CONSISTE EN UN CÍRCULO, DE TRAZO GUESO, COLOR NEGRO Y FONDO COLOR BLANCO. DENTRO DEL QUE SE OBSERVA LA FIGURA DE UN CAMELLO, DE TRAZO FINO Y FONDO COLOR BLANCO. CON LA PARTICULARIDAD QUE SU CUELLO, PATAS, PELAJE Y COLA ESTAN CONFORMADAS POR UN TRAZO GRUESO. SUS DOS JOROBAS ESTÁN REPRESENTADAS DE FORMA ABSTRACTA POR TRAZOS CURVOS INCONCLUSOS DONDE ENCIMA DE ELLAS SE OBSERVAN 5 GOTAS Y DENTRO 5 LÍNEAS GRUESAS. DEBAJO DE LA FIGURA SE OBSERVA UN TRAZO GRUESO, RECTO, DE COLOR NEGRO QUE ASEMEJA SER LA SOMBRA DEL CAMELLO. DEBAJO DEL CONJUNTO ANTERIORMENTE DESCRITO SE LEE LA PALABRA CAMEL, ESCRITA EN LETRAS DE IMPRENTA, MAYÚSCULAS, DE TRAZO GRUESO Y COLOR NEGRO. SE REIVINDICA LA PALABRA CAMEL Y EL CONJUNTO DESCRITO CON LOS COLORES INDICADOS EN EL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024008039.jpg', 283),
('denominativa', 'CINES UNIDOS CLUB', NULL, NULL, 284),
('denominativa', 'CONECTADOS CON TU VIDA', NULL, NULL, 285),
('denominativa', 'ATTIMO', NULL, NULL, 286),
('mixta', 'TEDEXIS', 'DESCRIPCIÓN DEL DISEÑO TEDEXIS CONSISTE EN LA REPRESENTACIÓN GRÁFICA DE LA PALABRA TEDEXIS, DE TRAZO GRUESO, COLOR AZUL, ESCRITA EN MINÚSCULA. EN LA LÍNEA SUPERIOR HORIZONTAL, QUE FORMA LA LETRA T, SE OBSERVA AL LADO IZQUIERDO UN CUADRADO DE COLOR AZUL. LA LETRA I TIENE POR PUNTO UNA FIGURA CUADRADA, DE COLOR AZUL. DEL LADO INFERIOR DERECHO SE OBSERVAN DIFERENTES SÍMBOLOS LOS CUALES SON DE MULTIPLICAR, SUMA, DOS PUNTOS Y PARÉNTESIS DE CIERRE. TODOS DE COLOR AZUL Y DE MENOR TAMAÑO. TODO LO DESCRITO SOBRE UN FONDO BLANCO. SE REIVINDICA EL CONJUNTO DESCRITO, ASÍ COMO LA COMBINACIÓN DE LOS COLORES: AZUL Y BLANCO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024008587.jpg', 287),
('mixta', 'MAXPRO', 'CONSISTE EN UNA FIGURA DE FORMA CUADRADA, DE FONDO BLANCO, EN LA CUAL APRECIAMOS UNA FIGURA CIRCULAR, LA CUAL ES INTERRUMPIDA EN LA PARTE IZQUIERDA Y DERECHA. EN ESA INTERRUPCION, PODEMOS OBSERVAR QUE NACEN Y SE EXTIENDEN DOS FORMAS TRIANGULARES, SIN LOS PLANOS INFERIORES, HACIA LA PARTE CENTRAL DE LA FIGURA CIRCULAR, QUE SE ENTRECRUZAN ENTRE SÍ EN LA PARTE CENTRAL. REALIZADO EN TRAZO GRUESO Y DE COLOR ROJO. LUEGO SE LEEN EN LA PARTE INFERIOR CENTRAL INTERNA DE LA FIGURA CIRCULAR, LAS LETRAS “ M A X P R O” (PALABRA DE FANTASIA, SIN TRADUCCION ALGUNA), ESCRITA EN LETRAS DE MOLDE, MAYUSCULA, DE TRAZOS FINO Y DEL MISMO COLOR ROJO. SE REIVINDICA EL CONJUNTO DESCRITO, ASI COMO SUS COLORES.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024008821.jpg', 288),
('denominativa', 'SOFTMOVE', NULL, NULL, 289),
('mixta', '+QCAMPUS', 'EL LOGO ES PARA UNA MARCA MIXTA QUE COMBINA ELEMENTOS GRÁFICOS Y TEXTUALES. EN LA PARTE SUPERIOR IZQUIERDA, SE ENCUENTRA UNA PEQUEÑA CRUZ FORMADA POR CUATRO TRIÁNGULOS ISÓSCELES DE COLORES VIVOS: ROJO, AZUL, AMARILLO Y VERDE. ESTA CRUZ SE INSERTA EN LA PARTE SUPERIOR IZQUIERDA DE LA LETRA Q MAYÚSCULA DE COLOR AZUL ÍNDIGO, LA MISMA SE OBSERVA DE MANERA INACABADA PARA LUEGO COMPLETARSE CON EL AUXILIO DE PARTE DE LA CITADA CRUZ Y ASI COMPLETANDO SU FORMA. LA PALABRA CAMPUS, QUE SIGUE A LA Q ESTA ESCRITA EN MINÚSCULAS Y EN FUENTE KALLISTO BOLD EN EL MISMO COLOR AZUL ÍNDIGO, LA COMBINACIÓN DE LA Q Y LA CRUZ SUGIERE UN ESPACIO DINÁMICO Y EN CONSTANTE CRECIMIENTO, MIENTRAS QUE LA PALABRA CAMPUS EVOCA UN AMBIENTE EDUCATIVO Y COMUNITARIO. EL TÉRMINO CAMPUS PROVIENE DEL LATÍN Y SIGNIFICA CAMPO O LLANURA. SE REIVINDICA EL CONJUNTO DESCRITO, INCLUYENDO LOS COLORES, PERO NO SE REIVINDICAN TÉRMINOS GENÉRICOS QUE PUEDAN ENCONTRARSE EN EL CONJUNTO DESCRITO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024009191.jpg', 290),
('denominativa', 'SYNTHESIA TECHNOLOGY', NULL, NULL, 291),
('denominativa', 'ECARVIT', NULL, NULL, 292),
('mixta', 'DON VILLA', 'CONSISTE EN UN LOGOTIPO DE FONDO COLOR BLANCO, EN EL CENTRO SE APRECIA UN ROSTRO DE FIGURA HUMANA CON PERFIL DEL LADO IZQUIERDO CON UN BORDEADO DE COLOR AMARILLO, DE PIEL MORENA CON UNA GRAN SONRISA, BIGOTES Y BARBILLA DE COLOR NEGRO QUE LLEVA PUESTO UN SOMBRERO DE COLOR MARRÓN CON CUELLO DE LA CAMISA DE COLOR MARRON Y BORDEADO DE COLOR NEGRO, DEBAJO SE APRECIA LA PALABRA (DON VILLA) LIGERAMENTE INCLINADO HACIA LA IZQUIERDA, PALABRA COMPUESTA EN DELINEADO FINO DE COLOR MARRÓN LA MISMA SE ENCUENTRA ENCIMA DE UNA SUPERFICIE COLOREADA DE COLOR AMARILLO, SE REVINDICA LOS COLORES Y TODO EL CONJUNTO COMO TAL. NO REIVINDICO LOS ASPECTOS GENÉRICOS Y DESCRIPTIVOS POR SI SOLOS, AQUÍ DESCRITOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024009400.jpg', 293),
