('mixta', 'FLIGHT', 'CONSISTE EN UN DISEÑO EN EL CUAL SE LEE `FLIGHT` (VUELO) EN LETRAS ESTILIZADAS, DE TRAZO FINO, MINÚSCULAS (CON EXCEPCIÓN DE LA PRIMERA LETRA) Y DE COLOR NEGRO; CON LA PARTICULARIDAD QUE LAS LETRAS SEMEJAN SER ESCRITURA MANUSCRITA Y QUE LAS DOS PRIMERAS LETRAS Y LAS TRES ÚLTIMAS SE UNEN EN ALGÚN PUNTO DE SU TRAZO. SE REIVINDICA EL CONJUNTO ANTERIORMENTE DESCRITO Y LOS COLORES ANTES MENCIONADOS.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024009620.jpg', 297),
('mixta', 'GRAN LOGIA DE LA REPUBLICA DE VENEZUELA', 'EL DISEÑO CONSISTE EN UN CONJUNTO FORMADO POR DISTINTAS LÍNEAS Y FIGURAS IRREGULARES. EL DISEÑO COMIENZA CON DOS CIRCUNFERENCIAS DE COLOR NEGRO Y TRAZO DELGADO, SEGUIDO DE ESTO SE LEE “GRAN LOGIA DE LA REPÚBLICA DE VENEZUELA” EN EL CENTRO DEL DISEÑO SE ENCUENTRA UN CIRCULO COMPUESTO POR PEQUEÑAS LÍNEAS Y FIGURAS, EN LA PARTE DE ARRIBA SE PUEDEN VER UN CIRCULO CON TRES PUNTOS EN EL CENTRO, UN TRIÁNGULO CON UNA FIGURA IRREGULAR EN EL CENTRO QUE SEMEJA SER UN OJO HUMANO, Y UNA LÍNEA CURVA CERRADA, TODOS ESTOS CON LÍNEAS DE DISTINTOS TAMAÑOS A SU ALREDEDOR, MÁS ABAJO SE PUEDEN OBSERVAR LÍNEAS CURVAS DE DISTINTOS TAMAÑOS Y EN COMBINACIÓN CON PEQUEÑAS CIRCUNFERENCIAS, DEBAJO DE ESTAS SE ENCUENTRAN LÍNEAS RECTAS EN HORIZONTAL, DEBAJO DE ESTAS TAMBIÉN HAY LÍNEAS PERO EN ORIENTACIÓN VERTICAL Y FINALMENTE EN LA PARTE INFERIOR HAY LÍNEAS EN HORIZONTAL. TODO LO DESCRITO ES EN TRAZOS DELGADOS Y DE COLOR NEGRO. SE REIVINDICA “GRAN LOGIA DE LA REPÚBLICA DE VENEZUELA” COMO UN CONJUNTO, PERO NO SE REIVINDICA LA PALABRA VENEZUELA.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024009782.jpg', 298),
('mixta', 'ACCUMES', 'CONSISTE EN UN RECTÁNGULO HORIZONTAL DE COLOR NEGRO. EN MEDIO DEL RECTÁNGULO, SE OBSERVA UNA FIGURA TRIANGULAR SEMI ABIERTA EN SU BASE Y SEMI ABIERTA EN SU LADO IZQUIERDO QUE SIMULA SER LA LETRA /“A”/. ESTA FIGURA TRIANGULAR, ESTÁ FORMADA POR LÍNEAS GRUESAS, DE DERECHA A IZQUIERDA, LA PRIMERA DE COLOR BLANCO, LA SEGUNDA DE COLOR NEGRO Y FINALMENTE UN TRIÁNGULO EQUILÁTERO DE COLOR ROJO. A LA DERECHA DEL CONJUNTO ANTERIORMENTE DESCRITO SE LEE: CCUMES, EL CUAL EN CONJUNTO CON EL LOGO ANTES DESCRITO SE LEE: ACCUMES (PALABRA DE FANTASÍA, TAL Y COMO SE SOLICITA NO TIENE TRADUCCIÓN), EN LETRA DE IMPRENTA, MINÚSCULA, DE TRAZO GRUESO Y DE COLOR BLANCO. SE REIVINDICA EL LOGO, LA PALABRA ACCUMES Y TODO EL CONJUNTO ANTES DESCRITO, CON LOS COLORES INDICADOS EN ÉL.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024009915.jpg', 299),
('mixta', 'SIMPLE', 'EL SIGNO SOLICITADO CONSISTE EN UN DISEÑO DONDE SE LEE LA PALABRA `SIMPLE` (SIN TRADUCCIÓN) ESCRITA EN LETRA MOLDE, MAYÚSCULA LA PRIMERA LETRA Y MINÚSCULA EL RESTO, DE COLOR BLANCO Y DE TRAZO GRUESO. EN EL LADO IZQUIERDO DEL DISEÑO, SE APRECIA UN CÍRCULO DE COLOR NARANJA QUE, EN SU INTERIOR, TIENE DOS LÍNEAS IRREGULARES Y GRUESAS DE COLOR NEGRO Y EXTREMOS REDONDEADOS, QUE ESTÁN SEPARADAS ENTRE SÍ, EN LAS QUE SOBRESALE EL HECHO QUE EN EL EXTREMO INFERIOR IZQUIERDO Y EL SUPERIOR DERECHO, CONCLUYEN CON UNAS LÍNEAS PUNTIAGUDAS, DONDE AMBAS FRANJAS, ASEMEJAN UNA LETRA S. EL CONJUNTO DE LA FIGURA Y EL TEXTO ESTÁ SOBRE UN RECTÁNGULO SÓLIDO DE COLOR NEGRO (SENTIDO HORIZONTAL). SE REIVINDICA EL CONJUNTO DESCRITO Y LA EXACTITUD DE LOS COLORES ANTES MENCIONADOS. NO SE REIVINDICA LOS TÉRMINOS DE USO COMÚN QUE FORMAN PARTE DEL CONJUNTO SOLICITADO.', 'http://grafico.sapi.gob.ve/marcas/ef2024/2024009938.jpg', 300);
